and one another.\n','Facilitating communications','2019-01-14 13:46:40','2019-01-14 13:46:40','통신 촉진',NULL,3),(13,'Contributing ideas and suggestions to the group.','Ideas and suggestions','2019-01-14 13:46:40','2019-01-14 13:46:40','아이디어 및 제안',NULL,3),(14,'Bringing new and relevant information to the group.','New information','2019-01-14 13:46:40','2019-01-14 13:46:40','새로운 정보',NULL,3),(15,'Interpreting, consolidating and integrating ideas and information into a useful result.\n','Integrating ideas','2019-01-14 13:46:40','2019-01-14 13:46:40','아이디어 통합',NULL,3),(16,'Accepting suggested tasks and/or volunteering for new ones.\n','Accepting tasks','2019-01-14 13:46:40','2019-01-14 13:46:40','과제 수락',NULL,3),(17,'Performing assigned tasks on time and/or notifying the group in a timely  fashion when assigned tasks cannot be completed for any reason (e.g. wrong task, insufficient information, insufficient time, etc.)\n','Time-sensitive','2019-01-14 13:46:40','2019-01-14 13:46:40','시간에 민감한',NULL,3),(18,'Asking questions relevant to understanding the group\'s goals or how to achieve  them. This includes questions aimed at understanding teammates\' ideas and  suggestions.\n','Relevant questions','2019-01-14 13:46:40','2019-01-14 13:46:40','관련 질문',NULL,3),(19,'Representing or demonstrating the group\'s progress, goals and/or positions  effectively and accurately to non-members (orally, visually or otherwise).\n','External communications','2019-01-14 13:46:40','2019-01-14 13:46:40','외부 커뮤니케이션',NULL,3),(20,'Managing the development of, adherence to and revision of the group\'s specific timeline.\n','Timeline management','2019-01-14 13:46:40','2019-01-14 13:46:40','타임 라인 관리',NULL,3),(21,'Suggesting allocation of resources (team members, materials, etc.) to individual task completions.\n','Allocating resources','2019-01-14 13:46:40','2019-01-14 13:46:40','자원 할당',NULL,3);
