INSERT INTO `quotes` VALUES (1,'Alone we can do so little; together we can do so much.','Helen Keller','2019-01-14 13:46:41','2019-01-14 13:46:41'),(2,'If I have seen further, it is by standing on the shoulders of giants.\n','Isaac Newton','2019-01-14 13:46:41','2019-01-14 13:46:41'),(3,'No one can whistle a symphony. It takes a whole orchestra to play it.','H.E. Luccock','2019-01-14 13:46:41','2019-01-14 13:46:41'),(4,'Coming together is a beginning, staying together is progress, and working together is success.\n','Henry Ford','2019-01-14 13:46:41','2019-01-14 13:46:41'),(5,'Talent wins games, but teamwork and intelligence win championships.','Michael Jordan','2019-01-14 13:46:41','2019-01-14 13:46:41'),(6,'The strength of the team is each individual member. The strength of each member is the team.\n','Phil Jackson','2019-01-14 13:46:41','2019-01-14 13:46:41'),(7,'There is no such thing as a self-made man. You will reach your goals only with the help of others.\n','George Shinn','2019-01-14 13:46:41','2019-01-14 13:46:41'),(8,'It is literally true that you can succeed best and quickest by helping others to succeed.\n','Napolean Hill','2019-01-14 13:46:41','2019-01-14 13:46:41'),(9,'The whole is other than the sum of the parts.','Kurt Koffka','2019-01-14 13:46:41','2019-01-14 13:46:41'),(10,'The ratio of \'We\'s to \'I\'s is the best indicator of the development of a team.','Lewis B. Ergen','2019-01-14 13:46:41','2019-01-14 13:46:41'),(11,'If you want to lift yourself up, lift up someone else.','Booker T. Washington','2019-01-14 13:46:41','2019-01-14 13:46:41'),(12,'Great things in business are never done by one person; they\'re done by a team of people.\n','Steve Jobs','2019-01-14 13:46:41','2019-01-14 13:46:41'),(13,'Individually, we are one drop. Together, we are an ocean.','Ryunosuke Satoro','2019-01-14 13:46:41','2019-01-14 13:46:41'),(14,'Cooperation is the thorough conviction that nobody can get there unless everybody gets there.\n','Virginia Burden','2019-01-14 13:46:41','2019-01-14 13:46:41'),(15,'Dialogue isn\'t a competition to be the smartest or the most correct person in the room; it is a collaboration to find the truth.\n','Oli Anderson','2019-01-14 13:46:41','2019-01-14 13:46:41'),(16,'When people challenge your ideas, they help you (whether they know it or not).\n','Oli Anderson','2019-01-14 13:46:41','2019-01-14 13:46:41'),(17,'Teamwork makes the dream work.','Bang Gae','2019-01-14 13:46:41','2019-01-14 13:46:41'),(18,'None of us is as smart as all of us.','Ken Blanchard','2019-01-14 13:46:41','2019-01-14 13:46:41'),(19,'Teamwork is the secret that makes common people achieve uncommon results.','Ifeanyi Onuoha','2019-01-14 13:46:41','2019-01-14 13:46:41'),(20,'We must all hang together or most assuredly we shall all hang separately.','Ben Franklin','2019-01-14 13:46:41','2019-01-14 13:46:41'),(21,'People achieve more as a result of working with others than against them.','Dr. Allan Fromme','2019-01-14 13:46:41','2019-01-14 13:46:41'),(22,'Teamwork: A few harmless flakes working together can unleash an avalanche of destruction.\n','Justin Sewell','2019-01-14 13:46:41','2019-01-14 13:46:41'),(23,'The nice thing about teamwork is that you always have others on your side.\n','Margaret Carty','2019-01-14 13:46:41','2019-01-14 13:46:41'),(24,'When he took time to help the man up the mountain, lo, he scaled it himself.','Tibetan Proverb','2019-01-14 13:46:41','2019-01-14 13:46:41'),(25,'When spider webs unite, they can tie up a lion.','Ethiopian Proverb','2019-01-14 13:46:41','2019-01-14 13:46:41'),(26,'It\'s a very important thing to learn to talk to people you disagree with.\n','Pete Seeger','2019-01-14 13:46:41','2019-01-14 13:46:41'),(27,'No member of a crew is praised for the rugged individuality of his rowing.','Ralph Waldo Emerson','2019-01-14 13:46:41','2019-01-14 13:46:41'),(28,'You don\'t get harmony when everybody sings the same note.','Doug Floyd','2019-01-14 13:46:41','2019-01-14 13:46:41'),(29,'In teamwork, silence isn\'t golden. Its deadly.','Mark Sanborn','2019-01-14 13:46:41','2019-01-14 13:46:41'),(30,'If you try and we lose, then it isn\'t your fault. But if you don\'t try and we lose, then it\'s all your fault.\"\n','Orson Scott Card','2019-01-14 13:46:41','2019-01-14 13:46:41'),(31,'There is little success where there is little laughter.','Andrew Carnegie','2019-01-14 13:46:41','2019-01-14 13:46:41'),(32,'A major reason capable people fail to advance is that they don\'t work well with their colleagues.\n','Lee Iacocca','2019-01-14 13:46:41','2019-01-14 13:46:41'),(33,'It takes two flints to make a fire.','Louisa May Alcott','2019-01-14 13:46:41','2019-01-14 13:46:41'),(34,'The main ingredient of stardom is the rest of the team.','John Wooden','2019-01-14 13:46:41','2019-01-14 13:46:41'),(35,'Disruption isnt about what happens to you. Its about how you respond to what happens to you.\n','Jay Samit','2019-01-14 13:46:41','2019-01-14 13:46:41'),(36,'As a coach, I play not my eleven best, but my best eleven.','Knute Rockne','2019-01-14 13:46:41','2019-01-14 13:46:41'),(37,'I suppose leadership at one time meant muscles, but today it means getting along with people.\n','Mohandas Ghandi','2019-01-14 13:46:41','2019-01-14 13:46:41'),(38,'I\'m not the smartest fellow in the world, but I sure can pick smart colleagues.\n','Franklin D. Roosevelt','2019-01-14 13:46:41','2019-01-14 13:46:41'),(39,'Sometimes the most ordinary things could be made extraordinary simply by doing them with the right people.\n','Nicholas Sparks','2019-01-14 13:46:41','2019-01-14 13:46:41'),(40,'Collaborate with people you can learn from.\n','Pharrell','2019-01-14 13:46:41','2019-01-14 13:46:41'),(41,'When we learn how to work together versus against each other things might start getting better.\n','Alex Elle','2019-01-14 13:46:41','2019-01-14 13:46:41'),(42,'It takes both sides to build a bridge.\n','Fredrik Nael','2019-01-14 13:46:41','2019-01-14 13:46:41'),(43,'A group becomes a team when each member is sure enough of himself to praise the skills of others.\n','Norman Shidle','2019-01-14 13:46:41','2019-01-14 13:46:41'),(44,'It\'s better to have a great team than a team of greats.\n','Simon Sinek','2019-01-14 13:46:41','2019-01-14 13:46:41'),(45,'The chain is only as strong as the weakest link  \n','Thomas Reid','2019-01-14 13:46:41','2019-01-14 13:46:41'),(46,'A single leaf working alone provides no shade.\n','Chuck Page','2019-01-14 13:46:41','2019-01-14 13:46:41'),(47,'The way to achieve your own success is to be willing to help somebody else get it first.\n','Iyanla Vanzant','2019-01-14 13:46:41','2019-01-14 13:46:41'),(48,'We rise by lifting others.\n','Robert Ingersoll','2019-01-14 13:46:41','2019-01-14 13:46:41'),(49,'If you take out the team in teamwork, it’s just work. Now who wants that?\n','Matthew Woodring Stover','2019-01-14 13:46:41','2019-01-14 13:46:41'),(50,'I don’t like that man. I must get to know him better.\n','Abraham Lincoln','2019-01-14 13:46:41','2019-01-14 13:46:41'),(51,'It is amazing what you can accomplish if you do not care who gets the credit.\n','Harry S. Truman','2019-01-14 13:46:41','2019-01-14 13:46:41');
/*!40000 ALTER TABLE `quotes` ENABLE KEYS */;
UNLOCK TABLES;

