INSERT INTO `weeks` VALUES (1,4,1,'<p> In group time, we began by setting up weekly team meetings. My group\nseems to be nice, and Anika and I shared one of our big lecture courses\nlast semester. Lionel says he just transferred into this school. The\nproject is pretty big and fairly open-ended, so we brainstormed topic ideas\nfor the rest of the time. </p>\n\n<p> Anika was pretty quiet &mdash; maybe she suggested an idea or two.\nEveryone else seemed to have a lot to say, though. Natasha\'s ideas almost\nalways made me laugh. She seems to be working hard to get outside the box\nand mostly she did it. This meant that many of her ideas weren\'t really\nuseable, but they were fun and often they helped me to come up with other\nideas, too. Toward the end of our meeting, Lionel noticed that no one was\ntaking notes, so we recounted the ideas we could remember while he wrote\nthem down and we discussed those 14 ideas. </p>\n\n<p> Before the meeting ended, we crossed off the ones that didn\'t seem to\nwork (this got rid of most of Natasha\'s) and ultimately narrowed it down to\nsix. I recommended we each look for resources on all the topics to get\nfamiliar with them. Next week, we will report back and select a topic.\nEveryone agreed with this, so we had a plan. </p>\n\n<p> After searching for about half an hour, it was pretty clear that only\ntwo of the topics really work for this project, so I focused on those. I\nfigure that if we are all working on this independently, we are likely to\ncome up with many of the same materials, so I tried not to spend too much\ntime on the ones I found easily, but rather to dig deeper instead. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(2,4,2,'<p> Anika found a lot of materials for one of the topics that I had a rough\ntime with, but Lionel and Natasha also focused on the same two as me. We\nended up with a lot of duplication, but at least we all know those topics.\nWhen we dug into what Anika found for the third topic, I couldn\'t see how\nwe would be able to use much of it &mdash; the research mostly just had\nmentions of what we needed. Even Anika seemed to mostly dismiss the topic,\nand our discussion quickly centered on our most promising two topics. </p>\n\n<p> There was a lot of discussion about which to choose &mdash; everyone\nhad an opinion. Then Natasha suggested that we try to combine them. We\nwasted about ten minutes trying to see if we could make that work, but\nultimately we couldn\'t and wound up back where we started. Our first vote\nwas split down the middle, so I decided to make a list of pros and cons. I\nmay have conveniently skewed the list in favor of my preference, but either\nway, our next vote was unanimous. Alex immediately pointed out that the\nother topic, although more exciting on the surface, would have probably\nbeen much more complicated and difficult. </p>\n\n<p> The obvious next step was to find more materials on our selected topic,\nso we figured out the major subtopics and divided them amongst ourselves.\nWe decided everyone would return next week with summaries of what they\'d\nfound to make it easier for the group to get moving quickly. To make sure\nwe didn\'t wind up with a million competing summaries for the many duplicate\nmaterials, I split up the materials we\'d already got among us. </p>\n\n<p> I found some more materials and then spent about half an hour writing\nthose summaries. The project would be big, but it is pretty straightforward\nso far. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(3,4,3,'<p> During our meeting, we began sorting through the materials. Lionel\'s\nand Natasha\'s materials were in good shape. At one point, Natasha misread\none of Lionel\'s summaries and made everyone laugh, but it was a pretty\nlucky mistake. In the ensuing conversation, a whole new light was shone on\nthe topic. I\'m not sure if that\'s what Natasha intended, but if so, it was\nbrilliant.  </p>\n\n<p> I guess I should have spent more time writing because no one understood\nwhat I wrote. I\'m not used to working in groups, and I guess I forget to\nexplain everything. I just wrote down my observations (which, in this case,\nI could have used to write my own paper), but it wasn\'t complete and I had\nto explain it for the rest of the group. They did like my observations,\nthough! I told them I\'d rework them for next week.  </p>\n\n<p> Anika\'s summaries, on the other hand, were just a sentence or two each.\nInitially, she seemed to think they would be useful to us. After some\nawkward questions, I asked her point blank if she\'d prefer to use Natasha\'s\nsummaries or her own to write the paper, and she understood. The question\nwas a bit blunt, but if Anika was offended, she didn\'t show it. I suspect\nit helped that we all had things to do to improve our work for next week.\n</p>\n\n<p> I restructured my summaries this week to look more like summaries than\nmy own notes. When I was done, I asked my roommate to take a look, and he\nhad a few good questions that I subsequently addressed. All told, it took\nme about an hour and forty-five minutes. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(4,4,4,'<p> Lionel was a bit late to the meeting this week, but Anika wasn\'t there\nat all. She hadn\'t been in class and no one had heard anything from her, so\nwe weren\'t sure what was going on.  </p>\n\n<p> When it looked like she wouldn\'t be coming, we began working through my\nupdated materials. Lionel and Natasha were both much happier this time.\nLionel pointed out that they could use some editing, but that they were\nmuch improved. He made a point of saying he really liked some of the\nobservations I\'d made. He volunteered to try to redo Anika\'s work and\nassemble what we had for the assignment due next week, but Natasha said\nshe\'d work on Anika\'s part and get it to him so he could include them. She\nsaid she didn\'t want him overloaded. She also asked me to put together a\nbasic outline of what the paper should look like. What a smart idea! </p>\n\n<p> Putting together the outline didn\'t really take a whole lot of time.\n</p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(5,4,5,'<p> Lionel turned in our assignment this week in class and Anika was there,\ntoo. It seems she\'d had to go home in a rush because her mother went to the\nhospital, but she had done her summaries and got them to Lionel in time for\nhim to include them in what he turned in. Our instructor gave us some time\nto meet as a group at the end of class, and we spent the time looking at my\noutline. Lionel seemed to be satisfied with it, but Anika and Natasha\nweren\'t. I wasn\'t really sure what they didn\'t like because we didn\'t have\nmuch time to get into it, but I tried to make some changes that evening.\n</p>\n\n<p> At our meeting, it took a while to really understand where we weren\'t\nconnecting. I thought the two of them were looking for me to make some\nchanges to what I had, but it turned out they had completely different\nideas of where this was going &mdash; from each other as well as from me!\nLionel seemed to be confused and stayed out of our discussion. I think he\nfigured it was all a simple misunderstanding that\'d get worked out quickly,\nbut he managed to be very involved in the conversation because his face is\nvery expressive. It was clear that he was being swayed by Natasha. So was\nI, for that matter. After about half an hour, we modified the outline to\nlook more like what Natasha was describing. Even Anika reluctantly agreed\nthat it was probably the right way to go. </p>\n\n<p> With the outline settled, Anika suggested we split the outline up into\nquarters and each write one for next week. Lionel spoke up quickly for the\nsecond section and I took the third because I didn\'t want to write the\nintroduction or the conclusion. Fortunately, Natasha took the former and\nAnika took the latter. </p>\n\n<p> It took me about two hours to write my draft of the paper because I\njust couldn\'t seem to make everything work properly. I finally stopped when\nI had something, but it\'s hardly my best work. It just doesn\'t seem to all\nfit properly. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(6,4,6,'<p> It seems that no one was really able to make the pieces work quite\nright, so we had to rethink our approach. I had a feeling Anika would bring\nup her idea from last week, and she did. Fortunately, I\'d thought a lot\nabout that when I ran into trouble writing and was quickly able to point\nout where and how we\'d run into the same problems her way. Lionel listened\nfor a bit and then suggested that we try something that he had used on a\npast project; it was a really good idea. It would, of course, require some\nadaptation, but it could work out very well for us.  </p>\n\n<p> Natasha and Anika joined in, and we ironed it out together. It was sort\nof exciting, really. In spite of it being his idea, Lionel seemed to be\nnervous about suggesting anything, but he also contributed. About halfway\ninto our meeting, we started looking back at the pieces we\'d already\nwritten and seeing if/where they still fit. It looked like we would be left\nwith about half a paper still to write. </p>\n\n<p> This time, we each took pieces that were left to write. Anika and\nNatasha fought a bit over who took one of the tricky parts, but ultimately\nwe all wound up with pieces we could handle. </p>\n\n<p> A few days later, Lionel asked if I could help him out with one of his\npieces. I felt bad because I hadn\'t started any of my writing, but of\ncourse I said yes. We worked on it for about an hour and he answered all\nhis own questions, so I don\'t know why he needed me.  </p>\n\n<p> When we moved on to my work, he couldn\'t understand any of what I\'d\nthrown together that morning. I knew it needed work, but it was also nice\nto have him pointing out exactly where. Sometimes it\'s tough to see what\nyou\'re thinking through other people\'s eyes. I am pretty sure he helped me\nmore than I helped him, and I told him so, but he probably didn\'t believe\nme &mdash; he really doesn\'t think he\'s very smart. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(7,4,7,'<p> I was a bit late because one of my instructors offered to run a study\nsession to prepare for the midterms, and I desperately needed the help. I\nfelt bad that I forgot to tell the group last week, but when I arrived I\nlearned that everyone else had been late for similar reasons. </p>\n\n<p> In spite of this, everyone was happier with what we had this week and,\nafter running through what we had, the paper was starting to look pretty\ngood. We spent much of our time assembling the pieces into a single paper.\nWhen we did, we realized that neither the introduction nor the conclusion\nworked very well any longer. Natasha asked Lionel to write the\nintroduction, because the new structure of the paper was his idea, but I\nthink he honestly doesn\'t understand that it was true. He actually denied\nit &mdash; and I don\'t think it was because he didn\'t want to write the\npiece. When he said he\'d do it, he made Anika promise that she\'d review it\nthe following week.  </p>\n\n<p> I volunteered to rework the conclusion, but Natasha asked me instead to\nproofread and format the document, while she rewrote the conclusion. Anika\ndidn\'t have anything for the week, and I think she didn\'t want to feel like\na slacker, so she said she\'d proofread the document, as well &mdash; just\nto have an extra set of eyes on it.  </p>\n\n<p> Natasha also told us she\'d be late next week because one of her\nmidterms would run until the start of this meeting. </p>\n\n<p> Proofreading took me awhile. It\'s a good paper, but you can tell it was\nwritten by four different people. I found lots of little things, but there\nwere a few things that will need major rework. One part of what Natasha had\nwritten probably made sense when she wrote it, but the instructor\ncompletely contradicted it in class, so we\'ll have to completely rewrite\nthat piece. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(8,4,8,'<p> I thought the group would be bummed that I was so nitpicky, but they\nwere thrilled I\'d found so much stuff. Anika found good stuff, too, but I\nhad almost everything she did and then about half again as many. We decided\nthat we couldn\'t make the bigger changes in time for the draft that\'s due\nnext week. We will be able to write it, but everyone has tight schedules\nthis week. We can\'t get it written and give anyone else a chance to take a\nlook at it before we have to turn it in; no one felt that would be OK. </p>\n\n<p> Natasha showed up just as we finished going through the fixes to the\npaper. Next we looked at Lionel\'s introduction and Anika immediately asked\nwhat everyone was thinking: why was it so short? Lionel just shrugged and\nwe all read it. As it turned out, Anika shouldn\'t have said anything before\nshe read it &mdash; it covered everything it needed to and was pretty good.\nNeither Natasha nor I had any ideas for improving it. I think Anika\nfelt like she had to do something, so after she thought about it for a\nmoment, she agreed that nothing was missing, but said she had some ideas\nfor beefing it up a bit. A few minutes later we had a new version that was\nlonger and felt a bit more complete. It was good, but not really necessary.\nI suggested making a part of what Natasha added a bit more concise. </p>\n\n<p> When we were done, Anika said she\'d add in the conclusion, make the\nchanges we talked about and have a version of the paper ready to turn in\nnext week in class. Natasha said that she\'d try to make the larger changes\nthat I\'d suggested. Lionel volunteered to start building a PowerPoint for\nthe upcoming presentation. I felt bad, but asked if anyone minded if I took\nthe week off because I had to prepare for a late midterm next week in my\ntoughest subject. No one minded. </p>\n\n<p> This week I did nothing for this class outside of our meeting. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(9,4,9,'<p> Anika not only brought a copy of our paper to class for the instructor,\nbut also brought copies for each of us to look at between class and our\nmeeting. This way, we didn\'t waste our meeting time on reading through it.\nAs an added bonus, Natasha had merged her changes into this latest version.\nUnfortunately, she\'d had a difficult time making those changes and they\nwere not complete. She brought a list of questions and possible answers,\nand we spent a good twenty minutes on that before we came to any answers.\nAt some point while I was listening, I had a fantastic idea so I said I\'d\ntake it home and work on it for next week. No one argued with me. </p>\n\n<p> Next we discussed the presentation &mdash; beginning with the\nPowerPoint Lionel had put together. Before Anika could comment (because she\nalways does), Lionel pointed out that this was just a start and that he\nknew there wasn\'t much to it. He recommended that everyone claim a few\nslides and modify them when they worked on what they were going to say. At\nthis, Anika just shut her mouth and I have to admit, that was pretty\nsatisfying. She\'s not mean or anything, but it was nice to not hear her\nbeing critical for once.  </p>\n\n<p> Natasha chose a few slides, including the first one, but Lionel said he\nwanted to introduce us. I was a bit surprised, because I didn\'t figure he\'d\nvolunteer for such a visible role. Ultimately, we decided that they\'d both\ngive it a shot and see which one we like best when we practice next week.\nI\'m actually excited about making it into a bit of a competition. </p>\n\n<p> I enjoy public speaking, so I spent a long time iterating over my\ntalking points for our presentation. My roommate is probably sick of\nhearing it, but I feel good about the presentation. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(10,4,10,'<p> I liked my presentation, but Anika and Natasha both had some ideas for\nimprovement. One of Anika\'s ideas was really a good one, but most of them\nwere sort of picky. It\'s no big deal, though &mdash; while I don\'t think\nthe ideas really improve anything, they won\'t hurt either, so I\'ll make\nthem.  </p>\n\n<p> Anika and Natasha both presented well, and they took home a lot of\nfeedback, as well. Frankly, I\'m pretty sure my presentation was better than\neither of theirs. I know that we aren\'t competing against each other and we\nall have to do well, but it felt good to know that mine was good &mdash; no\nmatter what they said. </p>\n\n<p> Lionel on the other hand&hellip; I don\'t know what was going on there!\nIt looked like this was his first time building a PowerPoint, and he spent\nall his time playing with his new toy! There were animations and images and\nwords flying in and out. Every slide was completely different, too. The\nworst part was that he just read all the words off the slide! Everyone\n&mdash; especially Anika &mdash; had a lot of feedback for him. I think we\nshould have been a bit gentler with him; although he\'s really bright, he\ndoesn\'t seem to know it. I could see on his face that took it really hard.\n</p>\n\n<p> Needless to say, it wasn\'t much of a competition. Natasha\'s\nintroduction was much better than his and we had to go with her for it. I\nthink she might use some of his visual ideas, though &mdash; it looks like\nhe spent a bunch of time cropping our heads for the main slide and it was\npretty nice (if also a bit cheesy). </p>\n\n<p> After the meeting ended and Natasha and Anika left, I offered to work\nwith him and help him with his presentation, but he said no. I think he was\nembarrassed. I hope I didn\'t make him feel worse. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(11,4,11,'<p> In class, the instructor returned the drafts and we met briefly during\nclass to review it. There weren\'t many comments, and most of them were\npretty minor or issues that Natasha had already fixed. However, there was\none comment that concerned us all: a diagram might help here. I can\'t\nbelieve that this was the first time I realized that we were presenting our\ninstructor with a great big wall of text_ko:  \ntext_en! How could we have missed that?\nWe\'d definitely have things to talk about at this week\'s team meeting. </p>\n\n<p> Lionel arrived a bit late as we were talking about our complete lack of\nimages. However, while we were still at the complaining-about-it stage, he\nwas way ahead of us. He actually apologized as he pulled out a bunch of\nsketches he\'d \"thrown together.\" They were fantastic! His were done with\npencil on scraps of paper and Natasha copied them over with black pen on\nfull sheets so they were crisper and easier to see. We worked on them for\nabout half an hour, making small changes here and there. Natasha\nvolunteered create new versions to include in the document. </p>\n\n<p> We spent the rest of the meeting working through the presentation and\neveryone sounded better this week &mdash; especially Lionel. It was like he\nwas a completely different person. We all commented on the dramatic\nimprovement. I\'m not sure he quite believed it, but there was some relief\non his face. He was also more active in providing feedback to everyone\nelse. He pointed out that I\'d included something that wasn\'t actually in\nour paper. I told him where I\'d found it and he seemed glad, but not\nsatisfied. He asked if we wanted to talk in the presentation about\nsomething that we didn\'t mention in the paper. Natasha and Anika didn\'t\nthink it was a big deal, but he clearly felt like it\'s a bad idea. He\nwouldn\'t let it go, but he wasn\'t saying I needed to take it out &mdash; he\nwas asking where we should add it to the paper. I told him that I didn\'t\nthink it was a big deal and also that I didn\'t have time to do it. So, he\nsaid that he\'d add it into the paper himself. Problem solved! </p>\n\n<p> I practiced some more for the presentation, but mostly left this class\nalone because I\'m pretty sure we are in good shape. However, after giving\nit a lot of thought, I realized that Lionel had a good point. I removed\nthat piece that we spent so much time discussing in the meeting. It\ntightened things up a bit to do so and wasn\'t really needed. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(12,4,12,'<p> Lionel\'s images really added a lot to our paper, making it easier for\npeople to understand parts of it. Lionel also claimed one of the images for\none of his slides, and it worked much better than the bullet points he\'d\nhad on there. I can\'t believe we didn\'t have any images in at all until\nnow. </p>\n\n<p> This week, the presentation was much better and after another three\npractice runs, it sounded smooth. Anika managed to slow down quite a lot. I\nthink Lionel was a little bit frustrated to find that, after our argument\nlast week, I\'d removed the bit he added into the paper. I probably should\nhave told him when I made that decision. Natasha added the photos of us to\nher introduction slide, and they looked pretty good. Finally, and arguably\nmost importantly, we managed to cut it down to the correct time. </p>\n\n<p> I practiced a few more times during the week when I was able to find a\nmoment here and there. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(13,4,13,'<p> The presentation went OK, but not quite as smoothly as I\'d hoped. I was\nnervous and I think I didn\'t speak as loudly as I should have. I\'m pretty\nsure that most people heard me, but it should have been louder. Anika, on\nthe other hand, raced through her presentation and as a result, I don\'t\nthink anyone understood her. We wound up finishing up about thirty seconds\nearly.  </p>\n\n<p> Our classmates asked some good questions, which showed that our\npresentation was decent; they understood enough to ask questions. Anika,\nwho spoke last, naturally received all the questions, but she handed them\noff to whomever she felt was best suited to answer them &mdash; that was a\nnice touch. There weren\'t a lot of questions, and none of them came to me.\nWe should have discussed clothes beforehand because Lionel wore slacks and\na sports jacket, and Natasha wore a dress skirt and blouse. Anika and I\nwere dressed very casually, and it was a bit uncomfortable. </p>\n\n<p> Generally, though, I think we felt good about the work we\'d done. I\nexpect positive feedback and good grades. </p>\n\n<p> We only met briefly this week because we were mostly finished and we\nall had finals to study for, but I said I\'d go through the paper one more\ntime. We all agreed that we\'d only meet briefly next week to address any\nlarge issues I might find.  </p>\n\n<p> I spent about another hour and didn\'t find anything major &mdash; just\nlots of little stuff that I could fix without anyone else\'s input. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(14,4,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. As we went through it, Anika took\nissue with a few of the changes I\'d made. The language I used was a bit\nambiguous and it could be read to mean the opposite of what we intended.\nShe was right, but I don\'t feel badly, because I don\'t know how she noticed\nit. It took the rest of us a while to see it. Maybe it was because we all\nknow what we\'re trying to say, but once I saw it, I couldn\'t un-see it.\nWhen I finally did see it, I said I\'d fix it, but I wasn\'t really sure that\nI could. Fortunately, Anika saved me. She said she had no problem doing it\n&mdash; as long as everyone trusted her (there wasn\'t enough time for her\nto make the changes and get us all to say OK in time). Of course we all\ntrusted her and said so. </p>\n\n<p> The night before she sent it in to our instructor, Anika sent us a copy\nof the document to make sure we were all OK with it. I took a quick look\nand then wrote back to tell her to go ahead and submit it. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(15,1,1,'<p> In group time, we began by setting up weekly team meetings. My group\nmembers seem to be nice and one of them, Lionel, is a transfer student. The\nproject is pretty big and fairly open-ended, so we brainstormed topic ideas\nfor the most of the time. </p>\n\n<p> I tried to think creatively while we brainstormed. Most of what I\nsuggested wasn\'t realistic and I knew that, but I was taught that you\nshould throw out all ideas uncritically during a brainstorming session.\nThey did make the rest of the group laugh, though, and others often built\noff of them, so I think it was a success. At some point, Lionel noticed\nthat no one was taking notes, so we recounted what we could remember while\nhe wrote them down, and we discussed those. </p>\n\n<p> Before the meeting ended, we crossed off the ones that didn\'t seem to\nwork (this got rid of most of mine &mdash; haha!) and narrowed the list\ndown to six. Alex asked us to each look for resources on all the topics so\nthat next week, we will report back and select a topic together. </p>\n\n<p> This was not exactly a difficult task and it only took about an hour of\nmy time. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(16,1,2,'<p> Anika found a lot of materials for one of the topics that I had a rough\ntime with. Alex and Lionel also focused on the same two as I did. We ended\nup with a lot of duplication, but at least we all know those topics. When\nwe dug into what Anika found for the third topic, we couldn\'t see how we\nwould be able to use much of it &mdash; the research just had mentions of\nwhat we needed. Our discussion quickly centered on our most promising two\ntopics. </p>\n\n<p> There was a lot of discussion about which to choose &mdash; everyone\nseemed to have a strong opinion. I suggested that maybe we could combine\nthem into one. That didn\'t really work, but I think it helped us to see\nthem a bit differently before we settled into making decisions. Our first\nvote was split down the middle, so Alex made a list of pros and cons. That\nhelped us to put things in perspective. Our next vote was unanimous. As\nAlex pointed out, the other topic, although more exciting on the surface,\nwould have probably been much more complicated and difficult. </p>\n\n<p> The obvious next step was to find more materials on our selected topic,\nso we figured out the major subtopics and divided them amongst ourselves.\nWe decided everyone would return next week with summaries of what we\'ve\nfound to make it easier for the group to get moving quickly. To make sure\nwe didn\'t wind up with a million competing summaries for the many duplicate\nmaterials, Alex thought to split up the materials we\'d already got among\nus. </p>\n\n<p> I found some more materials this week, then I wrote my summaries. I\nprobably spent an hour on this. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(17,1,3,'<p> During our meeting, we began sorting through the materials. Lionel\'s\nand my materials were in good shape. I thought that one of Lionel\'s\nsummaries was a bit odd, but when I read it out loud to check if I was\ncrazy, I realized I was reading it wrong. I got everyone to laugh again\n&mdash; but this time it wasn\'t at all intentional. Lionel took it a bit\nfurther, however, and turned it into an interesting suggestion.  </p>\n\n<p> Alex\'s summaries, unfortunately, were confusing, and no one understood\nthem. He had to explain what he meant a lot of the time; that was\nfrustrating. He seemed a bit embarrassed and told us he\'d rewrite the\nsummaries to make them clearer.  </p>\n\n<p> Anika\'s summaries, on the other hand, were just a sentence or two each.\nInitially, she seemed to think that would be useful to us, and she couldn\'t\nseem to understand why they weren\'t. After some awkward moments, Alex asked\nher if she\'d prefer to use my summaries or her own to write the paper; I\nthink it clicked for her. We all had things to do to improve our work for\nnext week. </p>\n\n<p> It took me about twenty minutes to apply my group\'s suggestions. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(18,1,4,'<p> Anika wasn\'t at the meeting this week. She wasn\'t in class, either, and\nno one had heard anything from her. We weren\'t sure what was going on.\n</p>\n\n<p> When it was clear that she wouldn\'t be coming, we began working through\nAlex\'s updated materials; they were much improved. They could use some\nediting, but at least they make sense now, and he is obviously very smart.\nI think maybe his mind races ahead of his fingers. Lionel volunteered to\ntry to redo Anika\'s work and put what we have together for the assignment\ndue next week, but I said no. I don\'t think it\'s fair that he should be\noverloaded like that. I told him I\'d work on Anika\'s part and get it to\nLionel three days before class so he could include them. I also asked Alex\nto put together a basic outline of what the paper should look like so we\ncan get started on that. </p>\n\n<p> It took me about an hour to redo Anika\'s materials and their summaries\nand I got Lionel the materials a day early. The next day we heard from\nAnika; her mother had been ill and Anika went home to visit her in the\nhospital. In spite of this, she still managed to send us her redone\nsummaries. I expect Lionel had time to incorporate them. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(19,1,5,'<p> Lionel turned in our assignment this week in class. Our instructor gave\nus some time to meet as a group at the end of class. We reviewed the\noutline Alex put together since no one else had brought anything with them.\nAlex seemed to be satisfied with it, but Anika and I weren\'t. We didn\'t\nreally have much time to get into it, though. </p>\n\n<p> At our meeting, it took a while to really understand where we weren\'t\nconnecting. I thought that Anika and I both wanted the same thing, but it\nturned out we had completely ideas of where this was going! Alex, Anika and\nI talked for about half an hour, but Lionel mostly didn\'t say anything. I\ndon\'t know if he just didn\'t care, but he was pretty quiet. Ultimately, we\nsort of settled on my plan and modified the outline Alex had put together\nto look more like what I was describing. </p>\n\n<p> Anika then suggested we split the outline up into quarters and each\nwrite one for next week. Lionel spoke up quickly for the second section, so\nI grabbed the first part. Anika took the last, and that left the third part\nfor Alex. </p>\n\n<p> I banged my head against this assignment for over an hour before I gave\nup. This approach just wasn\'t working and I wasn\'t sure how we could fix\nit. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(20,1,6,'<p> No one was really able to make their pieces work quite right, so we had\nto rethink our approach. Anika once again brought out her initial\npreference from last time, but Alex was a step ahead of her and pointed out\nwhere we\'d run into the same problems that way. Lionel listened for a bit\nand then suggested that we try something he had used on a past project, and\nit was a really exciting idea. It would, of course, require some\nadaptation, but it could work out very well for us.  </p>\n\n<p> Anika and I ironed it out together. In spite of it being his idea,\nLionel seemed to be nervous about suggesting anything, but he did\ncontribute. About halfway into our meeting, we started looking back at the\npieces we\'d already written to see if/where they still fit. It looked like\nwe would be left with about half a paper still to write. </p>\n\n<p> This time, we each claimed pieces that were left to write. Anika took\none of the bits that I\'d already started looking at. I told her I wanted to\nwrite that one, but she wouldn\'t budge. She eventually traded with me for\nanother piece, but not the one I\'d really wanted. I just went with it\nbecause I didn\'t want to argue. </p>\n\n<p> I had a lot of writing to do this week, but I also had a lot to do in\nmy other classes, so I spread this out over two nights of about an hour and\na half each. Maybe not the most productive time in the world, but I got it\ndone. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(21,1,7,'<p> I was a bit late because it took me longer than I\'d expected to finish\nup a project due in the class immediately after our meeting. As it turned\nout, though, I wasn\'t the only one late &mdash; Alex didn\'t show up for\nabout half an hour! I guess mid-term study sessions are taking up a lot of\ntime. </p>\n\n<p> Everyone was happy with what we had this week. After running through\nwhat we had, the paper was starting to look pretty good. We spent much of\nour time assembling the pieces into a single paper. When we did, we\nrealized that neither the introduction nor the conclusion worked very well\nany longer. I figured that Lionel should write these, since he had to have\nthe best handle on it. But he responded that it wasn\'t his idea and that he\nwasn\'t comfortable with it. This seemed absurd; I reminded him that he was\nthe one who suggested this structure when we were all stuck. Eventually, he\nsaid he\'d do it but he wanted someone to review it afterward; Anika\nvolunteered.  </p>\n\n<p> Alex volunteered to rewrite the conclusion, but I was afraid his\nwriting wasn\'t very good, so I asked him instead to proofread and format\nthe document while I rewrote the conclusion. Anika didn\'t have anything for\nthe week and I think she didn\'t want to feel like a slacker, so she said\nshe\'d proofread the document, as well &mdash; just to have an extra set of\neyes on it. Before we ended the meeting, I told everyone I\'d be late next\nweek because one of my midterms would run until the start of this meeting.\n</p>\n\n<p> The conclusion was pretty straightforward, but I stupidly started off\ntrying to fix what we had; that just made a mess. When I decided to just go\nahead and rewrite the whole thing, everything fell into place nicely. I was\nable to knock it out in under an hour. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(22,1,8,'<p> I arrived just as the group finished going through the fixes to the\npaper. I figured I\'d go through it on my own later, but everyone looked\nsatisfied. </p>\n\n<p> We next looked at Lionel\'s introduction, and Anika immediately asked\nwhat everyone was thinking: why was it so short? Lionel just shrugged and\nwe all read it. As it turned out, Anika shouldn\'t have said anything before\nshe read it &mdash; it really covered everything it needed to and was\npretty good. Neither Alex nor I had any ideas for improving it.  </p>\n\n<p> I think Anika felt like she had to do something. After she thought\nabout it for a moment, she said that while nothing was missing, she had\nsome ideas for beefing it up a bit. A few minutes later, we had a new\nversion that was longer and felt a bit meatier. </p>\n\n<p> When we were done, Anika said she\'d add in the conclusion, make the\nchanges we talked about and have a version of the paper ready to turn in\nnext week in class. I, in turn, volunteered to try to make the larger\nchanges that Alex suggested. Lionel said he\'d start working on a PowerPoint\nfor the upcoming presentation. Alex asked if anyone minded if he didn\'t do\nanything this week because he has a late midterm next week in his toughest\nsubject. It made sense to me and no one seemed to mind, so we went with it.\n</p>\n\n<p> I did re-read the document this week, and Alex and Anika had done a\ngreat job with it. It took me about two hours to make the changes, though,\nbecause I had to do a bunch of research to support it. I was still left\nwith a bunch of questions that I really need the group to work out. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(23,1,9,'<p> Anika not only brought a copy of our paper to class for the instructor,\nbut also brought copies for each of us to look at between class and our\nmeeting. This way we didn\'t have to waste our meeting time on reading\nthrough it. As a result, I was able to merge my changes into the version\nAnika gave to the instructor, so everything was nicely consolidated. </p>\n\n<p> I brought the merged document, along with a list of remaining questions\nand possible answers, to our group meeting. We spent twenty minutes on that\nbefore we came to any answers. Alex was pretty quiet during most of the\ndiscussion, but after noticing something, he said he thought he had an\nidea. He tried to explain it and, in true Alex form, he didn\'t do a very\ngood job, but what I did understand seemed to make sense. I think he saw\nthat we weren\'t quite following his explanation, so he asked if he could\ntake it home and work on it for next week. I was hesitant, because he\ndoesn\'t usually explain his own ideas well, but I said OK. We still have\ntime in case it requires too much cleanup. In fact, everyone was OK with\nit. </p>\n\n<p> We next discussed the presentation &mdash; beginning with the\nPowerPoint Lionel had put together. Before Anika could comment (because she\nalways does), Lionel pointed out that this was just a start; he knew there\nwasn\'t much to it. He recommended that everyone claim a few slides and\nmodify them when they worked on what they were going to say. At this, Anika\njust shut her mouth. I have to admit, that was pretty satisfying. She\'s not\nmean or anything, but it was nice not to hear her being critical for once.\n</p>\n\n<p> I claimed a few slides, including the first one, but Lionel said he\nwanted to introduce us. I was surprised, because I didn\'t figure he\'d\nvolunteer for such a visible role. We ultimately decided that we should\nboth give it a shot and see which one we all like best when we practice\nnext week. I\'m actually excited about making it into a bit of a\ncompetition. </p>\n\n<p> While I\'m told I\'m good at it, I really hate public speaking. I wanted\nto go first because I want to get my part over with as soon as possible. I\nthink I over-prepare to avoid looking stupid. I spent about two hours\nagonizing over this two-minute presentation. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(24,1,10,'<p> Everyone\'s presentations were pretty good, except for Lionel\'s. I\'m not\nsure what was going on, but it didn\'t seem like he had prepared very much.\nHe did some fun things with his slides, but then he just read them\nverbatim. Also, I thought the slides were also quite tacky. I tried to keep\nout of it because I didn\'t want to be obnoxious, since his work was being\ncompared to mine. Anika was pretty harsh, though. I don\'t think she knows\nhow not to be, but she really should have been gentler; he\'s really bright,\nbut he doesn\'t seem to know it. I think he takes criticism pretty hard.\n</p>\n\n<p> It wasn\'t really much of a competition. I\'ll be doing the introduction\n&mdash; even Lionel voted for me to do it. I am going to try to use some of\nhis ideas to spruce up the slides though &mdash; just not quite so much. I\nespecially like what he did with images of our heads bouncing onto the\nslide. It was a bit silly, but fun. </p>\n\n<p> I spent another hour this week on my slides and practicing. I also\nenlisted my best friend to listen and give me feedback. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(25,1,11,'<p> In class, the instructor returned the drafts. We met briefly to review\nours. There weren\'t many comments, and most of them were pretty minor or\nissues that I had already fixed. There was one comment, however, that\nconcerned us all: a diagram might help here. We were presenting our\ninstructor with a great big wall of text! How did we miss that? We\'d\ndefinitely have things to talk about at this week\'s meeting. </p>\n\n<p> Lionel arrived late as we were talking about our complete lack of\nimages. While we were still at the complaining-about-it stage, though, he\nwas way ahead of us. He actually apologized as he pulled out a bunch of\nsketches he\'d \"thrown together.\" They were a great start. They were tough\nto see, so I quickly copied them over with black pen on full sheets so they\nwere crisper. We worked on them for half an hour, making small changes here\nand there. I volunteered create new versions to include in the document.\n</p>\n\n<p> We spent the rest of the meeting working through the presentation.\nEveryone sounded better this week &mdash; especially Lionel. It was like he\nwas a completely different person. We all commented on the dramatic\nimprovement. I\'m not sure he quite believed it, but there was some relief\non his face and I felt better. He was also more active in providing\nfeedback to everyone else. He pointed out that Alex had included something\nthat wasn\'t actually in our paper. Alex told him where he\'d found it and\nLionel seemed glad, but not satisfied. He asked if we wanted to talk in the\npresentation about something that we didn\'t mention in the paper. I don\'t\nthink it was a big deal because it was true, but he clearly felt like it\nwas a bad idea and he wouldn\'t let it go. He wasn\'t telling Alex to take it\nout &mdash; he was asking where we should add it to the paper. He offered\nto make the change, so we said OK. </p>\n\n<p> I practiced some more for the presentation, but mostly I already felt\ngood about that. I instead spent my time on creating new versions of the\nimages for the paper. Lionel must have spent a lot of time thinking about\nthese. I was able to make them clearer and crisper, but there wasn\'t much\nelse I could do to improve upon them, and they really add a lot to the\npaper. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(26,1,12,'<p> Everyone loved what the images did for our paper &mdash; they would\nmake it a lot easier for people to understand certain parts of it. Lionel\nalso claimed one of the images for one of his slides, and it worked much\nbetter than the bullet points he\'d had on there. I still can\'t believe we\ndidn\'t have any images in at all until now. </p>\n\n<p> The presentation was much better this week. After another three\npractice runs, it sounded smooth. I felt bad for Lionel, though, because\nafter last week\'s discussion, Alex had second thoughts and removed the\ncontroversial bit from his presentation, but didn\'t think to let Lionel\nknow, so Lionel still added it to the paper. I decided to keep Lionel\'s\nphotos of us on our introduction slide, and everyone liked that. Finally,\nand arguably most importantly, we managed to cut it down to the correct\ntime. </p>\n\n<p> I practiced a few more times during the week when I was able to find a\nmoment here and there. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(27,1,13,'<p> The presentation went OK, but not quite as smoothly as I\'d hoped. Alex\nseemed nervous and got quieter than I\'d have liked, but I\'m pretty sure\nthat most people heard him. Anika, on the other hand, raced through her\npresentation; I don\'t think anyone understood her. We wound up finishing up\nabout 30 seconds early. </p>\n\n<p> Our classmates asked some good questions, which showed that our\npresentation was decent; they understood enough to ask questions. Anika,\nwho spoke last, naturally received all the questions, but she handed them\noff to whomever she felt was best suited to answer them &mdash; that was a\nnice touch. There weren\'t a lot of questions, and none of them came to me.\n</p>\n\n<p> We should have discussed clothes beforehand; Lionel wore slacks and a\nsports jacket, and I wore a dress skirt and blouse. Anika and Alex were\ndressed very casually, and it was a bit uncomfortable. </p>\n\n<p> Generally, though, I think we felt good about the work we\'d done. I\nexpect positive feedback and good grades. </p>\n\n<p> We only met briefly this week because we were mostly finished and we\nall had finals to study for, but Alex said he had time to go through the\npaper once more. Quite frankly, he\'s the best person to do it, so no one\ndisagreed. We also agreed that we\'d only meet briefly next week to make\nsure Alex didn\'t find any huge problems. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(28,1,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. As we went through it, Anika took\nissue with a few of the changes Alex made. It didn\'t seem like anything\nuntil she pointed it out, but some of the language he used was a bit\nambiguous. It could be read to mean the opposite of what we intended.  </p>\n\n<p> It took us all a while to see it, because we all know what we\'re trying\nto say, but once I saw it, I couldn\'t un-see it. Alex seemed to have the\nhardest time of it. He hesitantly volunteered to fix it before submission,\nbut we could all see that was a bad idea. Anika said she had no problem\ndoing it as long as everyone trusted her, because there wasn\'t enough time\nfor her to make the changes and get us all to say OK in time. Of course, we\nall trusted her and said so. </p>\n\n<p> The night before she sent it in to our instructor, Anika sent us a copy\nof the document just to make sure we were all OK with it. I didn\'t have a\nchance to read it carefully, but I wrote back and said OK. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(29,2,1,'<p> In group time, we began by setting up weekly team meetings. My group\nmembers seem to be nice. One of my teammates, Alex, I recognized from one\nof our big lecture courses last semester. One of the others, Lionel, is a\ntransfer. The project is pretty big and fairly open-ended, so we\nbrainstormed topic ideas for the most of the time. </p>\n\n<p> I didn\'t have a whole lot to say, so I mostly listened, but everyone\nelse seemed to have a lot of ideas. Natasha\'s ideas made me laugh. She\nseems to be working hard to think outside the box, and she mostly did it.\nThis meant that many of her ideas weren\'t really useable, but they were fun\nand they seemed to give other people ideas, too. At some point, Lionel\nnoticed that no one was taking notes, so we recounted what we could\nremember while he wrote them down, and we discussed those. </p>\n\n<p> Before the meeting ended, we crossed off the ideas that didn\'t seem to\nwork (this got rid of most of Natasha\'s) and narrowed the list down to six.\nAlex asked us to look for resources on all the topics so that next week, we\nwill report back and select a topic together. </p>\n\n<p> When I started looking for reference materials, I got off on a tangent.\nI wound up spending two hours on the task and found a bunch of materials,\nbut most of them were for just one topic. I don\'t think they\'ll really work\nfor what we need. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(30,2,2,'<p> Alex, Lionel and Natasha all focused on the same two topics, and\neveryone agreed that the topic I\'d done the most work on wasn\'t really\nviable. We ended up with a lot of duplication &mdash; especially between\nAlex and Natasha &mdash; but they all seemed to have a pretty good handle\non both topics. Our discussion quickly centered on our most promising two\ntopics. </p>\n\n<p> There was a lot of discussion about which to choose &mdash; everyone\nhad an opinion. Then Natasha suggested that we try to combine them. That\ndidn\'t really work, but I think it helped us to see them a bit differently\nbefore we settled into making decisions. Our first vote split evenly down\nthe middle, so Alex made a list of pros and cons. It helped to put things\nin perspective. Our next vote was unanimous. As Alex pointed out, the other\ntopic, although more exciting on the surface, would have probably been much\nmore complicated and difficult. </p>\n\n<p> The obvious next step was to find more materials on our selected topic,\nso we figured out the major subtopics and divided them amongst ourselves.\nWe decided everyone would return next week with summaries of what they\'d\nfound to make it easier for the group to get moving quickly. To make sure\nwe didn\'t wind up with a million competing summaries for the many duplicate\nmaterials, Alex thought to split up the materials we\'d already got among\nus. </p>\n\n<p> I found some more materials that week, then I wrote my summaries. I\nprobably spent an hour on this class work. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(31,2,3,'<p> During our meeting, we began sorting through the materials. Lionel\'s\nand Natasha\'s materials were in good shape. Natasha made me laugh when she\nmisread one of my summaries and shone a completely different light on it.\nIt turned into an interesting suggestion, too.  </p>\n\n<p> Natasha\'s contributions were solid, and we didn\'t spend too much time\non them, but Alex\'s summaries were confusing and no one understood them. He\nhad to explain what he meant a lot of the time. That frustrated Lionel and\nNatasha.  </p>\n\n<p> We then looked at my summaries, and they didn\'t think I\'d written\nenough. I thought that I\'d written everything that was necessary and I\nthought they were upset that I didn\'t pretty it up, but then Alex asked me\nflat out if I\'d prefer to use Natasha\'s summaries or my own to write the\npaper; that\'s when I got it.  </p>\n\n<p> I had only been thinking about doing this for the assignment due in two\nweeks because I don\'t do summaries like this myself, but I guess that\'s\nsort of a waste of time, isn\'t it? If we\'re to get a good grade here, we\'ll\nall need to help each other out, won\'t we? I did feel a bit stupid, but he\nwas right. Fortunately, we all have things to do to improve our work for\nnext week. </p>\n\n<p> I spent an hour cleaning up and filling out my summaries to be as\ncomplete as Natasha\'s. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(32,2,4,'<p> My mom has been ill for some time, and I found out that she was in\nhospital, so I drove back home to see her. The doctors took two days to\nfigure out what it was and it wound up a false alarm. I headed back to\nschool when they said they were comfortable with discharging her and,\nhonestly, that was the first time I even thought about this project. </p>\n\n<p> When I got back to town, I emailed the group to apologize and I sent\nout my summaries. I don\'t know why I didn\'t think to do that before I left,\nbut I just didn\'t. I hope they aren\'t too upset, but I haven\'t heard\nanything back from any of them. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(33,2,5,'<p> Lionel turned in our assignment this week in class, and our instructor\ngave us some time to meet as a group. We spent the time looking at the\noutline Alex put together, since no one else had brought anything with\nthem. Alex seemed to be satisfied with it, but Natasha and I weren\'t. We\ndidn\'t really have much time to get into it, though. </p>\n\n<p> At our meeting, it took a while to really understand where we weren\'t\nconnecting. I thought that Natasha and I both wanted the same thing, but it\nturns out we had completely ideas of where this was going! Alex, Natasha\nand I talked for half an hour, but I think Lionel was afraid to say\nanything. We ultimately sort of settled on Natasha\'s plan and modified the\noutline Alex had put together to look more like what she was describing. I\nstill think my idea was better, but hers wasn\'t bad. I could see that I\nwasn\'t convincing anyone, so I went along with it. </p>\n\n<p> With the outline settled, I suggested we split the outline up into\nquarters and each write one for next week. Lionel spoke up quickly for the\nsecond section. Natasha grabbed the first part, and I took the last. That\nleft the third part for Alex. </p>\n\n<p> It took me an hour and a half to see that this approach just wouldn\'t\nwork. We would have to go back and do it the way I thought at first, so I\nstopped about mid-way through and started working on a version that went\nthe way I thought it should. I had a lot of other work for this week,\nthough, so I didn\'t get very much of that done. I figure I\'ll still be\nahead of everyone else, anyway. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(34,2,6,'<p> I was right &mdash; no one was really able to make the pieces work\nquite right, so we had to rethink our approach. When I asked that we look\nat my idea from last week again, though, Alex had also been thinking about\nit and found that we\'d run into the same problems that way. Lionel\nsuggested that we try something he had used on a past project; it was a\nreally good idea. It would, of course, require some adaptation, but it\ncould work out very well for us.  </p>\n\n<p> It was quite exciting, and we all worked on ironing it out together.\nLionel seemed to be nervous about suggesting anything, but he contributed.\nAbout halfway into our meeting, we started looking back at the pieces we\'d\nalready written to see if/where they still fit. It looked like we would be\nleft with about half a paper still to write. </p>\n\n<p> This time, we each claimed pieces that were left to write. For some\nreason, Natasha wanted one of the tricky bits that I spoke for. She didn\'t\nhave any real reason for wanting it, except that I think she wanted to\noffload a boring piece. I traded her one of my other fun parts, though, for\nthe boring bit. Everyone was happy (I think)! </p>\n\n<p> I wound up spending an hour on the tricky piece alone. I was proud of\nit when I was done, but I still had other parts to do. I wound up spending\nan hour and a half more over the course of the week before I was ready for\nour meeting. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(35,2,7,'<p> Everyone else was late for our meeting this week. I guess that they all\nhad mid-term study sessions today, and they all forgot to mention it last\nweek. Kind of annoying, but there was nothing to be done about it. Alex\ndidn\'t arrive for half an hour! </p>\n\n<p> I didn\'t stay upset for long, though. Everyone had done their part for\nthe week and, after running through what we had, the paper was starting to\nlook pretty good. We spent much of our time assembling the pieces into a\nsingle paper. When we did, we realized that neither the introduction nor\nthe conclusion worked very well any longer. Natasha asked Lionel to write\nthe introduction, because the new structure of the paper was his idea, but\nhe claimed that it really wasn\'t his idea and didn\'t feel up to it. Alex\npushed this, though, and I volunteered to review it if he was concerned;\nthat seemed to satisfy Lionel. He said he\'d do it, but he made me promise\nthat I\'d review it the following week &mdash; I thought this was odd,\nbecause I\'d already volunteered to do it, but of course I promised I would.\n</p>\n\n<p> Alex volunteered to rework the conclusion, but Natasha asked him\ninstead to proofread and format the document while she rewrote the\nconclusion. He\'s not a very good writer. This left me without anything to\ndo for class for the week and I felt bad, so I said I\'d proofread the\ndocument, as well, to have an extra set of eyes on it. Before we ended the\nmeeting, Natasha told us she\'d be late next week because one of her\nmidterms would run until the start of this meeting. </p>\n\n<p> Proofreading took me awhile. It\'s a good paper, but it\'s been written\nby four different people. After an hour, I felt I\'d improved it\nsignificantly. </p>\n','2019-01-14 13:46:40','2019-01-14 13:46:40',NULL),(36,2,8,'<p> While Alex may not be good at making sure he puts all the right detail\nin himself, he is good at making sure everyone else does. He found all\nsorts of issues all over the paper &mdash; much more than I found. There\nwere a few items I\'d got that he didn\'t, but he did a much more thorough\njob than I\'d done. Most of the issues were pretty small, but a few would\nhave to wait for after we turn in the draft next week. We will be able to\nrewrite it, but everyone has tight schedules this week.  </p>\n\n<p> We next looked at Lionel\'s introduction; it was incredibly short. I\nasked him why and he just shrugged, so there was nothing to do but to read\nit. I probably shouldn\'t have said anything before I read it because he\nmanaged to cover all the bases in about half the word count than what I\ncould write.  </p>\n\n<p> Neither Natasha nor Alex had any ideas for improving it, but I was\nstill uncomfortable with it being so short. I told them that, although he\nwas right and everything necessary was in there, I was still uncomfortable\nwith it being so short. The others nodded a bit &mdash; they didn\'t argue.\nI made a couple of suggestions and so did Natasha. It didn\'t really add\nanything, but it made me feel better. Alex cut some of it back down again,\nbut I think we all felt good about it. </p>\n\n<p> When we were done, I said I\'d add in the conclusion, make the changes\nwe talked about and have a version of the paper ready to turn in next week\nin class. Natasha said that she\'d try to make the larger changes that Alex\nhad suggested. Lionel volunteered to start building a PowerPoint for the\nupcoming presentation. Alex asked if anyone minded if he didn\'t do anything\nthis week because he has a late midterm next week in his toughest subject.\n</p>\n\n<p> It only took me half an hour to get through everything this week, but\nthen I took another half hour reviewing it since we\'d be submitting it.\nWhen I was done, I made sure I had copies for everyone to review, in\naddition to the one for the instructor. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(37,2,9,'<p> We were happy to have copies to look at, but our instructor didn\'t give\nus any group time in class, so it wasn\'t as helpful as I\'d hoped it would\nbe. It did mean we didn\'t need to waste our meeting time on reading through\nit, though.  </p>\n\n<p> Natasha merged her changes into this latest version, which she brought\nto our meeting. She\'d had a difficult time making those changes, however,\nand they were not complete. She brought a list of questions and possible\nanswers, and we spent twenty minutes on that before we came to any answers.\n</p>\n\n<p> Alex was pretty quiet during most of the discussion, but suddenly he\nsaid he had an idea after seeing something that Natasha had done. He tried\nto explain it, but I think he saw that we weren\'t quite understanding, and\nhe asked if he could take it home to work on it for next week. I was\nhesitant because he doesn\'t usually explain his own ideas well, but I said\nOK. We still have time in case it requires too much cleanup. In fact,\neveryone was OK with it. </p>\n\n<p> We next discussed the presentation &mdash; beginning with the\nPowerPoint Lionel had put together. Lionel emphasized that this was just a\nstart and that he knew there wasn\'t much in it. He recommended that\neveryone claim a few slides and modify them when they worked on what they\nwere going to say. Natasha spoke for a few slides, including the first one,\nbut this time Lionel said he wanted to introduce us. I was surprised,\nbecause I didn\'t figure he\'d volunteer for such a visible role. We\nultimately decided that they\'d both give it a shot and see which one we\'d\nall like best when we practice next week. </p>\n\n<p> I didn\'t spend too much time on this this week. I didn\'t take that much\non because I had a lot of work for my other classes. I don\'t think anyone\nnoticed, but my parts were pretty simple. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(38,2,10,'<p> Everyone\'s presentations were pretty good, except for Lionel\'s. I don\'t\nknow what was going on there! It looked like this was his first time\nbuilding a PowerPoint, and he spent all his time playing with his new toy!\nThere were animations, images and words flying in and out. Every slide was\ncompletely different, too. The worst part was that he just read all the\nwords off the slides! We all had a lot of feedback for him &mdash; to be\nfair, there was a lot of feedback for everyone, but with him it wasn\'t\nnit-picky; it was pretty major.  </p>\n\n<p> I think maybe we were a bit too harsh, because he was really down\nafterwards. We should have been gentler with him; although he\'s really\nbright, he doesn\'t seem to know it. I could see on his face that he took it\nreally hard, but I just couldn\'t keep my mouth shut. I wasn\'t the only one,\nbut I was probably the harshest. I really did try to be constructive, but\nit probably didn\'t come out that way.  </p>\n\n<p> Needless to say, it wasn\'t much of a competition. Natasha\'s\nintroduction was much better than his, so she\'s going to present it. I\nthink she might use some of his visual ideas, though &mdash; it looks like\nhe spent a bunch of time cropping our heads for the main slide, and it was\nactually pretty nice (if also a bit cheesy). </p>\n\n<p> I spent some time practicing and applying the feedback this week, but\nthat didn\'t take too long. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(39,2,11,'<p> In class, the instructor returned the drafts, and we met briefly during\nclass to review it. There weren\'t many comments. Most of them were pretty\nminor or issues that Natasha had already fixed. There was one comment that\nconcerned us all, though: a diagram might help here. We were presenting our\ninstructor with a great big wall of text_ko:  \ntext_en! How did we miss that? We\'d\ndefinitely have things to talk about at this week\'s team meeting. </p>\n\n<p> Lionel arrived a bit late as we were talking about our complete lack of\nimages. While we were still at the complaining-about-it stage, though, he\nwas way ahead of us. He actually apologized as he pulled out a bunch of\nsketches he\'d \"thrown together.\" They were a great start. Natasha quickly\ncopied them over with black pen on full sheets so they were crisper and\neasier to see. We worked on them for half an hour, making small changes\nhere and there. Natasha volunteered create new versions to include in the\npaper. </p>\n\n<p> We spent the rest of the meeting working through the presentation.\nEveryone sounded better this week &mdash; especially Lionel. It was like he\nwas a completely different person. We all commented on the dramatic\nimprovement. I\'m not sure he quite believed it, but there was some relief\non his face, and I felt better. He was also more active in providing\nfeedback to everyone else. He pointed out that Alex had included something\nthat wasn\'t actually in our paper. Alex told him where he\'d found it and\nLionel seemed glad, but not satisfied. He asked if we wanted to talk in the\npresentation about something that we didn\'t mention in the paper. I didn\'t\nthink it was a big deal because it was true, but he clearly felt like it\nwas a bad idea and he wouldn\'t let it go.  </p>\n\n<p> He wasn\'t telling Alex to take it out &mdash; he was asking where we\nshould add it to the paper. I still didn\'t want to waste time on it because\nI thought it was fine, but he offered to make the change, so we said OK.\n</p>\n\n<p> I practiced some more for the presentation, but mostly left this class\nalone because I\'m pretty sure we are in good shape. The biggest comment\nthey\'d all had for me was that I was speaking too fast, so I worked on\nslowing it down. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(40,2,12,'<p> Lionel\'s images really added a lot to our paper. They would really make\nit easier for people to understand parts of it. Lionel also claimed one of\nthe images for one of his slides. It worked much better than the bullet\npoints he\'d had on there. I still can\'t believe we didn\'t have any images\nin at all until now. </p>\n\n<p> The presentation was much better this week. After another three\npractice runs, it sounded smooth. I felt bad for Lionel, though, because\nafter last week\'s discussion, Alex had second thoughts and removed the\ncontroversial bit of his presentation, but he didn\'t think to let Lionel\nknow, so Lionel had still added it to the paper. I could see how frustrated\nLionel was, but he didn\'t say anything at all about it. It was actually\ndifficult to keep from laughing about it, but I am pretty sure no one would\nhave liked that very much.  </p>\n\n<p> Natasha added the photos of us to her introduction slide, and they\nlooked pretty good. Finally, and arguably most importantly, we managed to\ncut it down to the correct time. </p>\n\n<p> I practiced a few more times during the week when I was able to find a\nmoment here and there. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(41,2,13,'<p> The presentation went OK, but not quite as smoothly as I\'d hoped. Alex\nseemed nervous and got quieter than I\'d have liked, but I\'m pretty sure\nthat most people heard him. They told me that, despite my efforts to avoid\ndoing so, I raced through my presentation. We wound up finishing up about\n30 seconds early.  </p>\n\n<p> Our classmates asked some good questions, which showed that our\npresentation was decent (because they understood at least enough to ask\nquestions). Since I spoke last, it seemed natural that I would direct\nquestions to the rest of the team (the ones who seemed to know those topics\nbest), and that worked quite well. There weren\'t a lot of questions, but\nenough.  </p>\n\n<p> We probably should have discussed clothes beforehand. Lionel wore\nslacks and a sports jacket, and Natasha wore a dress skirt and blouse. Alex\nand I were dressed very casually, and it was a bit uncomfortable. </p>\n\n<p> Generally, though, I think we felt good about the work we\'d done. I\nexpect positive feedback and good grades. </p>\n\n<p> We only met briefly this week because we were mostly finished, and we\nall had finals to study for, but Alex said that he had time to go through\nthe paper once more. Quite frankly, he\'s the best person to do it, so no\none disagreed. We also agreed that we\'d only meet briefly next week to make\nsure Alex didn\'t find any huge problems. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(42,2,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. As we went through it, I took issue\nwith a few of the changes Alex made. The language he used was a bit\nambiguous, and it could be read to mean the opposite of what we intended. I\nhad to explain it a few times and it took them a while to see it, but\neventually they did. They agreed that it needed to be fixed.  </p>\n\n<p> Alex offered to fix it, but I said I\'d do it because everyone else had\na hard time seeing it to begin with. It really only made sense for me to do\nit, but I was nervous about making a change and turning it in without\neveryone getting a chance to see it (we figured there wasn\'t enough time\nfor me to make the changes and get an OK  from everyone in time). They all\nsaid I should just go ahead and do it, though, so I took it. </p>\n\n<p> I worked on it that night and I could have sent it out, but figured it\nwould be best to proofread the whole thing the next day. I sent it out to\nthe team the next night and I got responses the following morning. I\nactually managed to send the paper in a bit early as a result! </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(43,3,1,'<p> In group time, we began by setting up weekly team meetings. This\nproject is pretty huge and I don\'t think any of us have had to do one like\nthis before.  I know how to work hard, though &mdash; I had a rough time at\nmy previous college, before I could bring my grades up enough to transfer\nin here. The rest of my group are freshmen, and it looks like they all knew\neach other already. I felt a bit left out, but that\'s life, I guess. </p>\n\n<p> The project is fairly open-ended, so we brainstormed topic ideas for\nmost of the first meeting. Natasha\'s ideas were easily the most fun &mdash;\nwhile Alex and I were suggesting fairly standard things, she managed to\nkeep coming up with interesting perspectives. Not all of them were\nappropriate, but they sure kept the discussion lively, and it didn\'t take\nmuch to make them useable.  </p>\n\n<p> Anika was quiet. I could tell that she was paying attention, but I\nguess she\'s a bit shy. When we started to slow down a bit, I realized that\nno one was taking any notes, so we tried to run back through the ideas\nwhile I wrote them down. We talked about the ones we remembered. </p>\n\n<p> Before the meeting ended, we narrowed it down to six ideas. We decided\nto all look for resources on all the topics. We will discuss them and\ndecide on one next week. </p>\n\n<p> During the week, I tried to look for stuff on all six topics, but while\nthey all sounded good during the meeting, only two of them really seem to\nwork for our project. Interestingly, one of the two was one that I\'m pretty\nsure started with a joke by Natasha. After an hour, I felt well-prepared\nfor those two topics, but I kept looking for stuff on the other topics for\nanother hour to make sure I had something for all the rest. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(44,3,2,'<p> Anika found a lot of materials for one of the topics that I had a rough\ntime with, but Alex and Natasha also focused on the same two as I did. We\nended up with a lot of duplication, but at least we all know those topics.\nWhen we dug into what Anika found for the third topic, I couldn\'t see how\nwe would be able to use much of it &mdash; the research just had mentions\nof what we needed. Our discussion quickly became about our most promising\ntwo topics. </p>\n\n<p> We had a lot of discussion about which to choose &mdash; everyone had\nan opinion. Then Natasha suggested that we try to combine them. We wasted\nten minutes trying to see if we could make that work, but ultimately we\ncouldn\'t. We wound up back where we started. Our first vote split evenly\ndown the middle, but Alex started writing pros and cons; seeing that made\nboth Anika and I change our votes. The other topic, although more exciting,\nwould have probably been more difficult. </p>\n\n<p> The obvious next step was to find more materials, so we divided up the\nmajor subtopics amongst ourselves. We decided everyone would return next\nweek with summaries of what they\'d found to make it easier for the group to\nget moving quickly. Alex also split up the duplicates among us. </p>\n\n<p> I found some more materials, and then I spent an hour writing and\nproofreading those summaries. Everyone in my group really seems to belong\nhere. It\'s going to be tough to keep up, but if I lose my scholarship, I\'m\nfinished. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(45,3,3,'<p> During our meeting, we began sorting through the materials. I showed\nmine first to get it over with, and no one had any complaints. Natasha made\nme laugh when she misread one of my summaries and shone a completely\ndifferent light on it. It turned into an interesting suggestion, too.  </p>\n\n<p> Natasha\'s contributions were solid and we didn\'t spend too much time on\nthem. Alex\'s materials were difficult to understand and we needed his help\nto interpret what he meant. He seemed a bit embarrassed and told us he\'d\nrewrite the summaries to make them clearer.  </p>\n\n<p> Anika\'s summaries were just a sentence or two each. I don\'t know how\nshe thought that would be useful to us. After some awkward moments, Alex\nasked her if she\'d prefer to use Natasha\'s summaries or her own to write\nthe paper, and I think it clicked for her. We all had things to do to\nimprove our work for next week. </p>\n\n<p> I carried Natasha\'s suggestion through my summaries and I think I did a\npretty good job, but it really didn\'t take much time. I felt like I should\nbe doing more, but couldn\'t think of anything to do, so I mostly focused on\nmy other classes this week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(46,3,4,'<p> Anika wasn\'t at the meeting when I got there. She hadn\'t been in class,\nand no one had heard anything from her. We weren\'t sure what was going on.\n</p>\n\n<p> When it looked like she wouldn\'t be coming, we began working through\nAlex\'s updated materials; they were much improved. They could use some\nediting, but at least they made sense now, and he is obviously very smart.\nI think maybe his mind races ahead of his fingers. I volunteered to try to\nredo Anika\'s work and put what we had together for the assignment due next\nweek, but Natasha said no. She said she\'d work on Anika\'s part and get it\nto me to three days before class so I could include them. She also asked\nAlex to put together a basic outline of what the paper should look like so\nwe could get started on that. Alex agreed, and I thought it was a great\nidea for him to keep us moving forward. </p>\n\n<p> Natasha got me the materials a day early, and I had plenty of time to\nput everything together. It took half an hour to put it all together and\nanother half to clean it all up.  </p>\n\n<p> The next evening, Anika got in touch with all of us, explaining that\nher mother had taken ill and that she\'d had to return home to be with her\nin the hospital. She\'d also included the materials she\'d been working on.\nThey were much improved &mdash; better in most cases than what Natasha had\nbeen able to put together. I was glad to have them, but it meant another\nforty five minutes to merge them with what Natasha provided. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(47,3,5,'<p> I turned in our assignment this week in class, and our instructor gave\nus some time to meet as a group. We spent the time looking at Alex\'s\noutline since that was the only new thing we had. I thought it was decent,\nbut Anika and Natasha seemed to feel differently. We didn\'t have enough\ntime to really get into it during class, but it was clear that the three of\nthem had different visions of what the paper should look like. </p>\n\n<p> Alex had made a few changes and once it was clear what those visions\nwere, I had to admit that they all had good ideas. I didn\'t have much to\nsay at first because I don\'t usually outline my papers &mdash; I just start\nwriting, but working in a group we have to agree on who is writing what.\nAfter 30 minutes of arguing (that I mostly stayed out of), we modified\nAlex\'s outline to incorporate much of what Natasha wanted. Over the course\nof the discussion, Natasha won Anika over to her perspective. </p>\n\n<p> With the outline settled, Anika suggested we split the outline up into\nquarters and each write one for next week. I spoke up quickly for the\nsecond section because I wasn\'t sure I could write the introduction or the\nconclusion. Fortunately, Natasha took the former and Anika took the latter.\n</p>\n\n<p> It took me two hours to write my part of the paper, but then I spent\nanother half hour proofreading it. I don\'t think it\'s great, but hopefully\nwhen the others review it, they\'ll be able to do what I can\'t. While I was\nwriting, I was reminded of a paper that I\'d written during my own freshman\nyear. I did a good job with it and this one has a lot of similarities\n&mdash; completely different topic, but it made me feel a bit more\ncomfortable. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(48,3,6,'<p> This week\'s meeting was uncomfortable. I thought the rest of the group\nwould be able to help me smooth out the rough parts of my piece, but it\nturned out everyone had similar rough spots. No one was really able to make\nhis or her piece work quite right. We had to rethink our whole approach.\n</p>\n\n<p> Anika once again brought out her initial preference from last time, but\nAlex was a step ahead of her and pointed out where we\'d run into the same\nproblems that way. After listening for a bit, I told the team about that\npaper I\'d written two years ago, because it seemed relevant. Alex jumped on\nit immediately. He said he thought it was a really good idea and could work\nwell &mdash; especially in light of the past two weeks\' in-class lectures.\n</p>\n\n<p> Natasha and Anika joined in and modified the outline. There were a\ncouple of places where I was able to offer some suggestions and help, too.\nAbout halfway into our meeting, we started looking back at the pieces we\'d\nalready written to see if/where they still fit. It looked like we would be\nleft with about half a paper still to write. </p>\n\n<p> This time, we each took pieces that were left to write. I didn\'t care\nwhich parts I took, but Anika and Natasha sure did. It seemed like they\nargued about almost all of them, but ultimately we all wound up with pieces\nwe could handle. </p>\n\n<p> One of my parts was pretty straightforward and I wrote it in half an\nhour, but the other one gave me a lot of trouble. For some reason, I just\ncouldn\'t make it work properly, so I set it aside. The next night I still\ncouldn\'t seem to get a handle on it, so I contacted Alex to see if we could\nwork it out together.  </p>\n\n<p> We met up for about an hour and he answered all my questions. We then\nlooked at his work. I often couldn\'t understand what he was saying and\nneeded to ask him to explain things more thoroughly. I felt pretty stupid,\nbut he said that I helped him and sounded sincere. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(49,3,7,'<p> I was late this week by about ten minutes because I had a study session\nfor one of my midterms coming next week. However, I was only the second\nperson to arrive. Natasha walked in five minutes later, out of breath from\nrunning to the meeting, and Alex didn\'t arrive for almost half an hour.\nBoth of them were coming from midterm preps. </p>\n\n<p> In spite of this, everyone was happier with what we had this week and,\nafter running through what we had, the paper is starting to look pretty\ngood. We spent much of our time assembling the pieces into a single paper.\nWhen we did, we realized that neither the introduction nor the conclusion\nworked very well any longer. Natasha asked that I write the introduction,\nsaying that the new structure of the paper was my idea, but it wasn\'t. They\nwere the ones who put most of it together &mdash; all I did was mention a\npast project I\'d done. I said I\'d do it only if one of them would review it\nthe following week. Anika said she\'d be happy to.  </p>\n\n<p> Alex volunteered to rework the conclusion, but Natasha quickly asked\nhim instead to proofread and format the document while she rewrote the\nconclusion. He was happy with this. I\'m glad, because his writing is pretty\nbad. Hopefully he does a better job with editing. Anika said she\'d\nproofread the document as well &mdash; just to have an extra set of eyes on\nit.  </p>\n\n<p> Natasha also told us she\'d be late next week because one of her\nmidterms would run until the start of this meeting. </p>\n\n<p> Writing the introduction wasn\'t really very difficult at all, and only\ntook me half an hour &mdash; I just hope it\'s what they\'re looking for. I\nre-read it later in the week to make sure I couldn\'t improve on it, but it\nstill seemed OK, so I\'ll just wait to hear what my teammates say. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(50,3,8,'<p> While Alex may not be good at making sure he puts all the right details\nin himself, he is good at making sure everyone else puts them in. He found\nall sorts of issues all over the paper. Most of them were pretty small, but\na few would have to wait for after we turn in the draft next week. They\nweren\'t horrible or anything, so that\'s fine. He also made the whole paper\nlook exactly the way the instructor asked us to (at least as near as I\ncould tell). It looks very professional. Anika also did a good job and\nnoted a few things that Alex missed, but she also missed many of the items\nthat Alex found. Why couldn\'t Alex do this with his own work? </p>\n\n<p> Natasha showed up just as we were finishing up with Alex and Anika\'s\nwork. We took a look at my introduction, and Anika asked why it was so\nshort before she even read it. I didn\'t know what to say, so I just\nshrugged and they read it. They were all quiet for a moment until Natasha\nshrugged and admitted that she couldn\'t think of anything that was missing\nand Alex agreed.  </p>\n\n<p> Anika thought for another moment and then she, too, agreed that nothing\nwas missing. She had some ideas for beefing it up a bit, though. Ten\nminutes later, we had a new version that was longer and felt a bit more\ncomplete. Her conclusion looked great to me, and only Alex made a\nsuggestion. </p>\n\n<p> When we were done, Anika said she\'d add in the conclusion, make the\nchanges we talked about and have a version of the paper ready to turn in\nnext week in class. Natasha said that she\'d try to make the larger changes\nthat Alex suggested. I wasn\'t sure what I could do this week because we\nseemed to be in pretty good shape, but I said I\'d start building a\nPowerPoint for the upcoming presentation. Alex asked if anyone minded if he\ndidn\'t do anything this week because he had a late midterm next week in his\ntoughest subject. </p>\n\n<p> I don\'t know what I was thinking when I volunteered for the PowerPoint.\nI had no idea what to put in it. After staring at a blank presentation for\nabout 20 minutes, I took our outline and made slides for each major topic.\nSeeing this, I rearranged it a little bit and added in some sub-headings,\nbut mostly I didn\'t do anything with it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(51,3,9,'<p> Anika not only brought a copy of our paper to class for the instructor,\nbut also brought copies for each of us to look at between class and our\nmeeting. This way, we didn\'t waste our meeting time on reading through it.\nAs a bonus, Natasha had merged her changes into this latest version. She\'d\nunfortunately had a difficult time making those changes and they were not\ncomplete. She brought a list of questions and possible answers and we spent\ntwenty minutes on that before we came to any answers.  </p>\n\n<p> Alex was pretty quiet during the discussion. At one point, though, he\nsaid he thought he had an idea after seeing what Natasha had done. He asked\nif he could take it home and work on it for next week; no one argued with\nthat. </p>\n\n<p> We next discussed the presentation &mdash; beginning with the\nPowerPoint I put together. Before Anika could comment, I pointed out that\nthis was just a start and that I knew there wasn\'t much to it. I said I\nthought everyone should claim a few slides and modify them when they worked\non what they were going to say. At this, Anika just shut her mouth and I\nhave to admit, that was pretty satisfying. It felt good to anticipate her\nquestions and head them off.  </p>\n\n<p> Natasha chose a few slides, including the first one, but I said that I\nwanted to introduce us. I don\'t think either of us had a very good reason\nfor wanting to begin the presentation. Neither Alex nor Anika had any\nopinion on it, so we decided that we\'d both give it a shot and see which\none we all like best when we practice next week. I\'m kind of excited about\nmaking it into a bit of a competition. </p>\n\n<p> I spent a lot more time on the introduction slide than I did on the\nothers this week, but I didn\'t completely ignore them. I built out my\nslides a bit with some clipart and a few more bullet points, but they were\npretty good as they were. For the introduction, I included little photos of\neveryone and had them bounce in. Then I animated the quick overview with\n\"whoosh\" effects. It\'s a bit cheesy, but I like it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(52,3,10,'<p> So, maybe I should have spent some more time on what I would say in the\nintroduction and less time on the slides (I think I went overboard).\nNatasha will open the presentation and I feel pretty dumb. On the plus\nside, they liked using the little photos of us all and they didn\'t hate the\n\"whoosh\" effect &mdash; but we\'re not keeping it, either. Everyone else\nsounded so much better than I did and I feel way out of my league.  </p>\n\n<p> I did get a lot of good suggestions, but they all seem so obvious that\nI should have known them. They all had recommendations for each other, too,\nbut theirs didn\'t seem nearly as obvious as mine. I was really feeling like\nI could handle this, and then they showed me just how much I don\'t belong\nhere. Anika seemed especially disappointed. </p>\n\n<p> After class, Alex hung back and offered to help me fix things this\nweek, but at that moment, I couldn\'t imagine how anyone could possibly fix\nmy awful performance, so I said no. </p>\n\n<p> When I got back to my room, I regretted it. I realized it\'s way too\nlate to drop the class. I should have said yes, but I figured what was done\nwas done. I\'d just have to try hard not to let them down too much again. I\nmade all the specific changes they suggested, and I practiced about a\nbillion times for anyone who would sit still long enough. I swear, my\nroommate and my mom must have my part of the presentation memorized at this\npoint, but I will not let my team down again. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(53,3,11,'<p> In class, the instructor returned the drafts, and we met briefly during\nclass to review it. There weren\'t many comments. Most of them were pretty\nminor or issues that Natasha had already fixed. There was one comment that\nconcerned me, though: a diagram might help here. I can\'t believe that this\nwas the first time I realized we were presenting our instructor with a\ngreat big wall of text! How could I have missed that? I took the document\nhome and sketched out ideas for four diagrams I felt would help us to\ncommunicate our point. </p>\n\n<p> I got to the meeting late, and everyone was already talking about our\ncomplete lack of images. I apologized and pulled out my sketches, and\neveryone\'s faces lit up. My sketches weren\'t very good, but I think they\nhelped everyone to come up with better ideas. After 30 minutes, Natasha\n(who is a much better artist than I), had three good diagrams to work with.\nShe said she\'d be happy to build them out and add them to the paper for\nnext week. </p>\n\n<p> We spent the rest of the meeting working through the presentation, and\neveryone sounded better this week. Anika even commented that mine had\nimproved dramatically. I noticed a bunch of mistakes, but no one talked\nabout them. Feeling better about the presentation, I was better able to\nlisten to their parts and offer them feedback. I noticed that Alex was\nspeaking too quietly, while Anika was a bit too fast.  </p>\n\n<p> Alex included something that I didn\'t remember from anywhere in the\npaper. He told me where he\'d found the information, and I believe him\nbecause he\'s got a great memory, but I wasn\'t sure that we wanted to talk\nin the presentation about something that we didn\'t mention in the paper.\nNatasha and Anika didn\'t think it was a big deal, but I feel like it\'s a\nbad idea. If it\'s important enough to talk about, shouldn\'t we write about\nit, too? Isn\'t this supposed to be a presentation of what we\'ve learned? I\nasked Alex to add it to the paper, but he didn\'t think it was necessary,\nand neither did Anika or Natasha. I think everyone\'s getting tired and just\nwants to be done with this. Finally, I just said that I\'d add it into the\npaper myself. </p>\n\n<p> I only spent half an hour making the small addition to our paper and\npracticing this week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(54,3,12,'<p> The images Natasha put together really added a lot to our paper and I\ncan see them making it easier for people to understand some aspects of it.\nI also claimed one of the images for one of my slides, because it would\nspeak so much better than the bullet points I had on there. I can\'t believe\nwe didn\'t have any images in at all until now. </p>\n\n<p> This week the presentation was much better. After another three\npractice runs, it sounded smooth. Alex was consistently speaking loud\nenough to be heard by the audience and we\'d slowed Anika down. I was a\nlittle bit frustrated to find that, after our argument last week, Alex\nremoved the bit they forced me to add into the paper. It\'s not as though\nit\'s out of place or that it needed to be in the presentation, but why\ncouldn\'t he have just gotten rid of it last week when I asked him about it?\n</p>\n\n<p> Natasha added the photos of us to her introduction slide, and I have to\nadmit, her intro was much better than mine. Finally, and arguably most\nimportantly, we managed to cut it down to the correct time. </p>\n\n<p> I practiced a few more times during the week when I was able to find a\nmoment. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(55,3,13,'<p> The presentation went OK, but not quite as smoothly as I\'d hoped. Alex\nseemed a bit nervous and got quiet, but I\'m pretty sure that most people\nheard him. Anika, on the other hand, raced through her presentation and as\na result, I don\'t think anyone understood her. We wound up finishing up\nabout 30 seconds early &mdash; I can\'t imagine that\'s a good thing.  </p>\n\n<p> Our classmates asked some good questions, which showed that they\nunderstood most of our presentation. Anika, who spoke last, naturally\nreceived all the questions, but she handed them off to whomever she felt\nwas best suited to answer them. There weren\'t a lot of questions, but I got\nto answer two and I felt good about being able to do that in front of our\ninstructor.  </p>\n\n<p> We should have discussed clothes beforehand. I came slacks and a sports\njacket, and Natasha wore a dress skirt and blouse. Alex and Anika were\ndressed very casually, and it was a bit uncomfortable. </p>\n\n<p> Generally, though, I think we felt good about the work we\'d done. I\nexpect positive feedback and good grades. </p>\n\n<p> We only met briefly this week because we were mostly finished and we\nall had finals to study for, but Alex said that he had time to go through\nit once more. Quite frankly, he\'s the best person to do it, so no one\ndisagreed. We also agreed that we\'d only meet briefly next week to make\nsure Alex didn\'t find any huge problems. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(56,3,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. As we went through it, Anika took\nissue with a few of the changes Alex made. It didn\'t seem like anything\nuntil she pointed it out that some of the language he used was a bit\nambiguous, and it could be read to mean the opposite of what we intended.\n</p>\n\n<p> It took us all a while to see it because we all know what we\'re trying\nto say, but once I saw it, I couldn\'t un-see it. Alex seemed to have the\nhardest time of it, and he hesitantly volunteered to fix it before\nsubmission, but we could all see that was a bad idea. Anika said she had no\nproblem doing it as long as everyone trusted her, because there wasn\'t\nenough time for her to make the changes and get us all to say OK in time.\nOf course we all trusted her and said so. </p>\n\n<p> The night before she sent it in to our instructor, Anika sent us a copy\nof the document to make sure we were all OK with it. I didn\'t have a chance\nto read it carefully, but I wrote back and said OK. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(57,5,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. The rest of my group are freshmen and they\'re all nervous about\nthis \"huge project\" but, as a sophomore, I\'ve already done lots of them.\nIt\'s clear that if I don\'t provide a lot of guidance, I\'ll wind up writing\neverything myself at the end. </p>\n\n<p> The project looks fairly open-ended, so we brainstormed topic ideas for\nmost of the time. I suggested some that I thought were pretty obvious and\neveryone seemed really impressed, so I told them I\'d done this sort of\nproject before. Jose tried to be involved, but the two ideas he suggested\nwere pretty mediocre. When Sam spoke, I wasn\'t sure if he was serious or\nnot. His suggestions were kind of funny, but I\'m not sure that was his\nintent &mdash; he definitely has a unique approach. Kim mostly just\nlistens; I guess she\'s shy or maybe just getting comfortable. Everyone\nfocused on trying to improve on my suggestions. </p>\n\n<p> Before the meeting ended, we narrowed it down to five ideas. I\nrecommended we each look for resources on one topic, report back next time\nand then select a topic, and everyone thought this was a pretty good idea.\nI spoke up for the topic that was most interesting to me &mdash; I\'d\nalready done some work on it for another class. Sam spoke for another and,\nafter a moment, Jose took another &mdash; but he didn\'t sound thrilled\nabout it. Kim said she\'d take the last two, but that seemed like too much\nfor her, so I said I\'d take it. She surprised me by insisting, so we\ncompromised and split it. She seems nice but hasn\'t said very much and I\ndon\'t know what to make of her. </p>\n\n<p> The research for this week took me about an hour. I\'ve got tons of\nmaterials on both topics because I was able to use some materials from the\nother class, as well. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(58,5,2,'<p> We began the meeting by going over the materials we\'d collected over\nthe last week, and it was very disappointing. I\'m glad Kim and I split that\nlast topic or the group would have junk for both of hers &mdash; she\'s\nclearly out of her depth. To be fair, though, it seems that neither Sam nor\nJose did much better. There are some things that we can use, but I can see\nthey barely read any of what they found. As a result, we spent most of the\nmeeting talking about how I conducted my research and vetted the results.\nSam didn\'t even understand why what he found wasn\'t useable, until I asked\na few questions about the topic &mdash; things that we\'d need to know for\nthe paper &mdash; and where he found the answers. Of course, he could only\nanswer one or two of them. I then went to my own notes and answered the\nsame questions for the topics I took, and then he seemed to understand.\n</p>\n\n<p> When I pointed out that they should redo their research for next week,\nSam actually suggested that the group just go with the topic I researched\nsince I\'d done such a good job with it (again, not sure if he was serious).\nI argued that this is obviously no good, because they still won\'t have any\nidea how to do the research &mdash; and this might not be the best topic\nfor us, anyway. Ultimately, they agreed and decided to redo the research\nfor next week. </p>\n\n<p> We ended early and Kim stopped me as I was about to leave. She told me\nshe thought I was rude to Sam by laughing at him, and we had an argument. I\nexplained that I wasn\'t being mean, I was just trying to help everyone get\nthe most out of the class! I wasn\'t trying to be mean &mdash; I thought he\nwas joking! I told her I\'d try to be more sensitive in the future, and she\nwas OK with it. </p>\n\n<p> Since my materials were fine, I didn\'t have anything to do this week,\nbut I did spend about half an hour looking for materials for the other\ntopics to help them out. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(59,5,3,'<p> In this week\'s meeting, we sorted through the materials we\'d got to\nevaluate them and decide on a topic, but it was tough to come to agreement.\nThey\'d all brought better materials this week. I feel like I never should\nhave pushed them to redo their research, because Sam came back loving his\ntopic, even though the materials available for it were pretty weak. Even\nworse &mdash; he convinced Kim to agree. I don\'t know how that happened,\nbecause I pointed out that the materials available were really thin and\nthere really wasn\'t much on which to base a paper. On the other hand, Jose,\nwho didn\'t much like his own topic, agreed that the topic I\'d initially\nselected was the best of them &mdash; it\'s got the best resources\navailable, as well. The discussion went on for most of the scheduled\nmeeting time, and ultimately the group settled on the topic I\'d researched.\nI\'m not positive that Sam\'s really on board, but he did say \'ok.\' </p>\n\n<p> After the topic was settled, I started drafting our outline and\neveryone joined in. It became clear pretty quickly that I\'d have to teach\nthem how to structure a paper properly. Even afterward, Sam proposed some\nodd ideas that he said would make it more interesting. I had to explain\nthat, while that was great for fiction, this was needed to be professional.\nAgain, he gave in, but I\'m not sure that meant he agreed. Jose suggested we\nsplit up the source materials among ourselves, look for a few more, write\nwhat we can about them and bring that back next week. It wasn\'t a bad idea,\nbut as soon as I started assigning them, everyone got upset with how I was\ndoing it, so I asked them to claim one they wanted until there were none\nleft. This worked pretty well, but Jose took one that was really too\ncomplicated and difficult, so I offered to help with it; this seemed to\nupset him. </p>\n\n<p> I spent about another hour taking notes this week. I took some notes on\nthat piece for Jose, but he never did get in touch with me to work on it,\nso I figured I\'d bring them to class and give them to him there. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(60,5,4,'<p> Jose was obnoxious in class about the notes I\'d put together to help\nhim. When I handed them to him after class, he looked at me like I was\ncrazy. I don\'t get it, but he did take them. </p>\n\n<p> Jose and Sam were late to the meeting this week, but that\'s not such a\nbig deal. What wasn\'t OK was that Sam forgot to write summaries for two of\nthe five parts he was supposed to bring! No one else seemed to care until I\nreminded them that we only had one week left before we turned it in. It\'s a\nshame, because he did a great job with what he did write. Jose seems to\nhave completely ignored all the notes I gave him and a quick glance at his\nsummaries shows that he doesn\'t understand what we\'re doing with this\npaper. It\'s not garbage, but there is a lot of work left to do. Kim did an\nOK job on her parts, but, while they are OK for next week, they are on the\nshort side and she didn\'t think about the outline at all or where her\nsummaries might fit into it. It\'s going to take a lot of work to build this\nout into a paper.  </p>\n\n<p> Naturally, everyone was surprised to see my summaries because they were\nmuch more complete. Also, no one else had thought to include pointers to\nthe sections where they should be used in our outline. Unfortunately, with\nthis due next week, there\'s no time for them to fix theirs. Sam said he\'d\nput everything together for what we need to turn in, since he still has to\nwrite a lot of his materials. I told him to send it to me so I could look\nat it before we turn it in. </p>\n\n<p> Next we talked about the outline and Kim had some really good ideas for\nimproving it. Everyone agreed, but Sam complained that it was too much for\nhim to do for next week and asked that we just make a note of it and make\nthe changes later, but this won\'t get us the feedback we need from the\ninstructor. Anyway, he\'s the one who didn\'t do his work for this week...\nKim stepped up, however, and offered to make the changes if Sam could get\nthe rest of it done by the middle of the week. Sam agreed. I really hope I\ncan trust them to do it right. </p>\n\n<p> Before we left, I reminded everyone that we need a completed draft\nready in another four weeks and that they should build out their summaries\nto look more like mine for next week. From the looks on their faces, it\nseemed no one else realized this was necessary, but no one argued. </p>\n\n<p> There wasn\'t much for me to do this week outside of the meeting, so I\nfocused on my other classwork. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(61,5,5,'<p> Kim was a little late, but turned in our paper in in class. After\nclass, the instructor allowed some time to meet for group work, and we\nreviewed Sam and Kim\'s work &mdash; they explained that they met up in the\nmiddle of last week after Sam had done his part and worked on finishing\neverything up together. There wasn\'t a lot of time in class and it looked\nok. I pointed to a few problems, but there weren\'t a lot of comments. </p>\n\n<p> Everyone was happy to see the paper starting to take shape and we\ndiscussed what we should do next. Sam suggested that we each build out the\nsummaries we\'d been working on, but I had to point out that that wouldn\'t\nwork, because some of them would appear all throughout the paper. I was\nabout to speak, but Jose had arrived and heard us talking about what came\nnext. He said we should just wait for the feedback from our instructor,\nanyway. He argued that we should take the week off, instead! The worst part\nwas that Kim and Sam also thought this was a good idea.  </p>\n\n<p> I had to explain that the first assignment was basically just to make\nsure we were moving forward. I also told them that, in my experience, it\noften took weeks for them to get this sort of thing back to us; if we\nwaited on that, we\'d never have the draft completed in time. I can\'t\nbelieve they didn\'t know! Also, it\'s getting toward mid-term time and we\'ll\nappreciate the extra time to study later if we finish most of this now.\n</p>\n\n<p> I told them we have to keep moving to get this done. That meant\nsplitting the paper into four pieces and each of us taking one &mdash; we\ncould save the introduction and conclusion to be written after the rest is\nin place. Eventually they agreed to this. </p>\n\n<p> I took the last quarter of the paper and spent a lot of time working on\nit this week. The topics in this part were mostly done by Sam and Jose, and\nI had to fix many major problems with Jose\'s work. He\'s trying, but doesn\'t\nreally get it. I had to review a bunch of the materials to see what they\nwere really saying and then redo everything. He misinterpreted the\nmaterials and was therefore arguing the wrong point. He probably won\'t even\nrecognize much of this as his work. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(62,5,6,'<p> Sam and Kim were again there when I arrived this week, but Jose was\nnot. We started by looking at Kim\'s work. It was well written and she\'s\nmade some good observations that I hadn\'t even thought of. We spent some\ntime exploring those observations further, and it gave me some ideas to add\nto mine. Sam\'s looks fantastic because he included some great visuals that\nmade it easy to understand what he was trying to say &mdash; he should be\nan illustrator. This started us talking about where else we might be able\nto add images to strengthen our paper. We came up with a diagram and a\ngraph that would really help, and Kim volunteered to take the graph, but I\ndon\'t want her to be overloaded since I\'ll probably ask her to do much of\nthe proofreading and formatting. Plus, Sam\'s obviously good at it. So I\nasked him to do them both, and he seemed happy. </p>\n\n<p> Then Jose showed up, about fifteen minutes late, saying his coach had\nbeen holding the team late to prepare for their upcoming game. We moved on\nto the part of the paper I\'d rewritten and Jose was angry because he didn\'t\nunderstand why I changed his part of it. I said that what he had put\ntogether had helped me orient myself, but that I\'d had to make some changes\nso it would all make sense and work toward the same vision. He responded\nthat it was my vision and not the group\'s. Then Kim spoke up to say that\neven though the paper is much different from what she thought it would be,\nit was clear that I had a lot of experience and that the paper was turning\nout well. After that, Jose admitted that he was going in a different\ndirection and asked us to think about writing the paper that way &mdash; he\nthought it was valid. So we talked about the problems we might run into\n(not the least of which being that we\'d have to do a major rewrite).\nUltimately, he gave up and stayed on the same path, of course. Obviously,\nwe didn\'t look at Jose\'s work because he would have to make some major\nchanges to it, anyway. </p>\n\n<p> Since none of their pieces are really finished and I had some things I\nwanted to add to mine (thanks, Kim!), we decided to each spend another week\nwith our own parts. I volunteered to write the introduction and conclusion,\nas well. My own additions took me longer than expected &mdash; I spent\nabout an hour on it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(63,5,7,'<p> Jose was late again this week. It was only about five minutes this\ntime, but it\'s getting to be a habit and he said the game was last week, so\nI asked him to please try to be on time in the future; he glared at me. He\nreminded me that his coach has been keeping him longer lately and then\nadded that it didn\'t matter because I was doing the whole project anyway\n&mdash; that it didn\'t make much difference if he was there or not. How am\nI supposed to respond to that? I reminded him that it\'s a group project and\nthat we\'re all working toward a shared grade on this. Really! Am I supposed\nto apologize for being more experienced? Kim stepped in at this point to\ncalm Jose down. She confirmed, and asked me to confirm that we were working\nas equals on a group project. </p>\n\n<p> Everyone\'s pieces looked much better this week &mdash; especially\nJose\'s, which was pretty much entirely rewritten. While Sam\'s very good\nwith visuals, his writing skills leave a lot to be desired. At first, I was\nmaking a lot of comments and corrections, but then I gave up and told him\nthat I\'d take it and fix it for next week. He was fine with that. Everyone\nseemed to be pretty happy with the way the paper was turning out, in fact\n&mdash; even Jose. </p>\n\n<p> I suggested that maybe we might want to trade pieces to proofread for\nnext week and then end early. Nobody was opposed to this, and I\'d already\nvolunteered to take Sam\'s work. Kim said she\'d assemble the four pieces for\nnext week so we could see the whole thing together. I wasn\'t comfortable\nwith this because we would all be looking at our pieces separately this\nweek, and it wasn\'t fair to make her do all of that. However, she pointed\nout that we could still make our edits to the pieces in the larger paper\nand she was volunteering to make the changes in the final document, too.\nSo, since I couldn\'t think of any good reason why we shouldn\'t, we went\nwith it. </p>\n\n<p> Jose asked that we change our meeting time for next week because he has\nsome study sessions to attend. Sam asked if we might even be able to cancel\nit, since we\'ve all got mid-terms coming up and our paper is looking like\nit\'s in pretty good shape; Kim agreed with him. Naturally, no one\nremembered that it was my planning and organization that put us in such a\ngood position. We decided to change next week\'s meeting to fifteen minutes\nimmediately after class; it will be primarily to pass around the updated\ndocument and our corrections. </p>\n\n<p> It took me a while to get through Sam\'s work, and I had to rework a lot\nof it. All told, it took me about an hour. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(64,5,8,'<p> During this week\'s class, some of the discussion touched on the topic\nof our paper, and Jose and Sam both were active in the discussion. This\nlead to some lively debate, and it became clear that there were competing\npoints of view within the classroom. </p>\n\n<p> After class, we met briefly as we decided last week. Kim did a good job\nof not only integrating her own work into the paper, but cleaning things up\nin general. She seems to have a real knack for that. She moved some things\naround throughout the paper, and it\'s a real improvement. She\'s also\napplied the formatting throughout the document and it\'s looking good. Jose\nand Sam were also impressed. Kim put a lot of work into it. The changes\nmade it difficult, however, to distinguish one piece from the other. We\ndecided we should look through our high-level comments and feedback to see\nwhat still makes sense to incorporate, and then hand the detail work back\nto Kim to apply in the new version. Most of the changes ended up being work\nthat Kim had already done. </p>\n\n<p> Then, Sam brought up the class discussion and asked what we should do\nabout addressing the other viewpoints. While we probably should mention\nthem, Jose looked at this as some sort of vindication of where he was going\noriginally (that I corrected). Worse yet, Sam agreed! Our existing approach\nshowed we are creative and thoughtful, rather than just parrots of the\ntextbooks. When the discussion stretched on, I suggested that maybe we\nshould hold our regularly-scheduled meeting to finish the discussion. No\none wanted to do that. I offered instead to add in a note explaining the\nother perspective, and Sam really liked this idea. He explained that he\nreally likes the direction we\'ve taken the paper, but that he was nervous\nthat we\'d look like we\'d completely missed that alternative perspective.\nHe\'s got a really good point, too. This got Jose on board, but he wanted to\nwrite it. I said no way! His other work has been sloppy, and I said I\nwouldn\'t risk turning in something unfinished, even if it is just a draft.\nKim told him that if he could get it to her by mid-week, she\'d include it\nin the draft she was preparing. On our way out, I caught Kim and asked her\nto be sure to keep the note brief. </p>\n\n<p> I didn\'t have anything to do outside of class this week, so I focused\non my other class work. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(65,5,9,'<p> Kim had our paper ready to be submitted when she arrived in class, and\nshe also brought a copy for each of us to look at afterward, but we didn\'t\nmeet because both Sam and Jose had already left. I was really hoping to\nhave a chance to go through it together, but that was probably best because\nit gave me a chance to look over the whole paper. Although it integrates\nnicely, I thought that Kim would keep Jose\'s brief note brief; instead, it\nadds almost a full page. </p>\n\n<p> About ten minutes into the meeting, I started to get up and leave\nbecause I was the only one there. Just then, Jose arrived and asked why I\nwas leaving. It seems that Kim told Jose and Sam she\'d be late to the\nmeeting, so they decided to just meet later instead &mdash; but no one\nthought to tell me. When everyone finally arrived, I tried not to make a\nbig deal, but I was pretty upset. </p>\n\n<p> I pulled out my own changes to the document and no one questioned any\nof them. They were mostly minor at this point, but I did trim down some of\nJose\'s note. No one said anything. I asked them to please take another look\nat the paper this week, but I doubt they will.  If they do, they probably\nwon\'t see anything. I guess everyone is exhausted. Maybe they hate me? </p>\n\n<p> Our next task was to begin preparing for the presentation. We drafted\nan initial PowerPoint, and they all just accepted the assignments that I\nsuggested &mdash; they pretty much followed the parts of the paper they\'d\neach written. I expected there to be some discussion, so I asked if\neveryone was OK with it. They said it was fine, so I guess they are. We all\nagreed to start working on our talking points and our slides in the deck.\n</p>\n\n<p> I am very comfortable with my topic, but that translated into it\nrunning about twice as long as it should. It took me two nights to get it\nto something workable because I had a lot of other projects to work on,\ntoo, and I just couldn\'t focus. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(66,5,10,'<p> We spent the first fifteen minutes practicing our presentation &mdash;\nthe one that\'s only supposed to take seven minutes! Have none of these\npeople ever presented anything before? Jose talked for five minutes about\neverything but his topics before he introduced Sam. Sam, in turn, had the\nsmart idea to add the diagrams to the slides, but then proceeded to\ndescribe the images, rather than the story they are supposed to tell. I\nhave no idea what Kim was talking about since she seems to be so petrified\nof public speaking that her voice never got up above a whisper. By\ncomparison, I thought mine was pretty decent. I may not be the best\npresenter, but at least I stayed on topic and close to the time limit. </p>\n\n<p> We spent the rest of the meeting working on the presentations.\nFortunately, I wasn\'t the only one criticizing and pointing out flaws. Each\nof us (including me) took home a bunch of things to work on before the next\nmeeting if this presentation is going to run smoothly. I have to slow down\nand rework a few phrases that didn\'t make sense to them when they heard it.\nAlso, after seeing what Sam put together, I\'ve got some ideas for improving\nmy slides. </p>\n\n<p> I actually spent another hour and a half just practicing my part\n&mdash; and that was after about half an hour of reworking. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(67,5,11,'<p> In class, the instructor returned the drafts to the groups, and we met\nbriefly during class to review it. The instructor left only six comments in\nour paper &mdash; glad we didn\'t wait on that! One comment read,\n\"Interesting approach! I like that you reached beyond what we did in\nclass.\" The comments clearly favored the results of my guidance (in\ncontrast with the direction Jose was pushing for). Another comment\ncomplimented the images. One of the comments indicated a need to further\ndevelop a section and another asked us to recheck one of our references.\n</p>\n\n<p> Our meeting opened up very strangely, as Jose completely misinterpreted\nthe instructor\'s comment. He thought the instructor was complimenting the\nfact that the document took what we talked about in class a bit further. It\ntook me a while to understand that\'s what he was thinking and then I tried\nto gently help him understand the truth. Eventually he said he understood,\nbut I\'m not sure that he really did. Sam and Kim both stayed out of that\ndisagreement and were quick to move on afterward. I told them that I\'d make\nthe requested changes this week because I\'d already started. </p>\n\n<p> The presentations were better this week, but we still need more\npractice and a bunch of rework. Jose changed his part in response to what\nhe thought the instructor was saying, but I\'m not sure I can convince him\nto fix it completely. He did say he\'d change it some to make sure it\'s\nstill in line with what everyone else wrote, and I guess this is OK. We do\nhave the note in the paper, so I guess he\'s got that covered. Sam and Kim\nhad both fixed some parts of theirs, but we spent most of the meeting\nfixing other parts. We also talked about how we should dress for the\npresentation. Kim had an elaborate costume idea that was completely\nunprofessional (and I hate dressing up in costumes). I said business\ncasual. When we ended the meeting, I reminded everyone that our\npresentation is in just two weeks. </p>\n\n<p> Reworking the paper this week took me about two hours, but I didn\'t\nmind. If I hadn\'t done it, it probably would have been wrong. Also, the\ninstructor was right about the reference &mdash; I\'ll have to ask Sam what\nhappened with that and if he\'s able to track down the correct reference.\nI\'m glad my part of the presentation is finished now. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(68,5,12,'<p> We had to start without Kim this week because she left a message with\nJose that she\'d be late due to a meeting for another class. The group spent\nsome time reviewing my changes to the paper. I asked Sam about the\nincorrect reference and he just laughed and rifled through his notes. He\nexplained that it was just a placeholder he threw in while he was writing,\nand he never got around to removing it. It\'s pretty funny that it stayed in\nthis long without anyone noticing. I continued and both of them were fine\nwith my fixes. </p>\n\n<p> Kim arrived just as I finished looking at the changes. She asked to\ntake another look, but I asked her to look at it after the meeting,\ninstead, so that we would have time to practice the presentation again.\nNone of them made many changes &mdash; even Sam, and that\'s annoying\n&mdash; but the presentation felt much better this week. They must have\npracticed a lot. After two practice runs, it sounded smooth. While it\'s\nstill running too long, we agreed that everyone will probably speak faster\nin class and the instructor probably won\'t be a stickler on time. </p>\n\n<p> We decided to end early this week. I reminded everyone to wear formal\nbusiness clothes to the presentation next week. </p>\n\n<p> I practiced a few more times this week, but mostly I was free again to\nwork on my other coursework. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(69,5,13,'<p> We were the only group dressed professionally, and I think that\nprobably earned us some points. Kim managed to speak loudly and clearly\nenough that the instructor only had to ask her to speak up once. Jose\nstumbled on his first few sentences, but he quickly relaxed and did a great\njob. The biggest surprise, though was Sam: he added an analogy at the end\nthat not only tied everything together, but it also made everyone laugh. It\nwas unexpected and risky, but it worked out well. There weren\'t a lot of\nquestions for us, and I stepped forward to direct them to the best person\nto answer. </p>\n\n<p> I think we can expect positive feedback and good grades.  </p>\n\n<p> Since the paper is mostly finished, we all decided to skip this week\'s\nmeeting and each give the paper one last review for the following week.\n</p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(70,5,14,'<p> At the final meeting, we compared notes and found that we had no major\nchanges to make. Kim took all four versions and said she\'d make all the\nchanges and then submit it at the end of the week. I asked her to send it\nto me first because I want to take one last look at it. She was annoyed by\nthis, but she agreed. </p>\n\n<p> When she got me the paper, there were no changes to make, but it felt\ngood to give it a final review and submit it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(71,6,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. I think we got lucky, because Anna is already a sophomore, while\nthe rest of us are freshmen. It seems like she knows what she\'s doing. </p>\n\n<p> The project is fairly open-ended, so we brainstormed topic ideas for\nthe rest of the time. I suggested some topics, but they weren\'t nearly as\ngood as Anna\'s ideas. I knew they weren\'t that great before I said them,\nbut when I caught a glimpse of Anna\'s face when I said them, I felt dumb.\nShe told us that she\'s done this sort of thing before. Thankfully,\neverything I said was sort of overshadowed by Sam\'s contribution that no\none knew how to respond to. When he speaks, I can\'t tell if he\'s serious or\nnot. His suggestions are kind of funny, but I\'m not sure that\'s his intent\n&mdash; he definitely has a unique approach. Kim mostly just listens; I\nguess she\'s shy or maybe just getting comfortable. Soon, everyone focused\non trying to improve on Anna\'s suggestions.  </p>\n\n<p> Before the meeting ended, we narrowed it down to five ideas. Anna told\nus we should each look for resources on one topic and then report back next\nweek. She spoke up for a topic she\'d already worked on in another class.\nSam quickly spoke up for another and, then I chose the most interesting one\nthat was left. Honestly, though, I was disappointed because I liked the one\nAnna chose, but I\'ll give this a shot. Kim said she\'d take the last two,\nbut I guess Anna\'s concerned, so she offered to take one herself. Kim\ninsisted, though, that she can handle it, so Anna split it with her. I\'m\nnervous about Kim, too, because she hasn\'t said or contributed much, but\nthat\'s fine. We\'ve got time. </p>\n\n<p> I spent about 45 minutes researching my topic this week and I found a\nlot of materials, so I feel pretty good. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(72,6,2,'<p> We began the meeting by going over the materials we collected over the\nlast week. Anna was clearly disappointed, and she didn\'t hide it well. She\nspent most of the meeting talking about how she did her research. It was\nhelpful, but makes me feel like I\'m a child. I\'m going to have to do a lot\nof it again. Sam asked some questions indicating that he didn\'t see why his\nmaterials are mostly unusable, and Anna just laughed at him. He asked again\nand this time Anna responded with a few detailed questions that Sam\ncouldn\'t answer. She then went to her own notes to answer the same\nquestions. It seemed a bit cruel (and I\'m glad it wasn\'t me) because I\ncouldn\'t have answered those questions. Sure, they are important and all,\nbut we\'re new to this and she\'s not. She\'s already worked on this topic\nbefore. </p>\n\n<p> I suggested that, in the interest of time, maybe we just go with the\ntopic she worked on, but Anna insisted that we redo our work. She pointed\nout that we all need to be able to do the research. No one could argue with\nthat, so we said we\'d redo our work. </p>\n\n<p> The next night, I spent about another hour and a half finding and\nskimming through new materials. I was still able to use most of my original\nmaterials. I found a bunch of additional ones, too. I don\'t love this\ntopic, though, so it feels like a waste of time. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(73,6,3,'<p> During this week\'s meeting, we sorted through the materials to decide\non a topic; we have much better materials this week. It turns out that\nSam\'s topic is really cool, but it was clear Anna was more interested in\nher own topic. So was I. It\'s really got the most potential, and we\'ve got\nthe best resources for it. We went back and forth for most of the meeting\nand it was a pretty good debate, but in the end, I thought Anna\'s topic was\nbest, and Kim wound up agreeing with us (even though she started out siding\nwith Sam). After Kim changed her mind, Sam agreed to go along. </p>\n\n<p> After the topic was settled, there wasn\'t much time, but Anna jumped\nright into drafting an outline, and she wouldn\'t let anyone else help. Sam\nhad some interesting ideas about how to make the paper easier to read, but\nwhen he brought them up, Anna took it as a sign that none of us had ever\nwritten a research paper before. We all had to sit through her explaining\nto us what an outline is and why we use it &mdash; that\'s ten minutes of my\nlife wasted. No one made any comments on the outline after that. </p>\n\n<p> When I suggested that we each take a few of our sources, search for\nmore content on our own and then write up summaries for next week, Anna\nagreed and started assigning them out. She acted like she was the only one\nwith a brain, however, and she didn\'t trust the rest of us to get anything\nright, so she took the materials that were actually interesting and offered\nany depth &mdash; strange, since she made such a big deal out of making\nsure we were all \"learning\" during the initial research. I wasn\'t the only\none upset &mdash; Kim spoke up first to request a specific topic, and then\nSam and I did the same. This clearly irritated Anna, but eventually she\ngave in and we each claimed the ones we most wanted. This seemed fine and I\ntook one that I thought I could make into something interesting, but\napparently Anna didn\'t think I could handle it. She told me she\'d \"help\" me\nwith it &mdash; like I\'m incompetent or something. I just said OK and moved\non &mdash; she can do what she wants, but I\'m writing it. </p>\n\n<p> I spent about two hours on reading, searching and writing summaries. I\nlike how it turned out. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(74,6,4,'<p> After class this week, Anna handed me her \"help\" &mdash; her completed\nsummary was even longer than mine! Does she think I\'m not competent to\nwrite anything? I wasn\'t sure how to respond; I just kept thinking this\ncouldn\'t really be happening, but when I realized it was, I took the paper\nand walked away. When I got home, I found that she\'d pulled out completely\ndifferent main points. I can see that this is where she\'s going, but my\napproach is just as good, and I didn\'t have time to make any changes to\nwhat I\'d written, anyway. </p>\n\n<p> I was a bit late to the meeting, but it was only about five minutes and\nSam was just arriving when I walked in. I can tell that Anna wasn\'t\nthrilled with what I brought, but she was more upset that Sam didn\'t finish\nhis part. She was particularly upset because she thought we were writing\nour completed portions to be added directly into the paper &mdash; and\napparently no one else thought this. What does she expect? She tells\neveryone what to do because she\'s got more experience, but then she doesn\'t\nexplain what she means &mdash; assuming that we have the same experience\nthat she does. Kim called her out on this, asking why she wrote so much\nalready when we\'re so early in the project. After all, we only have the\npreliminary structure done, and this is only the fourth week of class.\n</p>\n\n<p> Anna got upset and asked how she would be able to put anything together\nusing materials as thin as this; that\'s when Sam spoke up. He made a joke\nabout how poorly he\'d done his part &mdash; his wasn\'t just thin, it was\nnonexistent. It wasn\'t that funny, really, but everyone laughed and he\nvolunteered to assemble next week\'s assignment since he still has pieces to\nwrite. He also suggested that we take a look at what we\'ve got and whether\nthe outline we put together still fits. It was really either that or fight\nfor another hour, so everyone was all for it. </p>\n\n<p> The discussion was OK, and Kim offered some really good ideas about how\nto sequence things. It helped me to see the paper differently, and it gave\nme some more ideas. Anna agreed that the sequence is a good idea, but Sam\nquickly pointed out that he wouldn\'t have time to do it all, and Anna\nstarted getting upset again. I also don\'t have time to help out;\nfortunately, Kim offered to make the changes if Sam could get the rest of\nit done by the middle of the week. Sam gladly accepted this, and they\ndecided to coordinate later. </p>\n\n<p> Naturally, before we left, Anna had to remind everyone that we need to\nkeep working on our summaries because we\'ve got the draft due in another\nfour weeks. </p>\n\n<p> I spent about half an hour on my sections this week, but I mostly\nfocused on my other classes. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(75,6,5,'<p> Kim had our assignment ready and turned it in during class. The\ninstructor allowed some time at the end of class this week, so we reviewed\nwhat she and Sam put together. It seems they met up in the middle of the\nweek and finished it together. Anna was pleased with their work, so the\nmeeting went pretty smoothly. </p>\n\n<p> My coach kept us late all week to prepare for a home game against our\nrivals in two weeks, so I was about twenty minutes late. It was a tough\npractice and I was exhausted, so when I arrived and the group was\ndiscussing our next steps, I suggested we take a break from it for a week\nwhile we wait for feedback from the instructor. Sam and Kim seemed to think\nthis was a pretty good idea, but Anna got upset. She spent the next ten\nminutes explaining that she thought the instructor probably would barely\nlook at our papers, much less provide meaningful feedback. She said it\'d\nprobably be weeks before we got it back; by that point, we\'d have no time\nleft to get our draft together. She kept talking about how we couldn\'t stop\nnow because of midterms, scheduling and all sorts of other junk. I gave up\nbecause I just didn\'t want to hear any more. I really could have used a\nbreak, but I guess she won\'t let us have one. </p>\n\n<p> We split the paper up into quarters and each took a section to write up\nfor next week. Before we left, I told everyone that I\'d probably be late\nthe next week because of our practices. </p>\n\n<p> I had to spend about two and a half hours writing my part of the paper\nthis week. I mostly had to work with Sam\'s contribution and just a bit of\nKim\'s. Sam\'s contributions were difficult to understand. He had some good\npoints, but the way he wrote was very confusing and took a long time to\nunderstand &mdash; sometimes it was easier to just go back to the sources.\nThey also seemed to miss part of the point. Ultimately, I had to write most\nof it from scratch. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(76,6,6,'<p> I was a little late again for our meeting this week because of\npractice. Before I arrived, the group went through Kim\'s and Sam\'s work. I\ndidn\'t really get a chance to read either of them, but Sam included visuals\nin his and it makes a big difference! I guess that they all agreed and\nlooked for places to add more. </p>\n\n<p> Next, we reviewed Anna\'s. She sort of apologized to me for changing it\nto make sure it all made sense and worked toward the same point. As I read,\nthough, it became clear that she rewrote almost everything I gave her. I\nrecognize it, of course &mdash; it\'s all very similar to the \"help\" she\ngave me. I completely wasted my time and might as well not have written\nanything!  </p>\n\n<p> I answered that it was her vision and not that of the group. Kim spoke\nup and took Anna\'s side, saying she liked where the paper was going. I\nrealized that it didn\'t matter what I said or did, because we were just\nhelping Anna write her paper. It wasn\'t a bad paper, but it wasn\'t ours\neither. It was clear that I\'d have to rewrite most of the work I\'d done\nthis week, so we didn\'t bother looking at mine. </p>\n\n<p> As it turned out, I didn\'t have as many changes to make as I thought.\nIt only took me about 45 minutes to fix it all up. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(77,6,7,'<p> I was a little late this week because I think I pulled a muscle or\nsomething in my leg at practice. When I arrived Anna yelled at me for it.\nCouldn\'t she see that I was limping? Anyway, what did it matter since she\nwas writing the whole paper herself? We started to get into it but then Kim\nspoke up to calm us both down. She made Anna confirm (out loud) that we are\nall equals, working on this project together. Of course, Anna had to remind\neveryone that she had more experience than anyone else, but Kim pushed us\non anyway. </p>\n\n<p> Anna was happy with everyone\'s work this week &mdash; especially mine.\nOf course, I\'m basically just doing exactly what she told me. She was\ndisappointed by Sam\'s work, and there are a lot of corrections to be made\nthere, but it\'s nothing at all like last week. Anna told him she\'d take it\nand rewrite it for next week. At this, Anna told us we needed to trade\npieces and proofread each other\'s work for next week. Everyone was OK with\nthis, but Kim wanted to get started on assembling the paper and volunteered\nto do that. Anna pointed out that it would be tough to match the individual\npieces with the assembled document so that we could make the changes, Kim\nsaid she\'d take care of it, so it was decided. </p>\n\n<p> As we were getting ready to go, I asked if anyone would mind changing\nour meeting time for next week &mdash; I had a study session to prepare for\none of my midterms. Sam agreed and asked that we cancel it, since the paper\nis in pretty good shape. Kim was on board. Anna decided that we should\nstill meet, but only briefly immediately after class to share our changes.\n</p>\n\n<p> I took Kim\'s piece and it was really in pretty good shape. I was able\nto read through it quickly and I had very few comments or corrections to\nmake. I wonder if Sam will have much to say about mine. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(78,6,8,'<p> During this week\'s class some of the discussion touched on the topic of\nour paper, and it felt good to have a lot to contribute in class. There was\nsome good debate about the competing points of view &mdash; specifically,\nthere was a lot of interest in what I had written but that Anna had\nremoved. Sam, although usually pretty quiet during class, even got in on\nthe discussion and made a few good observations, although I\'m not sure\neveryone really understood them. I landed in a pretty smart group. </p>\n\n<p> After class, we met briefly as we decided last week. Kim did a great\njob on the paper again, and Sam\'s diagrams were mostly spot on. One of them\nseemed odd, but I couldn\'t explain why. Fortunately, Anna understood and\nasked Sam to make a few changes in line with my comments. Sam said he\nwasn\'t a good enough artist, however. He said that he agreed with me and\nthat he\'d like to be able to do it, but he doesn\'t have the skill. I can\'t\nreally argue with that, can I? Even like this, the diagrams really help to\nspruce things up and I didn\'t want to spend that much time on them, anyway\n&mdash; I was much more interested in the class discussion. Since Kim had\ndone such a great job, most of our own comments and changes weren\'t\nrelevant any longer, so we mostly just handed them to her to incorporate\nfor next week. </p>\n\n<p> When I wanted to talk about fixing our paper because the class was\ninterested in what I wanted to say, Anna said it was boring and that she\ndidn\'t have time to explain all the problems with it and asked if we wanted\nto hold our regular meeting to discuss it. Of course, we couldn\'t do this\nbecause we all had other study sessions to go to, but Sam also wanted to\ninclude my perspective. Finally, Anna gave in and agreed to add a section\non it, but she wouldn\'t let me to write it &mdash; like I\'d screw it up or\nsomething! She said that she didn\'t want us turning in something that was\n\"sloppy\" &mdash; my work is not sloppy! Fortunately, Kim spoke up and asked\nAnna if she\'d be OK with me writing it if she reviewed it first. Anna was\nOK with that, so Kim asked me to get it to her by mid-week. I feel like a\nchild, but whatever. </p>\n\n<p> I wanted to make sure that Anna couldn\'t complain about it being\n\"sloppy,\" so after spending an hour and a half writing the new section, I\nspent another hour proofreading it the next night before sending it to Kim.\n</p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(79,6,9,'<p> Kim had our paper ready to be submitted when she arrived in class. She\nalso brought a copy for each of us to review. I took a look that evening\nand Kim had done a great job of adding in my new section. She\'d made a few\nchanges to make it clearer, but mostly used what I gave her. I thanked her\nduring the week and she appreciated it. She also told me that she\'d be\nabout ten minutes late to our meeting this week. I mentioned it to Sam when\nI saw him in a class we share.  </p>\n\n<p> Unfortunately, we took this as a reason not to rush to our meeting, but\nno one mentioned it to Anna. She was packing up to leave when I arrived.\nOops. She seemed really uptight and stressed in the meeting. She\'s never\nbeen fun, but this seemed different &mdash; she must have been really\nangry. </p>\n\n<p> Anna had a long list of changes to the paper and some of them were big,\nbut no one said anything &mdash; I know I was feeling guilty and I imagine\neveryone else was, too. She asked us all to take another look at the whole\npaper and read it straight through for next week to make sure we haven\'t\nmissed anything. </p>\n\n<p> Our next task was to begin preparing for the presentation. Anna drafted\na PowerPoint for us to use, and then assigned slides to each of us. At one\npoint, she asked if anyone was upset with their piece and no one was, so\nshe kept going. She told us we needed to write up our talking points for\neach of our slides and practice a few times in front of a mirror for next\nweek. </p>\n\n<p> I am pretty comfortable with my topic, and it didn\'t take me long to\nwrite down some notes on index cards. Honestly, I\'m pretty good at public\nspeaking, so I don\'t think I need to prep too much. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(80,6,10,'<p> Wow! Anna found nothing but fault in my presentation! She pointed out\neverything I forgot to include and didn\'t seem to like anything about what\nI did include. To be fair, she wasn\'t the only one, but she was pretty\nharsh. No one else did a great job, either &mdash; including Anna. She\nmight think she\'s much better than all of us, but even she had a bunch of\nthings to fix.  </p>\n\n<p> Sam\'s slides looked better than everyone else\'s because he used a lot\nof the diagrams he\'d drawn, but he missed a few important points that\nweren\'t represented in them. Kim\'s was probably the best of all, but she\nspoke very quietly to her notes, rather than to the audience. After three\npractice runs, everyone took home a list of things to fix their\npresentations. </p>\n\n<p> I spent an hour and a half reworking my part &mdash; and then about\nhalf an hour practicing it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(81,6,11,'<p> In class, the instructor returned the drafts to the groups, and we met\nbriefly during class to review it. The instructor left only six comments in\nour paper, but one at the front of the paper read, \"Interesting approach! I\nlike that you reached beyond what we did in class.\" The instructor clearly\npraised the section I got Anna to include. Another comment complimented the\nimages. One of the comments indicated a need to further develop a section,\nand another asked us to recheck one of our references. I couldn\'t wait to\nsee Anna\'s reaction to the instructor\'s comment! I even fixed my\npresentation accordingly. </p>\n\n<p> Our meeting was frustrating because Anna wouldn\'t even consider the\nidea that the instructor\'s comment was referring to my addition. I can\'t\nbelieve I walked in thinking the paper would change the way I wanted it to.\nI walked out glad that I was able to keep any of my work in at all. Both\nSam and Kim stayed out of the discussion. When I asked what they thought,\nthey just shrugged. Anna said she\'d make the changes the instructor\nrequested this week. </p>\n\n<p> Everyone\'s presentations were better this week, but we still need more\npractice and rework. Sam and Kim had both fixed some parts of theirs, but\nwe spent most of the meeting fixing other parts. Anna had improved upon\nhers significantly since last week. I don\'t know how she did it, but it\nsounded perfect. Finally, we talked about how we should dress for the\npresentation. Kim had a cool costume idea that was in keeping with our\ntopic that Sam and I both liked, but Anna said that would look\nunprofessional. She said we had to wear business clothes. When we ended the\nmeeting, Anna reminded everyone that our presentation is in just two weeks.\n</p>\n\n<p> Since I still had my old notes, it only took me about fifteen minutes\nto get my presentation back in shape again. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(82,6,12,'<p> Kim let me know that she\'d be late because of another meeting, so we\nstarted without her. We spent some time reviewing Anna\'s changes to the\npaper, and then she asked Sam about the reference we needed to check on. He\njust laughed and rifled through his notes. He explained that it was a\nplaceholder he threw in while he was writing, and he never got around to\nreplacing it with the correct one. I got the feeling that he left it in\nthere just to see if anyone would notice it at all. </p>\n\n<p> Kim arrived just as Anna finished looking at the changes. Kim asked us\nto take another look, but Anna told her to review it after the meeting,\ninstead. Although it didn\'t seem like anyone made very many changes, the\npresentation felt much better this week. Whatever it was, after two\npractice runs, we sounded smooth. While it\'s still running too long, we\nagreed that everyone will probably speak faster in class, and the\ninstructor probably won\'t be a stickler on time. </p>\n\n<p> We decided to end early this week, but before we split up, Anna\nwouldn\'t be Anna if she didn\'t remind everyone to wear formal business\nclothes to the presentation next week. </p>\n\n<p> I practiced once this week with a friend, but mostly I focused on my\nother coursework. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(83,6,13,'<p> We were the only group dressed professionally, and I think that\nprobably earned us some points. Kim managed to speak loudly and clearly\nenough that the instructor only had to ask her to speak up once. I stumbled\non my first few sentences, but then I relaxed and I think it went well. The\nbiggest surprise, though was Sam, he added an analogy at the end that not\nonly tied everything together, but also made everyone laugh. It was\nunexpected and risky, but it worked out well. There weren\'t a lot of\nquestions for us and naturally, Anna stepped forward to answer them. </p>\n\n<p> I think we can expect positive feedback and good grades. </p>\n\n<p> Since the paper is mostly finished, we all decided to cancel this\nweek\'s meeting and instead each give the paper one last review for the\nfollowing week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(84,6,14,'<p> At the final meeting, we compared notes and found that we had no major\nchanges to make. Kim took all four versions and said she\'d make what few\nchanges there were and submit it at the end of the week. Anna asked her to\nsend it to her first, because I guess she doesn\'t completely trust her. Kim\nwas annoyed by this, but said she\'d do it. </p>\n\n<p> As far as I know, the paper went in on time as planned and I imagine\nwe\'ll get a good grade. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(85,7,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. I think we got lucky because Anna is already a sophomore while\nthe rest of us are freshmen. It seems like she knows what she\'s doing. </p>\n\n<p> The project is fairly open-ended, so we brainstormed topic ideas for\nthe rest of the time. Kim was quiet, but Jose, Anna and I all volunteered a\nfew topics. Two of mine were meant to be jokes, but no one seemed to\nunderstand them. The third was serious, but no one seemed to understand it,\neither, which is frustrating. Everyone loved it when Anna suggested the\nsame thing a little later. She had a bunch of good ideas and I don\'t think\nshe was stealing my idea or anything, I just said it wrong. Anyway,\neveryone thinks Anna is brilliant, so we focused on her suggestions. </p>\n\n<p> Before the meeting ended, we narrowed it down to five ideas. Anna told\nus we should each look for resources on one topic and then report back next\nweek. She spoke up for the topic she explained more clearly than me, and I\nquickly spoke up for another one I liked. After a few moments, Jose took\nanother. Kim said she\'d take the last two, but I guess Anna\'s concerned, so\nshe offered to take one herself. However, Kim insisted that she could\nhandle it, and eventually Anna split it with her. </p>\n\n<p> I spent about 30 minutes researching my topic this week and I think\nwe\'re off to a good start, so I feel pretty good. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(86,7,2,'<p> We began the meeting by going over the materials we collected over the\nlast week. Anna was clearly disappointed, but I didn\'t understand what the\nproblem was. This was only the second week and we were just trying to\nnarrow down the topic.  </p>\n\n<p> Anna laughed and started asking questions about the materials I\'d\nfound. They were very in-depth questions, and it\'s not as though we needed\nto know all of that now. However, she argued that we would need to know the\nanswers to evaluate the topics effectively, and she could answer those\nquestions for hers. I didn\'t agree with her, but I didn\'t want to fight\nabout it, so I said I did. </p>\n\n<p> Jose suggested that, in the interest of time, maybe we just go with the\ntopic she worked on, but Anna insisted told us that we had to redo our\nwork. She pointed out that we all need to be able to do the research\n&mdash; and maybe one of the other topics would be better for our group.\nShe\'s going to be a pain in the neck. We all agreed with her and said we\'d\nredo our work. </p>\n\n<p> The next night, I spent about another hour and a half on finding and\nskimming through new materials. Most of my materials were still fine, but I\nread more of them and now I can defend them. I found some extras, as well.\nI\'m really liking this topic and I\'m becoming convinced that this is the\none to go with. There\'s lots of material on it and it\'s just plain\ninteresting! </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(87,7,3,'<p> During this week\'s meeting, we sorted through the materials we\'ve got\nto evaluate to decide on a topic and we have much better materials this\nweek. I really like the topic I researched, but Anna is pushing for the one\nshe took initially. I tried to explain how we could touch on so many\ndifferent areas with mine, but that\'s exactly why Anna doesn\'t like it\n&mdash; she thinks that we wouldn\'t be able to focus ourselves. Kim seemed\nto understand what I\'m saying and agreed with me, but Jose supported Anna.\nWe went back and forth for most of the meeting and really it was a pretty\ngood discussion, but in the end, Anna won Kim over.  </p>\n\n<p> After the topic was settled, there wasn\'t much time left, but Anna\njumped right into drafting an outline, and she wouldn\'t let anyone else\nhelp. I suggested something I\'ve used before to try to make the paper\neasier to read, but Anna didn\'t like it and wanted to go with a more\nconventional approach. She figured that we just didn\'t know how to write a\npaper, so she spent about ten minutes explaining to us what an outline is\nand why we use it. No one made any comments on the outline after that. </p>\n\n<p> Jose suggested that we each take a few of our sources, search for more\non our own and then write up summaries for next week so we\'re ready for the\nfirst assignment. Anna agreed and started assigning them out. However, she\ndid it like she\'d decided that she was the only one with a brain and she\ndidn\'t trust any of the rest of us to get anything right, so she took all\nthe materials that were actually interesting and offered any depth &mdash;\nstrange, since she made such a big deal out of making sure we were all\n\"learning\" during the initial research. I wasn\'t the only one upset &mdash;\nKim spoke up first to request a specific topic and then Jose and I joined\nin. This clearly irritated Anna, but eventually she gave in and we each\nclaimed the ones we most wanted. She still couldn\'t let go, though, and\nwhen Jose claimed one that she wanted, she told him she\'d \"help\" him with\nit because it was very complex. He wasn\'t happy about that. </p>\n\n<p> I spent about an hour reading, searching and getting started on the\nsummaries one night this week, but figured I\'d do the rest next week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(88,7,4,'<p> I made a mistake. I forgot to finish my summaries until about half an\nhour before our meeting. Not only was I late to the meeting as a result,\nbut I didn\'t have time to finish, either. Jose was just arriving when I\nwalked in and Anna got upset with us both for being late, but then she was\neven more upset when we shared our work. Anna wasn\'t sure who to be more\nupset with: me or Jose. Kim\'s work was OK, but Jose\'s were a bit on the\nbrief side. However, after she got through my first three summaries, there\nwas no hiding the fact that I\'d forgot two of them. I apologized and\nexplained that I\'d had a lot to do for my other classes. Both Kim and Jose\nunderstood, but Anna just couldn\'t let it go. </p>\n\n<p> Then she showed us her pieces which went way beyond \"summary\" and\nlooked like completed portions to be added directly into the paper. She\nasked why we didn\'t all include pointers to where the summaries should\nultimately fit in the paper like she did. Kim argued with her on this. She\nasked why Anna\'s written so much already when we\'re so early in the\nproject. After all, we only have the preliminary structure done and this is\nonly the fourth week of class. Anna got upset and asked how anyone would be\nable to put anything together using materials as thin as this.  </p>\n\n<p> That\'s when I spoke up. I tried to lighten the mood by pointing out\nthat mine wasn\'t just thin, it was nonexistent, and everyone laughed. It\nwasn\'t that funny, really, but I think we needed it. I also volunteered to\nassemble next week\'s assignment, since I still had pieces to do. Finally, I\ntried to move us on by suggesting that we take a look at what we\'d got and\nwhether or not the outline we put together still fits. The truth is I was\njust trying to get Anna to move beyond the poor quality of everyone\'s work.\n</p>\n\n<p> The discussion was OK, and Kim offered some really good ideas about how\nto sequence things. I thought they were good ideas, but we really didn\'t\nhave time to put them together. There was just no way I could get all of\nthat done in the next week. However, Anna really liked the idea and started\ngetting upset with me for not having time. I know I screwed up this week,\nbut does she want me to mess up again next week? Fortunately, Kim stepped\nup and offered to make the changes if I could get the rest of it done by\nthe middle of the week. I accepted this and we decided to figure out the\ndetails after the meeting. </p>\n\n<p> Naturally, before we left, Anna had to remind everyone that we need to\nkeep working on our summaries because we\'ve got the draft due in another\nfour weeks. </p>\n\n<p> After the meeting, Kim asked me to let her know when I was done with my\npart and when I did, she suggested that we meet at the library the next\nevening. We got to talking about the project and other classes. Although\nshe\'s quiet, she seems to notice everything. She even pointed out that she\nliked how my topic idea was turning out &mdash; she noticed that I was\nreally the first one to suggest our topic! </p>\n\n<p> Anyway, we both had time, so we sat down to work together on the\nrevisions and it was so easy to work with her. At one point, though, she\nblocked what I thought was a good idea, asking if I thought I could\nconvince Anna to go along with it. It\'s annoying, but she was right. We\nfinished the writing much quicker than I\'d expected &mdash; maybe an hour\nor so.  </p>\n\n<p> All told, I think I spent about two and a half hours on this outside of\nour weekly meeting. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(89,7,5,'<p> Kim had our assignment ready and turned it in during class. The\ninstructor allowed some time at the end of class this week, so we all\nreviewed what she and I put together. Anna was pleased with what we\'d done,\nso the meeting went pretty smoothly. </p>\n\n<p> Kim and I arrived a couple of minutes early for our meeting and we were\njoking, but then Anna showed up and we got down to business. After working\nwith Kim last week, I really see how the paper is taking shape. I suggested\nthat maybe we further build out our summaries into the paper. Anna just\nlooked at me like I was dumb and said that we had to break it up into\nquarters because each of the summaries would be represented in multiple\nplaces in our outline. I thought we weren\'t quite ready to start on the\nactual paper yet, but I couldn\'t explain that and she\'d already decided,\nanyway.  </p>\n\n<p> That\'s when Jose showed up and said we should take the week off! He\nargued that we had to wait for the instructor\'s feedback. Kim and I\njokingly encouraged him, but I don\'t think he thought it was a joke. I\'m\npretty sure Anna didn\'t, either, because she got very upset and spent the\nnext ten minutes explaining that the instructor probably would barely look\nat our papers, much less provide meaningful feedback. She pointed out that\nit\'d probably be weeks before we got anything back and by that point we\'d\nhave no time left to get our draft together. She kept on about how we\ncouldn\'t stop now because we\'d want to take a break later during midterms.\nShe was right about all of it, of course, but Jose was really disappointed.\nHe said he\'d be late next week either way because of practice. </p>\n\n<p> We split the paper up into quarters and each took a section to write up\nfor next week. </p>\n\n<p> My section was supported by some of my own summaries, as well as a lot\nof Anna\'s work and some of Kim\'s. I have to admit that Anna\'s a good\nwriter. She really made it easy for me to put things together with her\nnotes and pointers. She provided a nearly-complete set of instructions for\nme to follow in building out the paper. It\'s like she\'s known exactly how\nthis paper would look from the very beginning.  </p>\n\n<p> I had some ideas for diagrams that would help to make some things\nclearer, so I went ahead and drafted them. I spent a lot of time on this\nbecause I sort of get absorbed in trying to make my art perfect. As a\nresult, I probably spent about two and a half hours on everything together.\n</p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(90,7,6,'<p> Kim and I arrived at around the same time for the meeting this week.\nAnna got there a few minutes later and we reviewed our work. Kim had done\nwell with her piece and we spent a long time talking about some of her\nobservations and what they could mean in other parts of the paper. My\nwriting is nowhere near as good, but Anna was distracted by the images I\nincluded. I have to admit that I\'m pretty proud of them. We spent some time\nlooking through Anna\'s and Kim\'s pieces, trying to come up with visuals\nthere, too. Kim said that she\'d add a chart using some of her data, but\nAnna told me to do it.  </p>\n\n<p> At first I was happy because I had fun with them, but Kim responded\nthat she hadn\'t done a lot of that sort of thing before and wanted to try\nit even if she then handed it to me to clean up. I thought it was a good\nidea, but Anna seemed not to hear it. She said I should do it because I\'m\ngood at it &mdash; but it didn\'t feel like a compliment. It feels like\nthat\'s all I\'m good for. I thought it should all be shared around, anyway?\nHow else is everyone going to learn? </p>\n\n<p> Then Jose arrived and he reminded us that his team was preparing for\ntheir upcoming game and he\'d be late for the next couple of weeks as a\nresult. I think he\'s here on a sports scholarship. Anyway, he was very\nupset when we looked at Anna\'s changes to his work. I didn\'t see what he\ngave her, so I\'m not sure, but he said she ripped out or rewrote most of it\nand I believe it. She\'s always telling everyone what to do (he\'s right) and\nshe clearly doesn\'t think much of him or his work. Anna said she was just\ntrying to make sure the paper looks and feels consistent.  </p>\n\n<p> This time, Jose wasn\'t backing down, though, and they probably would\nhave argued for the rest of the meeting, but Kim spoke up. She commented\nthat even though the paper is much different from what she thought it would\nbe, it was turning out well. Jose asked us to at least consider including\nthe perspective that Anna ripped out, but Anna tore the idea apart as too\nconventional and obvious. She said that we would wind up with just another\nboring paper that anyone could write and that we\'d have to spend a huge\namount of time rewriting the paper that way &mdash; she asked if Jose\nwanted to do a complete rewrite for next week. At this, Jose gave up and we\ndecided to keep the paper as she\'d written it. We didn\'t bother looking at\nJose\'s work for this week because he would have to make some major changes\nto it, anyway. </p>\n\n<p> I enjoyed working on images again this week and they all look even\nbetter now. The team offered good suggestions, but also I had some more\nideas. I really like doing this kind of work. With that and the substantial\ncleanup I needed to do to the written portion, I probably spent almost\nanother hour and a half this week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(91,7,7,'<p> Jose was a little late again when he arrived this week, but this time\nhe was visibly limping. I\'m not sure if Anna thought he was faking it or\nwhat, but she asked him to \"please try to be on time in the future\" in an\noverly polite tone. This set Jose off and he sniped back that it didn\'t\nmatter since she was obviously writing the whole thing herself however she\nwanted. Kim spoke up to calm them both down. She even made everyone,\nincluding Anna, confirm (out loud) that we are all equals, working on this\nproject together. Of course, Anna had to remind us that she had more\nexperience than anyone else, but Kim pushed us on anyway. </p>\n\n<p> Anna was clearly disappointed with my work this week, but it wasn\'t too\nbad and the images were good. We decided to swap papers with each other to\nproofread them; and she took mine. Everyone was OK with this, but Kim\nwanted to get started on assembling the paper and volunteered to do that,\nas well. At first, Anna said no because it would be tough to match the\nindividual pieces with the assembled document so that we could make the\nchanges, but Kim said she\'d take care of it. </p>\n\n<p> As we were getting ready to go, Jose asked if anyone would mind\nchanging our meeting time for next week &mdash; he has a study session to\nprepare for one of his midterms. I thought that was a great idea I because\nalso have midterms coming &mdash; I suggested that we cancel it, since the\npaper is in pretty good shape. Naturally, Anna said no. She said we should\nstill meet, but that we can do it briefly, immediately after class to share\nour changes. </p>\n\n<p> I took Anna\'s piece and so there wasn\'t much to clean up (she\'d\nprobably change it all back, even if I had). I was able to read through it\nquickly. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(92,7,8,'<p> During this week\'s class, some of the discussion touched on the topic\nof our paper and it felt good to be so well prepared. There was some good\ndebate about the competing points of view and Jose spoke up a lot. I made a\nfew comments, but, as usual, they didn\'t quite come out right. I could see\nthat no one seemed to quite understand what I was saying. I\'m not good at\nthat sort of thing. </p>\n\n<p> After class, we met briefly as we decided last week. Kim did a great\njob on the document again; she made a lot of changes on my portion. Jose\npointed out a problem in with part of my piece, but I didn\'t get it until\nAnna got impatient and told me I\'d forgot one of the diagrams. I had to\nexplain that I\'d actually spent about half an hour on it and couldn\'t make\nit work. I\'m not actually trained as an illustrator or an artist or\nanything. They were all disappointed, but naturally, Anna just told me to\ntry harder. I said I\'d try again, but honestly, I don\'t what more to do.\n</p>\n\n<p> I asked about our in-class discussion and how we wanted to address that\nin the paper. After all, it was clear that there were multiple points of\nview and we should at least acknowledge them. Anna said those approaches\nwere boring and that she wasn\'t going to throw away a good paper &mdash;\npointing out that our existing approach showed that we are both creative\nand thoughtful.  </p>\n\n<p> I agreed with Anna in general, but I pointed out that we need to at\nleast acknowledge the in-class conversation. Anna gave in a little bit and\nallowed a brief section, but didn\'t want Jose to write it because she was\nnervous that his work wasn\'t very good and we wouldn\'t have time to clean\nit up by the time the draft is due next week. Jose was offended by this,\nbut Kim told Anna she\'d review it if Jose could get it to her quickly and\nAnna was OK with that. So Kim asked him to get it to her by mid-week. Jose\naccepted this. </p>\n\n<p> I spent another half an hour on trying to rework the diagram, but I\'m\nsure it\'s not what Anna wants. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(93,7,9,'<p> Kim had our paper ready to be submitted when she arrived in class, and\nshe also brought a copy for each of us to review. I had to leave right\nafter class, but I took a look that evening and it looked good to me. </p>\n\n<p> Later in the week, Jose and I got to talking after a class we share,\nand he told me that this week\'s meeting would start about ten minutes late.\nUnfortunately, it seems that no one mentioned this to Anna. She was getting\nready to leave when we arrived. She\'s usually very serious, but this week\nshe seemed to be even more uptight and stressed &mdash; she was probably\nreally angry. </p>\n\n<p> Anna had a long list of changes to the paper and some of them were\npretty big, but no one said anything &mdash; I know I felt guilty and I\nimagine everyone else did, too. She told us all to take another look at the\nwhole paper and read it straight through for next week to make sure we\nhaven\'t missed anything and no one argued. </p>\n\n<p> Our next task was to begin preparing for the presentation. Anna drafted\na PowerPoint for us to use and then assigned slides to each of us. At one\npoint, she asked if anyone was upset with their piece and I think everyone\nwas afraid to make her mad, so she kept going. Then she told us we needed\nto write up our talking points for each of our slides and to practice a few\ntimes in front of a mirror for next week &mdash; like we\'re all children\nwho have never presented anything before. </p>\n\n<p> I think the images do a pretty good job of communicating the main\nideas, so I used some of them as the basis for my slides. Since am pretty\ncomfortable with my topic, I didn\'t bother with any notes. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(94,7,10,'<p> Wow! Maybe I should have practiced a bit? While everyone liked my use\nof images, they basically said that I focused on them and didn\'t explain\nthe topics well. No one else did a great job, either &mdash; including\nAnna. She had a bunch of things to fix and Jose seemed to be almost happy\nto be able to criticize her for a change. She didn\'t like that at all and\nasked if he was trying to make the presentation better or make her feel\nbad. He shut up after that.  </p>\n\n<p> Even after three practice runs together, everyone took home a list of\nthings to work on to fix their presentations. Kim\'s was probably the best\nof all, but she spoke very quietly to her notes in her own hands, rather\nthan to the audience. </p>\n\n<p> I actually spent an hour and a half reworking my part &mdash; and then\nabout half an hour more practicing it (in front of a mirror). </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(95,7,11,'<p> In class, the instructor returned the drafts to the groups and our team\nmet briefly during class to review it. The instructor left only six\ncomments in our paper, and most of them were pretty small, but one\ncomplimented my images. The only other one that seemed significant asked us\nto further develop a section. </p>\n\n<p> Our meeting opened with another fight between Anna and Jose. Jose\ninterpreted one of the comments to mean that he should write more in the\nsection about alternative perspectives, and Anna disagreed. Anna talked\ndown to him a lot and told him why he couldn\'t be right, and that just kept\nmaking him angrier, but it was clear that he couldn\'t win. I didn\'t want\nhim to win either, because it would mean rewriting the whole paper. Jose\nfinally gave up, and Anna said she\'d make the changes the instructor\nrequested this week. </p>\n\n<p> The presentations were better this week, but we still need more\npractice and rework. Anna had improved upon her presentation significantly\nsince last week. I don\'t know how she did it, but it sounded perfect.  </p>\n\n<p> We also talked about how we should dress for the presentation. Kim had\na cool costume idea that was in line with our topic that Jose and I both\nliked, but Anna said it was unprofessional. She said we had to wear\nbusiness attire so we would look professional. When we ended the meeting,\nAnna reminded everyone that our presentation is in just two weeks. </p>\n\n<p> I had a few small changes to make and did a few practice runs this\nweek, but probably not more than 45 minutes. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(96,7,12,'<p> We had to start without Kim this week because she left a message with\nJose that she\'d be late due to a meeting for another class. We spent some\ntime reviewing Anna\'s changes to the paper, and then she asked me about an\nincorrect reference that the instructor found. I\'ve got to be honest, I am\namazed that the instructor noticed it. I explained that it was just a\nplaceholder I threw in while he was writing.  </p>\n\n<p> Kim arrived just as Anna finished looking at the changes. Kim asked us\nto take another look, but Anna told her to look at it after the meeting,\ninstead. Although it didn\'t seem like anyone made many changes, the\npresentation felt much better this week. After two practice runs, we\nsounded smooth. While it\'s still running too long, we agreed that everyone\nwill probably speak faster in class and the instructor probably won\'t be a\nstickler on time. </p>\n\n<p> We decided we could finish early this week, but before we ended, Anna\nreminded everyone to wear formal business clothes to the presentation next\nweek. </p>\n\n<p> I practiced once this week with a friend, but mostly I focused on my\nother coursework. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(97,7,13,'<p> We were the only group where everyone looked professional, and I think\nthat probably earned us some points. Everyone spoke loudly and clearly\nenough that the instructor only had to ask Kim to speak up once. Jose\nstumbled on his first few sentences, but then he relaxed and I think it\ncame out well, overall. I went last and I added an analogy at the end that\nI think tied things together nicely, and it made everyone laugh. There\nweren\'t a lot of questions for us and naturally, Anna stepped forward to\nanswer them. </p>\n\n<p> I think we can expect positive feedback and good grades. </p>\n\n<p> Since the paper is mostly finished, we all decided to cancel this\nweek\'s meeting and instead each give the paper one last review for next\nweek. Anna told us to read through the paper one more time to make sure we\nhad everything, but we\'ve all got finals to prepare for. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(98,7,14,'<p> At the final meeting, we compared notes and found that we had no major\nchanges to make. Kim took all four versions and said she\'d make what few\nchanges there were and submit it at the end of the week. Anna asked her to\nsend it to her first, because I guess she doesn\'t completely trust her. Kim\nwas annoyed by this, but said she\'d do it. </p>\n\n<p> As far as I know, the paper went in on time as planned and I imagine\nwe\'ll get a good grade. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(99,8,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. Anna\'s a sophomore and I think her experience is valuable, but\nshe\'s also very pushy. Jose seems like he\'ll work hard, but I especially\nlike Sam. The way he speaks is a bit strange because he uses a lot of big\nwords. It doesn\'t seem like he\'s showing off or anything, he just thinks a\nlot about the words he uses. The trouble is that he often doesn\'t seem to\nuse them quite right. </p>\n\n<p> The project is fairly open-ended, so we brainstormed topic ideas for\nthe rest of the time. We all volunteered a few topics, but I didn\'t have\nany ideas, so I kept my mouth shut. I\'m pretty sure that one of Sam\'s\nsuggestions was a joke and one of them I couldn\'t understand at all, but\none of them was a really good idea. No one seemed to understand any of\nthem, and I didn\'t want to say anything. Later, I was surprised when Anna\nsuggested the same thing as though it was brand new. I don\'t think she was\ntrying to steal credit or anything, I just think she didn\'t understand him.\nAnyway, it\'s a good idea. </p>\n\n<p> Before the meeting ended, we narrowed it down to five ideas. Anna told\nus we should each look for resources on one topic and then report back next\nweek. She spoke up for a topic she\'d already worked on in another class and\nSam quickly spoke up for another. Jose eventually took another one and I\nsaid I\'d take the two that were left. Anna didn\'t like that and said she\'d\ntake one of them, but I put my foot down &mdash; she\'s not going to walk\nall over me. Ultimately, we compromised and split it. </p>\n\n<p> I spent about an hour researching my topic this week and I think we\'re\noff to a good start, so I feel pretty good. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(100,8,2,'<p> We began the meeting by going over the materials we\'d collected over\nthe last week. Anna was clearly disappointed, and she didn\'t hide it well.\nShe spent most of the meeting talking about how she did her research and\nit\'s a big help, but makes me feel like I\'m a child. I\'m going to have to\ndo a lot of it again. Sam asked some questions indicating that he didn\'t\nsee why his materials are mostly unusable, and Anna just laughed at him.\nHe\'s braver than I am, though, because he asked again. Anna responded with\na few detailed questions that Sam couldn\'t answer. She then went to her own\nnotes to answer the same questions. It seemed cruel, and I\'m glad it wasn\'t\nme because I couldn\'t have answered those same questions. Sure, they are\nimportant, but we\'re new to this and she\'s already worked on this topic\nbefore. </p>\n\n<p> Jose suggested that, in the interest of time, maybe we just go with the\ntopic she worked on, but Anna insisted that we had to redo our work. She\npointed out that we all need to be able to do the research She was right\n&mdash; even if it\'s a pain in the neck. I just wish she was nicer about\nit. Sam and Jose also agreed with it. </p>\n\n<p> After the meeting, I pulled Anna aside and told her that she was out of\nline in being so rude to Sam. It was uncalled for and I just couldn\'t stand\nby and let her do it. She pled innocent, though. She said that she honestly\nthought he was joking the first time, and she didn\'t mean to insult him.\nShe said it wasn\'t intentional, but that she\'ll try to be more sensitive in\nthe future. </p>\n\n<p> The next night, I spent another hour finding and skimming through new\nmaterials. I was actually still able to use most of my original materials.\nI found a bunch of additional ones, too. I don\'t love this topic, though,\nso it feels like a waste of time. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(101,8,3,'<p> During our meeting, we sorted through the materials we had to decide on\na topic. There was some conflict between Sam and Anna &mdash; Sam pushed\nfor the topic he\'d researched, while Anna made up her mind that we\'d go\nwith hers. I didn\'t want to get involved, but as Sam explained it, it did\nsound like more fun. It had a lot of potential to let us touch on lots of\ndifferent areas &mdash; but that\'s exactly why Anna didn\'t like it &mdash;\nshe thought we wouldn\'t be able to focus ourselves. Jose is supporting Anna\n&mdash; I think he\'s scared of her. We went back and forth for most of the\nmeeting and it was a pretty good discussion, but in the end, we went with\nAnna\'s topic. It\'s a pretty good one, and it\'s also clear that she will not\ngive up. </p>\n\n<p> After the topic was settled, there wasn\'t much time left, but Anna\njumped right into drafting an outline and she wouldn\'t let anyone else\nhelp. Sam suggested something to make the paper easier to read, but Anna\ndidn\'t like it and wanted to go with a more conventional approach. She\nfigured that we just didn\'t know how to write a paper, so she spent about\nten minutes explaining to us what an outline is and why we use it. No one\nmade any comments on the outline after that. </p>\n\n<p> Jose suggested that we each take a few of our sources, search for more\non our own and then write up summaries for next week, so we\'re ready for\nthe first assignment. Anna agreed and started assigning them out. However,\nshe acted like she was the only one with a brain and didn\'t trust any of\nthe rest of us to get anything right She took all the materials that were\nactually interesting and offered any depth &mdash; strange since she made\nsuch a big deal out of making sure we were all \"learning\" during the\ninitial research. This was not OK, so I told her which topics I\'d take. Sam\nand Jose backed me up by making their own preferences known.  </p>\n\n<p> We spent time negotiating who took what, but it was much better than\nher assignments. This clearly irritated Anna, but with everyone\ndisagreeing, there wasn\'t much she could do. She couldn\'t let go entirely,\nthough, and when Jose claimed one that she wanted, she told him she\'d\n\"help\" him with it because it was very complex &mdash; does she not see how\ninsulting that is? </p>\n\n<p> I spent about an hour and a half on reading, searching and getting\nwriting my summaries this week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(102,8,4,'<p> Jose and Sam were a bit late to the meeting. Anna was visibly upset,\nbut she didn\'t say anything about it. Sam explained that he forgot to\nfinish two of the five parts he was working on, and I thought she was going\nto explode. I don\'t see why this was such a big deal since we\'ve still got\ntime before even the first assignment. After we took a look at everyone\'s\nwork, she couldn\'t contain herself any longer and asked why no one had done\ntheir work. She compared what we brought to what she brought. She\'s got\nwhat looks like completed portions to be added directly into the paper.\n</p>\n\n<p> I told her to give it a rest &mdash; we still have time and no one was\nslacking off, but she got upset and asked how I would be able to put\nanything together using materials as thin as this. That\'s when Sam spoke\nup. He made a joke about how poorly he\'d done with his part &mdash; his\nwasn\'t just thin, it was nonexistent. It wasn\'t actually funny, but\neveryone laughed, and he volunteered to assemble next week\'s assignment\nsince he still has pieces to do. He also suggested that we take a look at\nwhat we\'ve got and whether the outline we put together still fits. It was\nreally either that or fight for an hour, so everyone is all for it. </p>\n\n<p> I had some new ideas about how to sequence the paper Anna particularly\nliked one idea, but Sam pointed out that he wouldn\'t have time to do it\nall, and she started getting upset again. I offered to make the changes if\nSam could get the rest of it done by the middle of the week. Sam gladly\naccepted this and we decided to coordinate later.  </p>\n\n<p> Naturally, before we left, Anna had to remind everyone that we need to\nkeep working on our summaries because we\'ve got the draft due in another\nfour weeks. </p>\n\n<p> After the meeting, I asked Sam to let me know when he was done with his\npart. When he was done, I suggested that we meet at the library the next\nevening. We got to talking about the project and I pointed out that I knew\nour topic was his idea first. I think he really appreciated that. We worked\ntogether on the revisions and it went smoothly, with me doing most of the\nwriting. There was only one time we disagreed and that was just because I\ndidn\'t think we could make Anna go along with Sam\'s idea. It\'s just not\nworth fighting with her. We finished the writing quicker than I expected\n&mdash; maybe an hour or so.  </p>\n\n<p> The day after I met with Sam, I cleaned everything up and put it all\ntogether for submission. All told, I think I spent about two hours on this\noutside of our weekly meeting. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(103,8,5,'<p> I turned in our assignment in class and the instructor allowed us some\ngroup time at the end of class, so we all reviewed what Sam and I put\ntogether. Anna was particularly pleased with what we\'d done, so the meeting\nwent well. </p>\n\n<p> Sam and I arrived a couple of minutes early for our meeting and we were\njoking a bit, but then Anna showed up and we got down to business. Sam was\nreally getting excited about the paper, and he suggested that we further\nbuild out our summaries into the paper. Anna looked at him like he was dumb\nand told him (like it was obvious) that each of the summaries would fit in\nmultiple places in our outline. He looked confused &mdash; like he wasn\'t\nquite sure what he was trying to say, but that\'s when Jose showed up and\njoked that maybe we should take the week off! He argued that we had to wait\nfor the instructor\'s feedback, anyway. I thought it was funny, so I\nencouraged him, but then I realized he didn\'t think it was a joke. Of\ncourse we would have to keep working if we wanted to get everything done in\ntime.  </p>\n\n<p> Anna took both of us seriously and got upset. She spent the next ten\nminutes explaining that the instructor probably would barely look at our\npapers, much less provide meaningful feedback. She pointed out that it\'d\nprobably be weeks before we got anything back at all and by that point we\'d\nhave no time left to get our draft together. She also made the point that\nif we kept going, we might be in a good place to break later during\nmidterms. Jose was disappointed and said he\'d be late next week either way\nbecause of practice. </p>\n\n<p> We split the paper into quarters, and we each took a section to write\nup for next week. </p>\n\n<p> My section was supported by some of my own summaries, as well as a lot\nof Anna\'s work and I have to admit that Anna\'s a good writer; she made it\neasy for me to put things together with her notes and pointers. It\'s like\nshe\'s known exactly how this paper would look from the very beginning. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(104,8,6,'<p> Again, Sam and I arrived at around the same time for the meeting this\nweek. Anna arrived a few minutes later, and we reviewed our work. We spent\na long time talking about some of my observations and what they could mean\nin other parts of the paper. Anna was distracted from Sam\'s poor writing\nskills by his impressive artistry. This pushed us to spend some time\nlooking through Anna\'s and my pieces to try to come up with good visuals\nthere, too. I volunteered to add a chart of some of my data, but Anna said\nno, because she wanted Sam to do it. I haven\'t really done that kind of\nwork, and I wanted to give it a shot, but Anna still wouldn\'t let me. She\nwants me to do the proofreading because she thinks I\'m really good at it\n(even if it is boring), and she doesn\'t want me to be overworked. It\'s not\nworth fighting about it. There\'ll be other projects... </p>\n\n<p> When Jose arrived, he reminded us that his team is preparing for their\nupcoming game and he\'ll be late for the next couple of weeks. He was very\nupset when we looked at Anna\'s work because I guess she changed a lot of\nwhat he wrote. I didn\'t see what he gave her, so I\'m not sure, but he said\nthat he feels like Anna\'s ignoring or ripping out the work of everyone who\ndoesn\'t do what she wants (true). He pointed out that she\'s always telling\neveryone what to do (he\'s right). Anna said she was just trying to make\nsure the paper feels unified in its vision.  </p>\n\n<p> They probably would have argued for the rest of the meeting, but I\nfigure that since Anna\'s part of our team, we\'re going to have to work with\nher. She\'s got good ideas, so I pointed out that even though the paper is\nmuch different from what I\'d thought it would be, it was turning out well.\nJose asked us to at least consider including the perspective that Anna\nripped out. Anna said no, because we would end up with just another boring\npaper that anyone could write; we\'d have to spend a huge amount of time\nrewriting the paper that way. She asked if Jose wanted to do a complete\nrewrite for next week. At this, Jose gave up and we decided to keep the\npaper as she\'d written it. We didn\'t look at Jose\'s work because he would\nhave to make some major changes to it. </p>\n\n<p> I spent about half an hour cleaning up my part a little more, but that\nwas about all for this week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(105,8,7,'<p> Jose was late again when he arrived this week, but this time he was\nvisibly limping. I\'m not sure if Anna thought he was faking it, but she\nrudely told him to \"please try to be on time in the future.\" Naturally,\nthis set Jose off, and he shot back that it didn\'t matter since she was\nbasically writing the whole thing herself. Seeing that this was going\nnowhere, I tried to calm everyone down. I reminded everyone that we\'re all\nequals working on this project together, and I even made Jose and Anna both\nsay so out loud. Of course, that won\'t make any difference to Anna, but it\nmade Jose feel better. </p>\n\n<p> After reviewing each other\'s work, we decided to swap papers to\nproofread them. I took Jose\'s, but I also wanted to get started on\nassembling the paper, so I also volunteered to do that. Anna said no at\nfirst, because she thought I couldn\'t handle matching up everyone\'s\nproofreads with the assembled paper, but I promised that I\'d reassemble it\nnext week if I couldn\'t match things up. I felt uncomfortable that we still\nhadn\'t seen all the pieces together. </p>\n\n<p> As we were getting ready to leave, Jose asked if anyone would mind\nchanging our meeting time for next week &mdash; he had a study session to\nprepare for one of his midterms. I also have midterms to study for and Sam\nsuggested that we cancel the meeting, since the paper is in pretty good\nshape. Naturally, Anna said no. She said we should still meet, but that we\ncould do it briefly, immediately after class to share our changes. </p>\n\n<p> I proofread everyone\'s papers as I was putting them together into the\nfinal paper this week. It took me about two hours, and I had to move a\nbunch of things around, but it made me feel better to know that we were\nalmost ready to turn this thing in. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(106,8,8,'<p> During this week\'s class some of the discussion touched on the topic of\nour paper; both Jose and Sam spoke up during the discussion. There was some\ngood debate about the competing points of view. Sam\'s comments made sense\nto me because I know him at this point, but he doesn\'t explain himself\nwell, and I\'m not sure it made sense to anyone else. </p>\n\n<p> After class, we met briefly as we decided last week. Everyone was\nexcited to see the full paper. Jose and Anna pointed out a problem with one\nof the images and asked Sam to fix it, but he said he couldn\'t. Anna was\ndisappointed, but Sam said he\'d already tried to fix it and it always came\nout worse instead of better. Finally he said he\'d give it another try, and\nthat was enough to let us move on. </p>\n\n<p> Sam asked about our in-class discussion and how we wanted to address\nthat in the paper. It was clear that there were multiple points of view,\nand we should at least acknowledge them. Anna listened for a bit but soon\ngot tired of it and told Jose that would make the paper boring. Compared\nwith what we\'ve got, she\'s kind of right.  </p>\n\n<p> Sam pointed out that we need to at least acknowledge the in-class\nconversation, and Jose jumped on this, volunteering to add a section about\nit. Anna agreed, but didn\'t want Jose to write it because I guess she\ndoesn\'t trust him to make it look good enough to turn in next week. I said\nI\'d review it when Jose got it to me and then integrate it. Anna was OK\nwith that. I asked Jose to get it to me by mid-week. Anna caught me on the\nway out and told me to make sure to keep the new section brief. </p>\n\n<p> Jose got the new section to me late in the week, but there was still\nplenty of time for me to put everything together for class. I probably\nspent about an hour on it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(107,8,9,'<p> In addition to the copy to be turned in, I brought copies of our draft\nfor each of us to review. I couldn\'t stay after class to discuss it,\nthough, and I guess no one met, anyway. This was going to be a busy week\nfor me with an unexpected project dropped on me in another class.  </p>\n\n<p> Later in the week, Jose thanked me during the week for putting the\npaper together, and it really made my day. I told him that I\'d be a little\nlate to the meeting because of this other project I had to work on; he said\nhe\'d let the others know. When I arrived, I learned that Jose told Sam but\n\"forgot\" to tell Anna. She sat in the meeting alone with no idea what was\ngoing on. That was a pretty awful thing to do and, although she tried to\nhide it, Anna was definitely hurt. I felt terrible. </p>\n\n<p> Anna had a long list of changes to the paper and some of them were\npretty big, but no one said anything &mdash; I know I felt guilty. I\nimagine everyone else was, too. She asked us to take another look at the\nwhole paper, and read it straight through for next week to make sure we\nhaven\'t missed anything. </p>\n\n<p> Our next task was to prepare for the presentation. Anna drafted a\nPowerPoint for us to use and then assigned slides to each of us. At one\npoint, she asked if anyone was upset with their piece and no one was, so\nshe kept going. Then she told us we needed to write up our talking points\nfor each of our slides and to practice a few times for next week. </p>\n\n<p> I had a lot to cover in my portion, so it took me awhile to put\ntogether a set of notes. I spent a lot of time practicing it and reworking\nit to try to make sure it fit the time allowed and to make sure it felt\nlike it flowed properly. I don\'t like public speaking, but if I\'m prepared\nthen I\'ll be OK. Two hours later, I felt OK. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(108,8,10,'<p> Wow! I don\'t know what Jose and Sam were thinking &mdash; it looks like\nthey just threw together some notes and didn\'t bother trying with anything\nelse. They spoke way too long and were off-topic throughout. Anna had\nobviously put more thought into it, and I could tell that she\'d actually\npracticed, but she also needed a lot of work. I like Jose, but he seemed to\nbe almost happy to be able to criticize her for a change, and that was\ndisturbing. She didn\'t like that at all and asked if he was trying to make\nthe presentation better or make her feel bad. He shut up after that.  </p>\n\n<p> After three practice runs together, everyone took home a list of things\nto fix their presentations. I need to look out at the audience and speak\nlouder &mdash; that sounds easy, but it\'s just not. More practice for me.\n</p>\n\n<p> I spent about half an hour practicing this week and asked one of my\nfriends to listen to it. She liked it and gave me a few recommendations,\ntoo, but mostly it was just good to practice in front of real people. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(109,8,11,'<p> In class, the instructor returned the drafts to the groups and we met\nbriefly during class to review it. The instructor left only six comments in\nour paper, and most of them were pretty small, but one asked us to further\ndevelop a section. </p>\n\n<p> Our meeting started with another fight between Anna and Jose. Jose\ninterpreted one of the comments to mean that he should write more in the\nsection about alternative perspectives, and Anna, predictably, disagreed.\nAnna talked down to him a lot, and that just kept making him angrier, but\nit was clear that he wasn\'t getting anywhere. It would mean rewriting the\nwhole paper and no one wanted that. Ultimately, Jose gave up and Anna said\nshe\'d make the changes the instructor requested this week. </p>\n\n<p> The presentations were better this week, but we still need more\npractice and a bunch of rework. Jose changed his part in response to what\nhe thought the instructor was saying, but he said he\'d change it to make\nsure it was still in line with what everyone else wrote. We do have the\nnote in the paper, so I guess he\'s got that covered.  </p>\n\n<p> Anna had improved upon hers significantly since last week. I don\'t know\nhow she did it, but it sounded perfect. Most importantly, this time Sam\nfocused on our content rather than the diagrams. Finally, we talked about\nhow we should dress for the presentation. I thought it would be a great\nidea to have costumes in keeping with our topic and both Jose and Sam liked\nthat, but Anna said it would make us look like children. She said we had to\nwear business attire so we would look professional. When we ended the\nmeeting, Anna reminded everyone that our presentation is in just two weeks.\n</p>\n\n<p> I had a few small changes to make and did a few practice runs this\nweek, but probably not more than half an hour. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(110,8,12,'<p> I had to be late this week because of another meeting. When I arrived,\nAnna was finishing up looking at the changes. I asked that we take another\nlook, but Anna told me that it would be better for me to look at it after\nthe meeting, instead &mdash; for the sake of time. Although it didn\'t seem\nlike anyone made very many changes, the presentation felt much better this\nweek. Whatever it was, after two practice runs, we sounded smooth. It\'s\nstill running too long, but the group agreed that everyone will probably\nspeak faster in class, and the instructor probably won\'t be a stickler on\ntime. </p>\n\n<p> When everything looked and sounded good, Anna actually suggested we end\nearly this week, and everyone agreed. However, before we left, Anna\nreminded everyone to wear formal business clothes to the presentation next\nweek. </p>\n\n<p> I practiced once this week with a friend, but mostly I focused on my\nother coursework. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(111,8,13,'<p> We were the only group dressed professionally, and I think that\nprobably earned us some points. I think that all my practice paid off; the\ninstructor only had to ask me to speak up once. Jose stumbled on his first\nfew sentences, but then he relaxed and I think it came out well overall.\nThe biggest surprise, though was Sam; he added an analogy at the end that\nnot only tied everything together, but it also made everyone laugh. It was\nunexpected and risky, but it worked out well. There weren\'t a lot of\nquestions for us and naturally, Anna stepped forward to answer them. </p>\n\n<p> I think we can expect positive feedback and good grades. </p>\n\n<p> Since the paper is mostly finished, we all decided to cancel this\nweek\'s meeting and, instead, each give the paper one last review for next\nweek. Naturally, Anna told us to read through the paper one more time to\nmake sure we had everything.  </p>\n\n<p> I have to admit that I am sick of that paper, and I didn\'t look at it\nat all. It\'s good enough to turn in as it is, and I won\'t make it any\nbetter at this point. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(112,8,14,'<p> At the final meeting, we compared notes and found that we had no major\nchanges to make. I took all four versions to make what few changes there\nwere and submit it at the end of the week. For some reason, Anna didn\'t\ntrust me, though, and asked me to send it to her first. What am I going to\ndo &mdash; ruin it? Of course she still wanted me to put it together, she\njust wanted to make sure she\'s the one to submit it.  </p>\n\n<p> I am so glad this project is over and I hope I never wind up on a team\nwith her again. Of course I said I\'d do it, but I had to keep reminding\nmyself that it was almost over. </p>\n\n<p> Making the changes went pretty quickly and I got her the paper the next\nday. I assume the paper went in on time as planned, and I imagine we\'ll get\na good grade. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(113,9,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. The project is fairly open-ended, so we brainstormed topic ideas\nfor the rest of the time. </p>\n\n<p> Iain had some really good ideas &mdash; it seems he\'s done this sort of\nthing before. I only had a couple of ideas and none of them are as good as\nhis, but I volunteered both of them anyway. When Marie spoke, I wasn\'t sure\nif she was serious or not. Her suggestions were usually funny &mdash; but\nI\'m not sure they were meant to be. She definitely has a unique approach.\nHannah mostly just listened throughout &mdash; maybe she\'s shy. We built on\neach other\'s suggestions (mostly Iain\'s). </p>\n\n<p> Before the meeting ended, we narrowed it down to three ideas, and Marie\nrecommended we each look for resources on one topic to report back next\ntime and select a topic. This seemed like a pretty good approach, and we\nall agreed. Iain spoke first to claim one topic based upon a prior\ninterest. I spoke up next for another topic because I\'d heard of it before\nand had an idea of where to look. No one challenged me, so it\'s mine. After\nsome consideration, Marie spoke next, and that left Hannah without a topic,\nso we decided she should search for additional materials on Iain\'s topic.\nShe seems nice but hasn\'t said very much. </p>\n\n<p> After the meeting, I did some quick searches and turned up some\npromising materials for the following week. I feel pretty good about being\nable to contribute next week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(114,9,2,'<p> Hannah started getting upset because she had found few materials and\ncomplained that it was too difficult. Before I had a chance to speak, Iain\npointed out that he\'d gotten more than enough to start with and even\nvolunteered to explain to Hannah how he searched, so she would have a\nbetter idea for the future. </p>\n\n<p> After reviewing the topics and materials everyone found, there was a\nlot of discussion around which topic to choose. Everyone had an opinion.\nMarie led the group in writing out lists of pros and cons, and ultimately\nthe group held a vote and decided on the topic I researched. I was excited\nabout that, because it seemed the most promising and most of the group\nagreed. However, it wasn\'t the one Iain was pushing for, and he seemed\ngrumpy afterward. </p>\n\n<p> The materials I found were just the beginning, so the group divided the\ntopic into subtopics and we each took a few. Hannah and Iain planned to\nmeet separately so Hannah could learn some of Iain\'s research strategies.\nWe plan to have summaries of what we\'ve found for next week so we are ready\nfor the next assignment. </p>\n\n<p> I spent about two hours working on my task for the group. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(115,9,3,'<p> We began our meeting by sorting through the materials. Together, Iain\nand Hannah were able to collect some quality materials and the summaries\nthey\'ve written help Marie and I to understand their value quickly. Clearly\nthey\'ve put a lot of effort into the task. I felt bad when my turn came\nbecause, by comparison, I had to spend more time helping the team to\nunderstand what I found &mdash; I did write them all alone, though. I was\npretty sure the group mostly understood, but I told them I\'d rewrite the\nsummaries to make them clearer, and they were visibly relieved. Oops. </p>\n\n<p> Marie\'s summaries were somewhat better than mine, but I don\'t see how\nmost of them relate. They are interesting and some are funny, but how do\nthey fit in? Iain and Hannah seemed to be confused &mdash; it wasn\'t just\nme. None of us knew how to respond, but after some awkward moments, Iain\nlaid out a few direct questions and I would swear I saw a light bulb go on\nover Marie\'s head. Somehow, the way he asked those questions, she didn\'t\nseem to get upset at all! We all decided that there\'s plenty of time and\nthat we can wait to meet again next week to review the updated materials\nfrom Marie and I. </p>\n\n<p> I spent about two hours rewriting my summaries and even getting some\nmore materials. Maybe it wasn\'t the most productive time, but I really\ndidn\'t want to be embarrassed again, and I kept losing my focus. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(116,9,4,'<p> I spent another hour reviewing all the materials and proofreading my\nwork prior to the meeting. Iain was late by about five minutes, but Hannah\nwas not in class at all and had not arrived at our meeting by the time Iain\ndid. No one had heard anything from her, and she was unreachable using any\nof the contact information she provided. </p>\n\n<p> We went ahead and started without Hannah and began working through\nMarie\'s updated materials, and Iain and I became concerned.  After a few\nmore discussions that were reminiscent of last week, Iain pushed us to move\non; I was happy to join that effort. Marie, though a little confused, went\nwith it. Much less time was needed for my materials because I had improved\nthem a great deal.  Going into the fifth week, I said I\'d put together what\nwe\'ve got for our first assignment. Iain also pushed for us to get started\non an early draft, and we split up the tasks of synthesizing sections of\nthe paper. </p>\n\n<p> Iain caught me outside after the meeting broke up and expressed his\nconcerns about Marie and Hannah. We discussed the possibility of talking to\nthe instructor, but decided to wait for a bit longer since it was only the\nfourth week. Iain thought we could still use some of Marie\'s resources, and\nI volunteered to proofread (i.e. rewrite) her summaries, while Iain offered\nto search for additional content. </p>\n\n<p> I had to spend two nights making sense of those summaries and drafting\nmy portion of the paper. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(117,9,5,'<p> I turned in our assignment during class and it felt good to know that\nwe were on track. Our instructor gave us some of time in class to meet, and\nwe discussed our progress, but none of us expected to have this time, so no\none brought their materials to review. I was mostly finished with my\nportion already and it had gone pretty smoothly. Either everyone else was\nin the same position or they hadn\'t started working on theirs. Either way,\nit was a bit of a waste of time. </p>\n\n<p> Hannah was back for the meeting this week and wearing a cast. She\nslipped on some ice the weekend before and landed in the hospital for\nalmost a week. She did bring a first draft of the section that was assigned\nto her in her absence (I emailed meeting notes to the whole group last\nweek). </p>\n\n<p> Iain was noticeably less enthusiastic this week than he has been in the\npast, and seemed to be less patient with Marie. Also, his draft doesn\'t\nlook like he put much thought into it. There are a number of spots that\nread \"to be determined,\" and I didn\'t see any citations anywhere. Marie was\nclearly nervous when the group reviewed her work, but I was actually\nimpressed with how much she seems to have improved. That must have shown on\nmy face because she seemed to relax after she looked at me. Hannah and I\nboth pointed out a number of rough spots, but I was no longer nervous that\nMarie was struggling. Hannah explained that her own work was incomplete,\nand it clearly was, but (given the circumstances) everyone was just\nimpressed that she\'d done anything. The hours I spent writing paid off, as\nmine was easily the most complete. Usually Iain has a lot to say, but this\nweek he was really quiet. </p>\n\n<p> Marie suggested we each hand off our portion to another team member for\na more thorough review and I volunteered to take Iain\'s because I knew it\nwould need work. He, in turn, claimed mine, but Hannah wanted to take more\ntime to finish her own section. Marie, reminding us of Iain\'s early,\ninsightful comments, asked that he look at her work. Marie took mine. Wow!\nThey were all fighting to take my work! </p>\n\n<p> I spent a lot of time reworking Iain\'s paper. The language was clear\nand readable, but the sections felt thin. In fact, I grew one section so\nmuch that it had to be split out into two. Also, there were only two\ncitations listed and one of them was wrong. It\'s pretty bad and I\'m sure he\ncould have done better than this. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(118,9,6,'<p> Iain was in class this week, but he emailed the team about an hour and\na half before the meeting to say that there was a family emergency and that\nhe would not be able to make the meeting. He sent over his progress on\nMarie\'s part of the paper &mdash; and it didn\'t look he\'d done much more\nthan make the few changes we discussed in class last week. </p>\n\n<p> The meeting was fairly productive and I felt like I could see the paper\nstarting to take shape. Marie took an odd approach to revising my section;\nI think she didn\'t really understand it. Hannah seemed to agree with me,\nand Marie quickly said she\'d go ahead and change it back. The three of us\nspent awhile talking about how satisfied we were with the topic. Feeling\nlike much of the paper was in good shape, Hannah took the pieces home to\nassemble them into a full draft to use moving forward. </p>\n\n<p> Before the meeting ended, I asked about switching next week\'s meeting\ntime so I could meet with another study group &mdash; I really need to\nprepare for a mid-term exam the following week. After some discussion, we\ncouldn\'t agree on a new time, so we decided instead to meet only for half\nan hour. Marie sent an email to let Iain know of the change. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(119,9,7,'<p> This week turned out to be very busy, so I\'m glad we decided to cut the\nmeeting time down. Hannah gave everyone a copy of the document she\nassembled. After about 15 minutes of what was scheduled to be a half-hour\nmeeting, Iain had not arrived, so we all decided to walk through what\nHannah put together. </p>\n\n<p> Hannah clearly spent a lot of time putting everything together. The\nformatting was consistent and I didn\'t see anything missing. There\'s one\nempty section, but she explained that it\'s because she added it &mdash;\nbeing the only one who\'s read it all through, she felt it was necessary. I\njokingly suggested that Iain should write it; Marie quickly countered\nthat\'d mean I\'d end up writing it, anyway. Hannah interrupted our joking\nand said we were being mean. I think she felt bad because, in the\nbeginning, Iain had helped her. She reminded us that he was going through a\nfamily emergency and maybe he was really shaken up by it. I felt a little\nbadly and we all returned to reviewing the document. </p>\n\n<p> Once we finished walking through the document, we agreed to make\nnotes/corrections/suggestions on our own for next week. As we were all\ngetting ready to leave, Iain came in the door of the meeting room. Hannah\nquickly asked him if he was doing OK and what was going on &mdash; it\nseemed like she was afraid Marie or I would have said something mean if she\ndidn\'t speak first. He said his brother was going through something that he\nwas helping him with. We gave him a copy of the paper, and quickly\nexplained what we\'d all be doing for next week. </p>\n\n<p> I only spent about 30 minutes reviewing the document, because I had a\nlot of studying to do for mid-terms, but there is be more work needed\nbefore this project is ready. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(120,9,8,'<p> Everyone was there by the time I arrived this week. My instructor let\nme take a little extra time on my mid-term, which helped me out, but made\nme a little late to the meeting. </p>\n\n<p> Marie has a great eye for detail &mdash; she found spelling and\nformatting errors that everyone else missed. Hannah volunteered to take\neveryone else\'s copies and make all the changes for the draft we turn in\nnext week in class. When I asked about the section that was still missing,\nIain said he thought it was too late to get it into the draft. He figured\nit should be fine to include a note that it will be in the final version\nand he made it clear that he wasn\'t going to do it. I didn\'t think this was\nOK. Marie agreed, and volunteered to draft the section and get it to Hannah\nby the middle of the week. Honestly, I\'m a little nervous about Marie\nwriting it, but it was clear that Iain wasn\'t going to do it, and I really\nneed a break from this project. Hannah figured she wouldn\'t have time to do\nboth the editing and the writing, but agreed to add the new content if\nMarie could write it in time. All Iain offered Marie were some (pretty\ngood) suggestions on how to approach the new content. </p>\n\n<p> The next evening, Marie asked if I could come over to help get the\nsections done in time. She was stressed because some surprise assignments\nin other classes gave her less time than she\'d expected. I said OK, and\nwhen we met up, I found that it was much more complicated than it looked.\nWorking together, we were able to write a decent draft so she could deliver\nit to Hannah the next day, but it took most of the night. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(121,9,9,'<p> Hannah didn\'t provide copies to everyone before class, and that was\nnerve-wracking, but she did have one to turn in to the instructor. She\nturned it in and now we get to wait for feedback. Of course, we already\nknow some of the work that needs done. </p>\n\n<p> Working with Marie last week, we noticed some problems in the draft\nthat will need correcting &mdash; particularly stuff that Iain supposedly\nworked on. It\'s like he didn\'t even touch it. Just before Iain left for\nanother meeting, Marie suggested we could use some diagrams to illustrate\nsome of our points. Iain watched us sketch for a bit before he left. We\ncame up with some good ideas and Marie volunteered to draw them out. I\noffered to reread the entire document and the meeting ended a bit early\nbecause we were mostly done anyway. </p>\n\n<p> I spent another two and a half hours reworking the document this week.\n</p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(122,9,10,'<p> Marie and I both arrived early to this week\'s meeting, and started\nlooking at the images she put together over the past week while we waited\nfor Hannah and Iain to arrive. The images were a bit odd and I don\'t think\nsome of them are appropriate. When Hannah arrived, she said that Iain had\nlet her know he won tickets to the game tonight, and so he couldn\'t make it\nto our meeting &mdash; nothing new there.  </p>\n\n<p> Hannah said she really liked the images Marie put together. They\nreflect Marie\'s quirky personality, but Hannah pointed out that they also\ninclude the right details to get the point across. She described them as\nfunctional, eye-catching, and memorable. They are memorable, but I don\'t\nthink that was the goal here. I wish Iain had showed up, because he always\nseems to have a good feel for the project\'s direction. I\'m pretty sure he\'d\nagree with me, but I felt outnumbered. I made a few requests to tame them\ndown, but ultimately I accepted it, and we moved on. </p>\n\n<p> I\'d made a lot of changes to the document, and some of them were pretty\nbig. I walked through them at a high level to make sure everyone agreed\nbefore starting to prepare for the presentation. We decided on a basic\nstructure and, for the next meeting, we decided that we should each put\ntogether notes or a script for what we would say during our part so we can\npractice it next week. Hannah said she\'d pass this on to Iain. </p>\n\n<p> I\'ve had a difficult time writing my script, so one afternoon I emailed\nIain to see if we could meet and work on it together. However, when I\ndidn\'t hear back from him, I met up with Hannah instead. After working\ntogether for an hour, we both made some good progress. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(123,9,11,'<p> In class, the instructor returned the drafts to the groups and gave us\ntime during class to review it. Unfortunately, while we know there were\nmany problems with that version, the instructor left only five comments in\nour paper. One said, \"This shows promise,\" two corrected grammar issues\nthat we\'ve already fixed, one requested that page numbers be added, and one\nsuggested clarifying one of the sections Marie wrote initially, saying it\nwas a novel approach and that it should be explained more clearly and\nthoroughly. </p>\n\n<p> Everyone arrived on time to the group meeting. The discussion began\nwith how little feedback we received, and whether this meant the paper was\nin great shape or that instructor simply didn\'t really read it. Either way,\nwe had the feedback we\'d been waiting for, and it was time to move forward.\n</p>\n\n<p> Marie asked Iain to review her section again, and he answered that he\nhad already done so once at her request. Marie responded in a snarky tone\nthat she\'d like him to \"actually read it this time.\" This became an\nargument, with Marie accusing Iain of not participating in the group. Iain\nattacked back, saying that the low quality of her work made it very\ndifficult to work with. That wasn\'t fair, and I started to defend Marie for\nat least working and trying hard, and showing up, when Hannah raised her\nvoice and everyone quieted down. She reminded the group that the\npresentation was coming up soon and that we needed to practice. Iain said\nthat, while he wouldn\'t have time to go through the entire paper, he would\ntake a look at Marie\'s section again before next week. </p>\n\n<p> The rest of the meeting was spent working through the presentation.\nMarie put together a PowerPoint and we did a practice run. Iain really\nseems to have put a lot of time into his part; he sounded very polished. He\nalso had many suggestions for the rest of us, but, honestly, they were hard\nto hear after the argument we just had. By the end of the meeting, the\npresentation was still running too long. I have to make decisions on how to\ncut my part down, but with two weeks left, I feel pretty good about it.\n</p>\n\n<p> I spent about an hour on revising and cutting content from my\npresentation during the week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(124,9,12,'<p> Everyone arrived on time for the meeting this week. Iain provided\nfeedback on Marie\'s section and, reading through it, it became clear that\nmaking these changes would require more substantial changes throughout the\npaper. We could easily have just ignored them because what we have is not\nwrong, but making the changes would certainly improve the paper. However,\nso close to the end of this class, I\'m not sure we have the time to do this\n&mdash; especially with everyone getting ready for final projects and\nexams. It would have been nice if he\'d bothered to read the paper earlier,\nwhen it would have been easier to make these changes. Why didn\'t he even\ntry to start making them?  </p>\n\n<p> Hannah said she thought she had time to make the changes this week, and\nvolunteered to try if someone else would read through it next week. When no\none else responded, I volunteered. She\'s been doing a good job and checking\nit over shouldn\'t be a huge amount of work, even with all my other\nclasswork to prepare. </p>\n\n<p> This week, the presentation was much better. After three practice runs,\nit sounded smooth. While it was still running a bit too long, we agreed\nthat everyone will probably speak faster in class, and the instructor\nprobably won\'t be so strict about timing. </p>\n\n<p> This week, aside from practicing my part of the presentation, I mostly\nfocused on my other classes and end-of-semester activities. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(125,9,13,'<p> The presentation went very smoothly. Hannah seemed nervous, spoke too\nquickly, and faced the PowerPoint instead of the class, but she knew what\nshe was talking about and that showed. The audience asked some good\nquestions, which showed that they understood the presentation, but Iain\nseemed to want to score points by answering most of the questions. I\nstarted to answer one, but he cut me off and he talked right over me as he\nanswered himself. Also, we should have discussed attire beforehand, because\nIain wore a suit, while Hannah and Marie were both wearing dress skirts and\nblouses. I felt out of place in my usual jeans and a sweater. </p>\n\n<p> At our meeting this week, everyone commented on my casual clothes and I\napologized, but I just never thought about it. Aside from that, the group\nfelt good about the work we\'ve done, and we all agreed that we expected\npositive feedback and good grades. Hannah shared her updated version of the\npaper and I took it to review (as we had discussed last week).  </p>\n\n<p> As we were leaving, Marie asked me to send her a copy as soon as I\nfinished reviewing Hannah\'s corrections, so she could take another look at\nit. I spent about an hour reading through the new version, but I only made\na few changes and then sent it on to Marie. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(126,9,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. Iain volunteered to do a final read,\nprint the document and send it to the instructor. Marie started to attack\nIain for not helping the group &mdash; I think she felt like he was trying\nto steal credit for all our work at the end &mdash; just like he did with\nthe presentation. I was too tired for that, though, and I just wanted the\nproject to be over, so I tried to calm her down and Hannah joined me. I\nsuggested that Marie submit the latest version she had at the deadline, and\nif Iain was able to get her his updates by that time, they\'d go in;\notherwise, she should use what she had &mdash; Marie would send it in. Iain\nwas annoyed, but agreed. </p>\n\n<p> After the deadline, Marie confirmed that Iain got his changes to her in\ntime for her to submit them, and she sent a copy of the finished product to\nthe entire group. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(127,10,1,'<p> In group time the first week, we began by setting up weekly group\nmeetings. The project is fairly open-ended, so we brainstormed topic ideas\nfor the rest of the time. </p>\n\n<p> Iain had some really good ideas &mdash; it seems he\'s done this sort of\nthing before. John tried to be involved by suggesting a couple of ideas,\nbut they were pretty mediocre. I like to look at things from a different\nperspective, so I suggested some things that were not exactly off-topic,\nbut not entirely serious, either. However, they seemed to fall completely\nflat; not only didn\'t they spark conversation, but I didn\'t even get a\nchuckle. Throughout the meeting, I could tell that Hannah was listening,\nbut maybe she\'s shy, because she didn\'t say much. Pretty quickly we built\non Iain\'s suggestions. </p>\n\n<p> Before the meeting ended, we narrowed it down to three ideas. I\nrecommended that we each look for resources on one topic, report back next\ntime and then select one; everyone else agreed. Iain claimed a topic based\nupon a prior interest, and John spoke up for another. I reluctantly\nvolunteered for the last topic, leaving Hannah without one. She said she\'d\nsearch for additional materials on Iain\'s topic. </p>\n\n<p> I didn\'t find much on my topic, so I got creative in my interpretation\nit &mdash; hopefully it will at least be good for a laugh. I was\nuncomfortable with what I have, but I know I\'ve tried. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(128,10,2,'<p> Hannah was upset because she had found very few materials &mdash;\ncomplaining that there was nothing to find. Iain pointed out that he had\nmore than enough to start with, and even volunteered to explain how he\nsearched to Hannah after the meeting, so she would have a better idea for\nthe future. </p>\n\n<p> After reviewing the topics and the materials everyone found, there was\na lot of discussion around which topic showed the greatest promise. I\ndecided to organize what everyone was saying into lists of pros and cons to\nmake it easier to understand. The topic I\'d looked at was quickly removed,\nbut both John\'s and Iain\'s looked good. Iain pushed really hard for his\ntopic, but I just couldn\'t seem to get as excited about it. Eventually, we\nheld a vote and decided on the topic John had researched. I was pretty\nhappy with the decision, but Iain seemed grumpy afterward. </p>\n\n<p> The materials John had found were just the beginning, so we divided up\nthe major subtopics among us. Hannah and Iain planned to meet separately so\nshe could learn some of his research strategies. We planned to return next\nweek with summaries of what we\'ve found to make it easier for the group to\nget moving quickly. </p>\n\n<p> With John and Iain\'s work as a model, I spent about three and a half\nhours over this week working on my task for the group &mdash; I don\'t want\nto feel stupid again at the next meeting. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(129,10,3,'<p> We began sorting through the materials at this week\'s meeting. Iain and\nHannah were able to collect some quality materials, and the summaries\nthey\'ve written help me understand their value quickly. They\'ve clearly put\na lot of effort into the task. John\'s materials, on the other hand, were\ndifficult to understand and required his help in interpreting what he\nmeant. He seemed embarrassed and told us he\'d rewrite the summaries to make\nthem clearer. My summaries got some laughs, but the group seemed to be\nconfused by them. Their questions make it clear that they didn\'t see the\nsame value in them that I did &mdash; and their questions also made me see\nwhy. They were being polite, but I could still tell. Finally, Iain asked a\nfew direct questions that helped me to understand everything a bit\ndifferently &mdash; he\'s really got good control on this whole project.\nEveryone agreed that there is plenty of time, and that we can wait until\nnext week\'s meeting to review the new and updated materials from John and\nme. </p>\n\n<p> I spent another two hours getting new materials and rewriting my\nsummaries. Hopefully this was time well spent. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(130,10,4,'<p> Iain was late to the meeting by about ten minutes, but Hannah was not\nin class at all, and didn\'t show up for the meeting, either. No one had\nheard anything from her, and no one could reach her. </p>\n\n<p> We began the meeting by working through our updated materials, and Iain\nand John were still concerned. After a few more questions that were\nreminiscent of last week, Iain pushed to move on. I\'d only got through\nabout half of my materials, but they didn\'t seem all that pleased. I felt\nstupid because I guess I still don\'t get it, so I was happy to move on.\nJohn\'s materials, on the other hand, were really solid, and he volunteered\nto put together what we\'ve already got so we can turn it in next week. Iain\npointed out that we really needed to get a draft going. John echoed this\nand I agreed, so it was settled. We split up the tasks of synthesizing the\nsections before we ended the meeting to keep us moving forward.  </p>\n\n<p> I spent an entire evening drafting my portion of the paper, and then I\nspent most of another day reworking it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(131,10,5,'<p> John turned in our assignment during class, and our instructor gave us\nsome of time in class to meet. We discussed our progress, but none of us\nexpected to have this time, so no one brought their materials to review. I\nhad already finished with my part, and I thought it was OK. Either everyone\nelse was in the same position or they hadn\'t looked at it. We all left\nearly. </p>\n\n<p> Hannah was back this week and wearing a cast. She slipped on some ice\nthe weekend before and it landed her in the hospital for a week. She did\nbring a first draft of the section that was assigned to her in her absence\n&mdash; John emailed meeting notes to the whole group. </p>\n\n<p> Iain seemed like he didn\'t care this week, and he was a bit\ncondescending to me, too. He brought a draft of his portion, but it doesn\'t\nlook like he put much thought into it. There are a number of spots that\nread \"to be determined,\" and I didn\'t see any citations or references. I\nwas nervous when the group reviewed my work, but this time they actually\nseem satisfied with it &mdash; more than that, they seem impressed. I could\nread it on both John and Hannah\'s faces, and that was a relief. Iain seemed\nnot to have paid much attention at all, so I got little reaction there. It\nwasn\'t perfect, but mostly now it was grammar or spelling, so it wasn\'t a\nbig deal to me &mdash; it didn\'t leave me feeling stupid and confused.\nHannah explained that her work was incomplete, and it clearly was, but\n(given the circumstances) even this much was great to have. John\'s writing\nwas excellent. His piece was easy to read and made sense and he covered all\nthe points he was supposed to &mdash; he must be putting a lot of time into\nthis class. Throughout the meeting, Iain was really quiet. </p>\n\n<p> When we were done, I suggested that everyone trade their portion to\nanother group member for a review. John volunteered to take Iain\'s and Iain\nclaimed John\'s &mdash; probably because it was already in such good shape.\nHowever, Hannah said she wanted to take more time to finish her section. I\ndidn\'t feel it was fair for Iain to take the easy task, so I reminded the\ngroup of Iain\'s early, insightful comments and asked that he look at my\nwork; I took John\'s, instead. </p>\n\n<p> John\'s portion was in great shape, and it didn\'t take me more than an\nhour to read through it and fix the few mistakes that were there. Then I\ngot an idea for presenting the information in a different way that could\nshed additional light on the topic. I spent an hour putting it together,\nbut when I looked at the clock and saw how late it was, I switched to my\nother classwork, because I still have time to finish this later. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(132,10,6,'<p> Iain was in class this week, but he emailed the group about an hour and\na half before the meeting to say that there was a family emergency and that\nhe would not be able to make the meeting. He included his work on my\nsection &mdash; and it didn\'t look he\'d gone any deeper than the few\nchanges we discussed in class last week. </p>\n\n<p> The meeting was pretty good, and I can see that the paper is definitely\nstarting to take shape. Unfortunately, I noticed when I got to the meeting\nthat I accidentally forgot to get back to my revisions of John\'s work.\nThat\'s probably a good thing, because John and Hannah don\'t seem to\nunderstand what I was doing, anyway. Maybe it was too much of a stretch. I\nhope they don\'t think I don\'t understand what\'s going on. The three of\nwound up spending awhile discussing how happy we were for choosing this\ntopic &mdash; it\'s more interesting than any of us expected. Feeling like\nmuch of the paper was in good shape, Hannah took the pieces home to\nassemble them into a full draft to use moving forward. </p>\n\n<p> Before the meeting ended, John asked about switching next week\'s\nmeeting time so he could meet with another study group. With mid-terms\ncoming, everyone agreed that we need extra time to prepare. However, we\ncouldn\'t agree on a new time, so we decided instead to meet only for 30\nminutes. I sent an email to let Iain know of the change. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(133,10,7,'<p> This week turned out to be very busy, so I was thankful the group cut\nthe meeting time down for this week. Hannah gave everyone a copy of the\ndocument she assembled. After about 15 minutes of what was scheduled to be\na 30-minute meeting, Iain had not arrived. We went ahead without him and\nwalked through what Hannah had put together. </p>\n\n<p> Hannah clearly spent a lot of time putting everything together. The\nformatting was consistent, and I didn\'t see anything missing. There was one\nempty section that she added, because she felt it was necessary after\nhaving read the whole piece. John joked that Iain should write it, and I\ntold him that would mean he\'d end up writing it anyway. We both laughed,\nbut Hannah got upset and said we were being unfair. She pointed out that\nIain had helped her in the beginning. I don\'t really believe he had an\nemergency last week, but we both stopped talking about it, and turned back\nto reviewing the document. </p>\n\n<p> Once we finished going through the document, we agreed to make\nnotes/corrections/suggestions for next week. As we were getting ready to\nleave, Iain walked in. Hannah quickly asked him if he was OK and what was\ngoing on. He said his brother needed him. We made sure he had a copy and\ntold him what we\'d all be doing for next week. </p>\n\n<p> I spent about two hours reviewing the document, because I wanted to\nmake sure I was doing my part &mdash; I didn\'t want to be seen as another\nIain. However, I had a lot of studying to do for mid-terms and there are\nstill many weeks left in the project, so I figured that was enough. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(134,10,8,'<p> Surprisingly, Iain was already there when I arrived. Everyone was\nimpressed by my attention to detail &mdash; it seems I found more errors\nthan anyone else. Hannah volunteered to take everyone else\'s copies and\nmake all the changes for the draft that we are supposed to turn in next\nweek in class. John pointed out the section that was still missing or\nincomplete. Iain said that it was too late to get it into the draft. He\nfigured it should be fine to include a note that it will be in the final\nversion. Clearly he wasn\'t going to fix it. I was uncomfortable with that,\nso I said I\'d draft the section and get it to Hannah by the middle of the\nweek. Hannah said that she\'d incorporate the new content if she got it in\ntime. Iain did offer some good suggestions on how to approach the new\ncontent, but that was all. </p>\n\n<p> The next evening, I asked John for help getting the section done in\ntime. I had less time than I\'d thought because of a surprise assignment in\none class and I already had to do major rework in another. Also, the\nsections were more complicated than they looked. He came over, and we were\nable to write a decent draft for me to give Hannah the next day &mdash;\nplenty of time. Working with John helped to ground me, I think. If it was\njust me doing this whole project, it would be much less conventional, I\nthink, but, working in a group, I don\'t get to do that. John kept reminding\nme of this with his \"let\'s just get it done\" approach. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(135,10,9,'<p> Hannah turned in our draft, and now we get to wait for feedback. </p>\n\n<p> We do, however, already know of some work that needs done. Last week,\nJohn and I noticed some problems in the draft that will need correcting.\nAlso, it seems Iain barely touched my work when I asked that he review it\n&mdash; and John pointed out a number of other areas that could be\nimproved. Iain had to leave early for another meeting, but when I suggested\nusing some diagrams to illustrate our points, he sat there for another five\nminutes of giving us nothing. We spent some time sketching ideas and then\neveryone was happy to let me clean them up &mdash; I\'d just taken an\nillustration class. John offered to reread the entire document.  </p>\n\n<p> I spent an hour putting together the diagrams. I\'m pretty proud of them\n&mdash; I got to use some of the skills I just learned, and I got to be\ncreative and experiment for the first time on this project. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(136,10,10,'<p> John and I started looking at the images I put together over the past\nweek while we waited for Hannah and Iain to arrive. He seemed to be\nindifferent toward them, but when Hannah arrived, she said that Iain let\nher know he won tickets to the game tonight and that he wouldn\'t be coming\nto our meeting &mdash; why should he start showing up now?  </p>\n\n<p> On a positive note, she said she really liked the images I\'d put\ntogether. John said they reflect my \"quirky personality,\" and Hannah\npointed out that they also included the right details to get the point\nacross. She called them \"functional, eye-catching, and memorable.\" After\nthat, although I could tell John was still uncomfortable with them, he\'d\naccepted it. He still said he wanted Iain\'s opinion, but just asked me to\nmake a few small changes. That takes some of the fun out of the images, but\nI\'m OK with that, as long as John and Hannah are. </p>\n\n<p> John made a lot of changes to the document, and some of them were\npretty extensive. However, he walked through them at a high level and\neveryone agreed, so we moved on to prepare for the presentation. For the\nnext meeting, we each took a part and decided that we should put together\nnotes or a script for what we would say so we could practice it next week.\nHannah said she\'d pass this on to Iain. </p>\n\n<p> I\'ve never minded public speaking, and I drafted a version of my script\nin about 30 minutes one evening. I also put together a PowerPoint, based on\nan outline of what everyone would cover. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(137,10,11,'<p> In class, the instructor returned our draft and we met briefly to\nreview it. Unfortunately, while we already knew there were lots of problems\nwith that version, the instructor left only five comments in our paper. I\nguess they expected much of it to change since it was only a draft, after\nall. One said \"this shows promise,\" two corrected grammar issues in\nsentences that were already gone, and one requested that page numbers be\nadded. The only thing valuable for me was a request to clarify one of the\nsections I wrote. The instructor said it was a \"novel approach\" and that it\nshould therefore be explained more clearly and thoroughly. It was nice to\nknow I\'d made an impression and that someone who counts got it! </p>\n\n<p> During the weekly group meeting, we were all on time. The discussion\nbegan with how little feedback we got and whether this means the paper was\nin great shape or that instructor simply didn\'t really read the whole\nthing. I\'m pretty sure it\'s the latter. Either way, I had the feedback we\'d\nbeen waiting for and it was time to move forward. </p>\n\n<p> I asked Iain to please review my section again and he responded that he\nalready did that once. I told him it\'d be nice if he would actually read it\nthis time; maybe that wasn\'t the best approach, because it turned into a\nshouting match, but I\'m upset that he didn\'t do his job in the first place,\nand I said that, too. I was trying to tell him that I really wanted his\nfeedback, but he got upset and snapped back that it was difficult to read\nmy work because it was so bad. I was too embarrassed to respond, but\nthankfully John jumped in and defended me (sort of), pointing out that at\nleast I showed up and tried hard. Hannah raised her voice and everyone\nquieted down. She focused us back on the presentation coming in two weeks\nand the fact that we hadn\'t practiced for it yet. Iain reluctantly agreed\nto take a look at my section again for next week but made sure to tell us\nhe was too busy to go through the whole thing. </p>\n\n<p> The rest of the meeting was spent working through the presentation. The\ngroup used the PowerPoint I put together in a practice run. We made a few\nchanges as we went, but I\'d made a pretty good start. Iain really seems to\nhave put a lot of time into his part and he sounded very polished. He also\nhad lots of suggestions for the rest of us, but they were a bit hard to\nhear after the argument we just had. The presentation was running too long\n&mdash; particularly John\'s part. He doesn\'t seem very experienced at this\nsort of thing and said way too much, way too fast.  </p>\n\n<p> I spent about an hour revising my portion of the presentation and\nrevising the slides during the week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(138,10,12,'<p> Everyone arrived on time for the meeting this week. Iain provided\nfeedback on my section and, in reading through it, it was clear that making\nthese changes would require larger changes throughout the paper. We could\neasily just ignore them because what we had was not wrong, but making the\nchanges was the better way to go. It\'s just frustrating because he could\nhave caught this much earlier if he\'d bothered to read the paper, but now\nit\'s so close to the end of class.  </p>\n\n<p> Hannah said she thought she could make the changes this week and\nvolunteered to try if someone else would promise to read through it next\nweek. After a pause, John volunteered. I can\'t believe that Iain didn\'t\nmake the changes when he saw that they were needed and then that he\nwouldn\'t bother to even read it. It\'s his fault we\'re in this mess. </p>\n\n<p> This week the presentation was much better. After three practice runs,\nit sounded smooth. It\'s still running too long, but we agreed that everyone\nwill probably speak faster in class and the instructor probably wouldn\'t be\na stickler on time. </p>\n\n<p> This week I focused on my other classes and end-of-semester activities.\n</p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(139,10,13,'<p> The presentation went very smoothly. Hannah got nervous, spoke too\nquickly and faced the PowerPoint instead of the class, but she knew what\nshe was talking about and it showed. The audience asked some good\nquestions, which showed that they understood the presentation. Iain kept\nstepping forward to answer most of the questions without giving anyone else\na chance &mdash; like he was trying to make it look like he\'d done much\nmore than he actually did. I think he even talked over John once. We should\nhave discussed attire beforehand, because everyone but John dressed up. He\nlooked out of place in his usual jeans and a sweater. I felt badly for him.\n</p>\n\n<p> At our meeting, Iain commented on John\'s casual clothes. John\napologized for it, but it felt cruel because he knew his part and was well\nprepared. He already seemed embarrassed about his choice of clothes. Aside\nfrom that, we felt good about the work we\'d done and we expect positive\nfeedback and good grades. Hannah shared her updated version of the paper\nand, after a quick review of the changes, we ended early with John taking\nthe paper to review it as we discussed last week.  </p>\n\n<p> As we were leaving, I asked John to send me a copy as soon as he\'s\nfinished so I could take one last crack at it before we turned it in. When\nhe did, I spent about an hour and a half reading through the new version,\nbut I didn\'t make any more changes. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(140,10,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. Iain volunteered to do a final read,\nprint it and send it to the instructor. When I asked why he should bother\nnow since he\'d barely contributed anything to it during the semester, both\nJohn and Hannah stopped me- I guess they just wanted the project to be\nover. John suggested that I send it to him and submit the latest version at\nthe deadline &mdash; if Iain could get his updates to me by that time,\nthey\'ll go in, but otherwise we should go with what I\'ve got. Iain was\nclearly annoyed, but he agreed. </p>\n\n<p> Iain got the document to me in plenty of time to send it in and there\nwere very few changes. After I submitted it, I sent a copy of the finished\nproduct to the entire team. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(141,11,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. The project is fairly open-ended, so we brainstormed topic ideas\nfor the rest of the time. </p>\n\n<p> Iain had some really good ideas &mdash; it seems he\'s done this sort of\nthing before. John tried hard to be involved, but only suggested a couple\nof ideas and they were pretty mediocre. When Marie spoke, I sometimes\nwasn\'t sure if she was serious or not. Her suggestions were often funny,\nbut I was too nervous to laugh &mdash; especially since no one else did.\nShe definitely has a unique approach. Mostly, I just took it all in. Soon,\nwe were building on each other\'s suggestions (mostly Iain\'s). </p>\n\n<p> Before the meeting ended, we narrowed it down to three ideas. Marie\nrecommended we each look for resources on one topic, report back next time\nand then select a topic. This seemed like a good plan; Iain spoke first to\nclaim a topic based upon a prior interest and John spoke up for another.\nAfter a moment, Marie took the last topic, but she didn\'t sound thrilled\nabout it &mdash; I think it sounds like a tough one. I was left without a\ntopic, so I volunteered to search for additional materials on Iain\'s topic\nbecause it sounded the most promising. </p>\n\n<p> After spending half an hour searching, I wasn\'t able to find much of\nanything. It was frustrating because Iain seemed so excited about it\n&mdash; I guess he\'s going to be disappointed. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(142,11,2,'<p> When I arrived, I felt uncomfortable because everyone had long lists of\nwhat they found and I had so little to offer. I asked how everyone found so\nmuch &mdash; especially Iain. He found so much more than I did on the same\ntopic! He said that he\'d got more than enough to start with and even\noffered to work with me after the meeting to help me. </p>\n\n<p> After reviewing the topics and the materials everyone found, there was\nsome debate regarding which topic to focus on. Marie decided to start\norganizing things into lists of pros and cons to make it easier to\nunderstand; when she\'d got some lists going, John\'s topic looked like the\nclear winner. We held a vote and decided on John\'s topic. This seemed like\na good choice, but I could tell Iain was hoping that his would be selected.\n</p>\n\n<p> The materials John found were just the tip of the iceberg, so we\ndivided up the major subtopics to research with summaries for next week.\nThis way we\'ll be ready for the first assignment and be able to start\nmoving quickly on getting this paper finished. </p>\n\n<p> I met with Iain two days later and he was still bummed about the topic\nthe group selected, but he\'s nice and we got along well. He also seems to\nhave much more experience than the rest of us do because, although he\nstarted with the same searches I did, he dug into the materials further to\nfind related content. It took about two and a half hours, but we found some\nsolid references. I went through them and wrote summaries, and then Iain\nverified them. I learned a lot and we both have a lot to bring to the next\nmeeting. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(143,11,3,'<p> This week, we began sorting through the materials we\'d all found.\nTogether, Iain and I had easily the best materials and summaries to offer.\nVery little time needed to be spent covering our work because there weren\'t\nany questions. John\'s summaries, though, were difficult to understand and\nwe needed his help in interpreting what he meant. It\'s not that the\nmaterials themselves were bad or anything, but he doesn\'t seem to have\nconnected all the dots when writing them up. He was embarrassed and told us\nhe\'d rewrite them to make them clearer. Marie\'s summaries were interesting\nand some were funny, but I wasn\'t sure how exactly they fit in &mdash; and\nI don\'t think anyone else could see it, either. Honestly, she seems to need\nhelp understanding what we\'re doing, and everyone is afraid to tell her so.\nAfter some awkward moments, Iain asked a few direct but fair questions. As\nMarie tried to answer, it seemed that she was finally realizing that what\nshe brought was really weak. He didn\'t push too hard though &mdash;\nprobably didn\'t want to make her feel stupid. We decided to wait for our\nnext meeting to review the new and updated materials from both Marie and\nJohn. </p>\n\n<p> I got to relax during the week without any tasks for this project. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(144,11,4,'<p> I slipped on some ice on my way to class and had to be rushed to the\nhospital to set a broken bone and get some stitches &mdash; it was pretty\nbad. They gave me some painkillers and I didn\'t react well to them. I\ncompletely forgot our team meeting until two days afterward, but by that\npoint, I was working hard to try to make up for lost time in all my\nclasses. John emailed me notes from the meeting and I did my best to try to\nput together my part of the paper, but I know it\'s not going to be close to\nperfect. I did spend a few hours on it, but it honestly wasn\'t my top\npriority. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(145,11,5,'<p> I didn\'t get to class, but I understand that John turned in the\nassignment for us. I was able to make it to the meeting this week and,\nnaturally, everyone was surprised to see my cast. They were even more\nshocked that I\'d brought a draft of my portion of the assignment. Of\ncourse, they didn\'t yet know that it wasn\'t very good. </p>\n\n<p> Iain seemed like he didn\'t care much this week and was a little bit\nmean toward Marie. He brought a draft of his portion, but it didn\'t look\nlike he put much thought into it. There were a number of spots that read\n\"to be determined\" and I didn\'t see any citations or references. Marie\nalmost seemed scared when the team reviewed her work, but I was actually\nimpressed with how much she seems to have improved. Maybe that showed on my\nface; after she looked at me, she seemed to relax. John and I pointed out a\nnumber of rough spots, but I was no longer as nervous about her ability,\nand she was visibly relieved. Then it was my turn. I explained that my work\nwas still incomplete, and it clearly was, but Marie said that, given the\ncircumstances, even this much was great to have. We didn\'t spend much time\non mine. John\'s writing was excellent this time. His thoughts were well\narticulated and he covered all the points he was supposed to &mdash; he\nmust be putting a lot of time into this class. Throughout the meeting, Iain\nwas really quiet &mdash; which is unusual for him. </p>\n\n<p> Marie suggested we each hand off our portion to another team member for\na more thorough review. John volunteered to take Iain\'s and Iain, in turn,\nclaimed John\'s. However, I still needed to take more time to finish my\nsection, and Marie, reminding the group of some of Iain\'s early, insightful\ncomments, asked that Iain look at her work. Marie took John\'s work for\nreview. </p>\n\n<p> I was in much better shape this week and felt relatively caught up, so\nI spent about two hours finishing up my section and proofreading it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(146,11,6,'<p> Iain was in class this week, but he emailed the team about an hour and\na half before the meeting to say that there was a family emergency and that\nhe would not be able to make it to the meeting. He sent over his progress\non Marie\'s part of the paper. </p>\n\n<p> The meeting was fairly productive, as we were beginning to see the\npaper take shape. Marie took an odd approach to revising John\'s section and\nJohn seemed to agree, but Marie didn\'t push it and said she\'d change it\nback for next week. The three of us spent a while just talking about how\nsatisfied we were with the topic. There was a lot of information on it once\nwe understood how to find it, and the consensus was that it\'s more\ninteresting than any of us expected. Feeling like much of the paper was in\ngood shape, I took the pieces home to assemble them into a full draft to\nuse moving forward &mdash; Marie said she still had the earlier version of\nJohn\'s work and she\'d give me that piece in the next day or so. </p>\n\n<p> Before the meeting broke up, John asked about switching next week\'s\nmeeting time so he could meet with another study group. With mid-terms\ncoming, everyone agreed that they needed extra time to prepare. However, we\ncouldn\'t agree on a new time, so we decided to meet only for 30 minutes\ninstead. Marie sent an email to let Iain know of the change. </p>\n\n<p> I spent two hours assembling and proofreading the document. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(147,11,7,'<p> I gave everyone a copy of the document I\'d assembled when we started\nour meeting. After about 15 minutes of what was scheduled to be a 30-minute\nmeeting, Iain had not arrived, so we decided to walk through the document\ntogether. </p>\n\n<p> John and Marie were vocal about how impressed they were. As the only\none who had read everything through, I felt it was necessary to add a\nsection &mdash; now just a placeholder. John suggested that Iain should\nwrite it and Marie joked that that would mean John would wind up writing\nit. They both chuckled, but I wasn\'t comfortable with it. It\'s true that\nIain hasn\'t been doing his best work recently, but I still think they\'re\nbeing unfair. I reminded them that Iain helped me in the beginning (even\nthough it might seem like ages ago) and maybe he was just really shaken up\nby whatever family emergency he went through. They both got quiet and we\nturned back to reviewing the document. </p>\n\n<p> Once we finished going through the document, the three of us agreed to\nreview it and make notes/corrections/suggestions for next week. As we were\nall getting ready to leave, Iain popped in the door of the meeting room.\nAfraid they might say something mean, I quickly asked him if he was doing\nOK and what had happened. He said his brother was going through something.\nWe made sure he had a copy and knew what we\'d all be doing for next week.\n</p>\n\n<p> I did review the document, but I\'d just put it together last week, so I\ndidn\'t have much to add to it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(148,11,8,'<p> Iain was already there when I arrived at the meeting this week. Marie\nhas got a great eye for detail, as she found a ton of spelling and\nformatting errors that everyone else missed. I volunteered to take\neveryone\'s copies and make all the changes for the draft that we are to\nturn in next week in class. John pointed out the section that was still\nmissing or incomplete. Iain said it was too late to get it into the draft\nbut that it should be fine to include a note that it will be in the final\nversion. He also made it clear that he wasn\'t writing it. Everyone else was\nuncomfortable with that approach. Marie volunteered to draft it and get it\nto me by the middle of the week. I figured I wouldn\'t have had the time to\ndo both the writing and the editing, but this I can handle. I agreed to\nincorporate the new content if she got it to me in time. Iain offered Marie\nsome good suggestions on how to approach the new content. </p>\n\n<p> It took about another hour to apply all the changes, and Marie got the\nnew content to me in plenty of time to incorporate, as well. It probably\ntook me an hour and a half. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(149,11,9,'<p> I forgot to provide copies to everyone before class and they seemed\nupset about it, but I did have one to turn in to the instructor. Now we get\nto wait for feedback. We do, however, already know of some work that needs\ndone. </p>\n\n<p> Last week, Marie and John (who wound up collaborating on the new\nsection) noticed some problems in the draft that needed to be corrected.\nAlso, it seems Iain didn\'t do much at all on Marie\'s work &mdash; and John\npointed out a number of areas that could be improved. As Iain was getting\nready to leave for another meeting, Marie suggested that we add some\ndiagrams to illustrate some of our points. The three of us sketched out\nconcepts and when the group settled, it was clear that Marie was eager to\ntake on this task. No one fought her for it. John offered to reread the\nentire document. The meeting ended early because Iain had another\nappointment to get to. </p>\n\n<p> I didn\'t have much to do this week for this class, so I got to focus on\nmy other classes for a change. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(150,11,10,'<p> As I was on my way to the meeting, I heard from Iain. He told me that\nhe\'d just got free, front-row tickets to the game tonight, so he wouldn\'t\nbe coming to our meeting. I can\'t believe he skipped another meeting, but\nthere wasn\'t much I could do, so I told John and Marie when I got to our\nmeeting.  </p>\n\n<p> John was already looking at the images Marie put together, and he\ndidn\'t seem to like them much. They were a bit more artistic than we\'d\nexpected, but that\'s Marie! He said they were quirky (and they were), but\nthey included all the right details to get the point across. They were\nfunctional but also eye-catching and memorable, and I said so. John seemed\nto still be a little uncomfortable with them and mentioned that he\'d like\nIain\'s opinion, but ultimately just made a few small requests. His changes\nwould make the images less fun, but Marie and I both accepted them because\nthey made John more comfortable. </p>\n\n<p> John made many changes to the document and some of them were pretty\nbig. We walked through them at a high level and everyone agreed, so we\nmoved on to prepare for the presentation. We worked out a basic structure\nfor it and decided that we should each put together notes or a script for\nwhat we would say during our part so we could practice. I passed this on to\nIain. </p>\n\n<p> Writing up this script took me a while, because I dread the thought of\nspeaking in front of people. I managed to get something down, though. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(151,11,11,'<p> In class, our instructor returned the drafts to the groups and we met\nbriefly during class to review it. Unfortunately, while we knew there were\nlots of problems with that version, the instructor only left five comments\nin our paper. I guess they wisely expected much of it to change since it\nwas only a draft. One read \"this shows promise,\" two corrected grammar\nissues, one requested that page numbers be added and one suggested we\nclarify that section Marie wrote initially, saying it was a novel approach\nand that it should therefore be explained more clearly and thoroughly. </p>\n\n<p> Everyone arrived on time for our meeting and the discussion began with\nhow little feedback we got and whether this meant the paper was in great\nshape or that instructor simply didn\'t really read the whole thing. Either\nway, we had the feedback we\'d been waiting for and it was time to move\nforward. </p>\n\n<p> Marie asked Iain to review her section again and he declined, saying\nthat he\'d already reviewed it once at her request. Marie responded with a\nsnarky tone that she\'d like him to \"actually read it this time.\" This\nturned into an argument with Marie accusing Iain of not participating and\nIain responding that her work was of low quality. John jumped in and\ndefended Marie, saying that at least she was showing up and trying. At this\npoint, I raised my voice and everyone quieted down. I reminded everyone of\nthe upcoming presentation, and that yelling at each other wouldn\'t help us\nprepare. Iain argued that he didn\'t have time to go through the entire\npaper, but reluctantly agreed to take a look at Marie\'s section again by\nnext week. </p>\n\n<p> The rest of the meeting was spent working through the presentation. The\ngroup used a PowerPoint Marie thought to put together in a practice run. We\nmade a few adjustments, but it was nice to have it. Iain really seems to\nhave put a lot of time into his part, and he sounded very polished. He also\nhad lots of suggestions for the rest of us. By the end of the meeting, the\npresentation was still running too long &mdash; particularly John\'s part.\nHe doesn\'t seem very experienced at this sort of thing. He included way too\nmuch and said it way too fast. He\'ll have to cut a bunch of it and\npractice, but with two weeks left, I still feel pretty good about it. </p>\n\n<p> I spent about half an hour revising my portion of the presentation\nduring the week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(152,11,12,'<p> Everyone arrived on time for the meeting this week. </p>\n\n<p> Iain provided feedback on Marie\'s section and, in reading through it,\nit became clear that making his changes would require changes throughout\nthe paper. It was exactly the kind of feedback Marie wanted in the first\nplace. However, so close to the end of class, it would be tough to make\nthem, because no one in our group had the time to carry all the changes\nthrough &mdash; especially with everyone getting ready for final projects\nand exams. I can\'t believe he hasn\'t bothered to even read the paper until\nnow. What we had wasn\'t wrong or anything, but these changes would make it\nstand out. I really don\'t understand why Iain didn\'t make the changes when\nhe saw they were needed </p>\n\n<p> I volunteered to make the changes because I think they will make an\nimpression on the instructor. I said I could find time to make the changes\nthis week if someone else would read through it to make sure I didn\'t miss\nanything. John volunteered to do that.  </p>\n\n<p> The presentation was much better and, after three practice runs, it\nsounded smooth. While it was still running too long, we agreed that\neveryone would probably speak faster in class and the instructor probably\nwouldn\'t care if we ran over by a little. </p>\n\n<p> Making the changes took me about three hours that I really didn\'t have\nto spend, but at least it\'s done. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(153,11,13,'<p> The presentation went very smoothly. I was nervous, but I knew what I\nwas talking about and I think that showed. The audience asked some good\nquestions, which meant that they understood the presentation.  For some\nreason, Iain stepped forward to answer almost every question. It was like\nhe was trying to show the instructor he\'d done more than he actually did.\nOnce, John started to answer and Iain seemed not to notice &mdash; he just\nwent ahead and answered it himself. Also, we should have discussed clothes\nbeforehand because we all dressed up except for John. He looked out of\nplace in his usual jeans and a sweater. </p>\n\n<p> At our meeting, Iain commented on John\'s casual clothes, and John\napologized. I felt it was unfair, because he was obviously already\nembarrassed about it.  He knew his part and was well prepared, and he has\nworked hard throughout the project. Aside from that, we all felt good about\nthe work we\'d done and I expect we\'ll get positive feedback and good\ngrades. I shared my updated version of the paper and a quick review of the\nchanges, but everyone knew what to expect and no one was surprised. John\ntook it to do his review and we ended early because there wasn\'t much else\nto do. </p>\n\n<p> As we wrapped up, Marie asked John to send her a copy as soon as he was\nfinished so she could take one last crack at it before we turn it in. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(154,11,14,'<p> At our final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. Iain volunteered to do a final read,\nprint the document and send it to the instructor. Marie started to attack\nIain for not helping the group &mdash; I think she felt like he was trying\nto steal credit for all our work at the end &mdash; just like he did in the\npresentation. John seemed tired and tried to calm her down and I joined\nhim. John suggested that Marie submit the latest version she had at the\ndeadline. If Iain could get his updates to her by that time, great, but\notherwise she should use what she had. Iain was annoyed, but agreed. </p>\n\n<p> After the deadline, Marie confirmed that Iain got his changes to her in\ntime for her to submit them, and she sent a copy of the finished product to\nthe entire team. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(155,12,1,'<p> In group time the first week, we began by setting up weekly team\nmeetings. The rest of the group seem to be freshmen. They\'re all so nervous\nabout this \"huge project\" but, as a junior, I know it\'s not that big of a\ndeal. I just hope that I don\'t wind up getting stuck rewriting the project\nat the last minute after they mess everything up. </p>\n\n<p> The project was fairly open-ended, so we brainstormed topic ideas for\nmost of the first meeting. I suggested some of the more obvious topics and\nwas a little shocked when they all loved them. John tried to be involved,\nbut his suggestions were pretty weak. When Marie spoke, I couldn\'t tell if\nshe was serious or not. Her suggestions were funny, but I\'m not sure that\nwas her intent. She definitely has a unique approach. Hannah didn\'t talk\nmuch. She seemed to be paying attention, but I guess she\'s shy. Pretty\nsoon, everyone built on my suggestions. </p>\n\n<p> Before the meeting ended, we narrowed it down to three ideas. Marie\nrecommended we each look for resources on one topic and then report back\nnext time. It seemed like a good idea and everyone else agreed. I spoke up\nquickly for a topic that I\'ve done some work on it in another class &mdash;\nit was also the most interesting. John spoke up for another and, after a\nmoment, Marie took the last topic. She didn\'t sound thrilled about it,\nthough. That left Hannah without a topic, so she said she\'d search for\nadditional materials on my topic. She seems nice, but we\'ll see where that\ngoes. </p>\n\n<p> The research for this week didn\'t take very long because I was able to\nuse some materials from that previous class. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(156,12,2,'<p> Hannah had a breakdown when she arrived because she couldn\'t find much\n&mdash; she\'s clearly out of her depth. I pointed out that I\'d got more\nthan enough to start with and I offered to work with her after the meeting\nto give her some tips and tricks. </p>\n\n<p> After reviewing the topics and the materials everyone found, there was\nfighting over which topic to focus on. Marie decided to start organizing\nthings into lists of pros and cons to make it easier to understand, and\nthen the group held a vote. For some reason, the three of them decided to\ngo with the topic John had researched &mdash; even though my topic would be\nmuch easier and isn\'t boring. This makes no sense at all and this whole\nproject\'s going to be a nightmare. </p>\n\n<p> The obvious next step was to find more materials, so we divided up the\nmajor subtopics. We decided everyone would return next week with summaries\nof what they\'d found to make it easier for the group to get moving quickly.\n</p>\n\n<p> I met with Hannah two days later and she\'s nice and pretty bright. I\nshowed her how to pull more keywords out of materials and to look in the\nbibliographies for more ideas. After about two and a half hours, we had\nsome solid references. She went through them and wrote summaries, and then\nI verified them. She was probably just overwhelmed at first, because she\ndid a pretty good job. Now she\'s on the right track. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(157,12,3,'<p> In this week\'s meeting, we began sorting through the materials.\nTogether, Hannah and I had easily the best materials and summaries, and we\ndidn\'t spend much time reviewing it. John\'s materials, on the other hand,\nwere difficult to understand and his help was required to interpret what he\nmeant. He seemed embarrassed and told us he\'d rewrite the summaries to make\nthem clearer. Marie\'s summaries were interesting and some of them were\nfunny, but I wasn\'t sure how they fit in. I tried not to look too confused,\nbut everyone seemed unsure of how to respond. After some awkward moments, I\nasked her a few direct questions that seemed to help her see what we need.\nThe team decided there was still plenty of time, though, and that she could\ntake another week to try again. After all, John would be doing the same.\n</p>\n\n<p> I got to relax this week without any tasks for this project. Looks like\nthis project isn\'t going to take too much of my time after all. That\'s\ngreat, because I\'ve got a heavy course load this semester. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(158,12,4,'<p> I arrived a little late to the meeting, but Hannah wasn\'t there at all.\nShe wasn\'t even in class and no one had heard anything from her. The\ninstructor would tell us if she dropped the class, right? </p>\n\n<p> When it looked like she wouldn\'t be coming, we began working through\nMarie\'s updated materials. John and I exchanged concerned looks. After a\nfew more discussions that were reminiscent of last week, I began pushing to\nmove on and John was happy to join that effort. Marie went with it, even\nthough she was clearly confused. Much less time was needed for John\'s\nmaterials because they were in much better shape now. John volunteered to\nput together what we had for the assignment due next week, and we both\npushed to get started on an early draft. We split up the tasks of\nsynthesizing the sections. </p>\n\n<p> I caught John outside after the meeting ended, and we discussed Marie\nand Hannah. We discussed the possibility of talking to the instructor, but\ndecided to wait another week or so. I think we can probably use some of\nMarie\'s resources. John volunteered to proofread her summaries and I said\nI\'d look for additional content. </p>\n\n<p> My searching was pretty easy, and I only needed to spend about half an\nhour on both that and summarizing what I\'d found. For the first draft of my\nportion of the paper, I spent about an hour writing &mdash; there will be\nplenty of time to fix it up later, and I have other classwork. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(159,12,5,'<p> John turned in our assignment during class, and our instructor gave us\nsome time in class to meet. We discussed our progress, but none of us\nexpected to have this time, so no one brought their materials to review. No\none seemed to want to be there, so we all left early instead. </p>\n\n<p> Hannah was back this week and wearing a cast. She slipped on some ice\nand landed in the hospital for a week. Impressively, she brought a first\ndraft of the section that was assigned to her when she was out &mdash; John\nemailed meeting notes to the whole group. </p>\n\n<p> Marie\'s constant attempts to be weird are really getting on my nerves.\nAlso, for some reason, everyone seemed to treat this first draft like it\nwas supposed to be the final complete version; everyone was visibly\ndisappointed with what I brought, but that\'s fine. There\'s lots of time\nleft. Marie was clearly nervous when we reviewed her work, but I was\nactually pleasantly surprised by what she\'d done. Maybe that showed on\neveryone\'s faces because when she looked up at us, she seemed to relax.\nJohn and Hannah both pointed out a number of rough spots, but I\'m no longer\nnervous about her ability and she seemed to be visibly relieved. Hannah\nexplained that her own work was incomplete, and it clearly was, but she was\nin the hospital. The fact that she brought anything at all was awesome. I\nhonestly didn\'t pay too much attention to John\'s piece because I figured it\nwas probably pretty good. I started thinking about an upcoming quiz in one\nof my more advanced classes. I tried to focus and participate, but they\ndidn\'t really need me there. </p>\n\n<p> Marie suggested we hand off our portion to another team member for a\nmore thorough review, even though I didn\'t think we were ready for that\nyet. John immediately volunteered to take mine, so I claimed his &mdash; it\nwas in pretty good shape already and that\'d give me some extra time to\nstudy for my other classes. Hannah asked for more time to finish her\nsection and then Marie specifically asked me to review hers; she took\nJohn\'s. I probably should be flattered, but I\'d really rather have the time\ninstead. </p>\n\n<p> Marie took some notes on her work before we traded papers, so that made\nit pretty quick and easy to make those changes. I quickly read through the\nwhole thing and found that it was kind of a mess. I set it aside so I could\nspend more time on it later in the week when my other work was done. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(160,12,6,'<p> The morning of our meeting, I picked up Marie\'s paper again but I just\ncouldn\'t manage to get through it. It seems that she tried hard to be\ndifferent and come up with a unique perspective, but the end result doesn\'t\ncover the main points and really doesn\'t make any sense. Just as I was\nstarting to make some sense of what she wrote, my brother asked me to come\nover. He\'s been having a rough time since his discharge and he told me he\nneeded to get out. I emailed the team to let them know I had to take care\nof a family thing, sent them what I had and then I drove back home to see\nhim. </p>\n\n<p> I had a massive headache the next morning, but I knew it\'d go away and\nmy brother seemed better. Marie had emailed me to let me know they decided\nto cut the next meeting down to only half an hour to give everyone time to\nprepare for mid-terms in other classes. A good idea, but I\'d have to really\nrush to make it for a short meeting because one of my own study groups was\nset to end when this one starts &mdash; across campus. As a bonus, though,\nMarie\'s paper was out of my hands. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(161,12,7,'<p> I arrived late because of the study group and Hannah asked if\neverything was OK. I explained that something came up with my brother but\nthat he was OK and they gave me a copy of the assembled document &mdash; it\nseems they\'re further along than I thought! We\'re all supposed to review\nthe whole document for next week. </p>\n\n<p> The paper looked pretty good, actually. It seems that Hannah put it\ntogether well and even identified a new section that will need to be\nwritten, as well as a few other changes here and there. They were good\nideas, but the new section will certainly have to wait for the final\nversion, because there\'s no way we can get it written and added into the\ndraft due in two weeks. All told, I probably spent about half an hour going\nthrough this version and I didn\'t have many comments. I didn\'t spend too\nmuch time on Marie\'s work, either. I just didn\'t have the energy. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(162,12,8,'<p> I arrived early this week. They\'ve been making decent progress without\nme though, so it\'s not a problem. This time John arrived late because his\nexam had run late. </p>\n\n<p> Marie has a great eye for detail, as she found a ton of spelling and\nformatting errors that everyone else missed. Hannah volunteered to take\neveryone else\'s copies and make all the changes for the draft that we are\nto turn in next week in class. John pointed out the sections that are still\nmissing or incomplete, but I said it\'s too late to get it into the draft\nand that it should be fine to include a note that it will be in the final\nversion. I certainly didn\'t have the time to write it. The rest of the\ngroup disagreed with me, though. They decided to try to get it done, and\nMarie volunteered to draft the two sections and get them to Hannah by the\nmiddle of the week so Hannah could incorporate the changes. I couldn\'t\nimagine how they can find the time, but I offered Marie some suggestions on\nhow to approach the new content, and everyone seemed to value my\nrecommendations. </p>\n\n<p> Fortunately, I managed to get away with no work for this group this\nweek because my other classes are keeping me very busy. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(163,12,9,'<p> Hannah brought our paper to class and turned it in to the instructor.\nNow we get to wait for feedback while we continue to work. </p>\n\n<p> John and Marie met last week and worked together; while working through\nit, they noticed a bunch of problems in the draft that will need\ncorrecting. Many of them were in Marie\'s work, and she got upset that I\ndidn\'t fix them when she asked me to look at it. Why didn\'t she write it\nlike that in the first place? Eventually, we moved on when Marie suggested\nwe add some diagrams to illustrate some of our points. Even though I had to\ngo to another meeting, I stuck around a bit while the group sketched some\nideas. However, I really did have to go and when they seemed to have it\nunder control, I left. </p>\n\n<p> Again, I was lucky not to have much to do in this class this week. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(164,12,10,'<p> My buddy offered me his extra seat to the game, and the seats were\namazing, so I accepted without realizing this was the night of our meeting.\nAs soon as I remembered, I let Hannah know I wouldn\'t be there.  </p>\n\n<p> When I got back, there was an email from Hannah asking me to look at\nthe report with Marie\'s images. She also asked me to prepare notes or a\nscript for my part in the presentation so we can practice together next\nweek.  </p>\n\n<p> The images were odd, but I sort of liked them.  </p>\n\n<p> Preparing for my part took less than half an hour, so I took some extra\ntime and practiced it on a friend. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(165,12,11,'<p> In class, the instructor returned the drafts and our team met briefly\nduring class to review it. Unfortunately, while we knew there were lots of\nproblems with that version, the instructor left only five comments in the\npaper. I guess they expected much of it to change since it was only a\ndraft. One read \"this shows promise,\" two corrected grammar issues, one\nrequested that page numbers be added and one suggested clarifying some of\nMarie\'s work. It read that it was a novel approach and that it should\ntherefore be explained more clearly and thoroughly. </p>\n\n<p> During the meeting, we were all on time and the discussion began with\nhow little feedback the group got &mdash; we figured that the instructor\nprobably didn\'t really read the whole thing. Either way, we had our\nfeedback and it was time to move forward. </p>\n\n<p> Predictably, Marie asked me once again to review her section. This\nannoyed me because I really don\'t want to look at it again. Marie pushed\nwith a snarky tone that she\'d like me to \"actually read it this time.\" Soon\nshe was accusing me of not participating. Maybe I was out of line, but I\nresponded that the low quality of her contribution made it very difficult\nto work with. John jumped in on Marie\'s side and then Hannah raised her\nvoice and quieted everyone down. She reminded us of the presentation coming\nin two weeks and that yelling at each other wouldn\'t help us get prepared.\nI said I\'d look at Marie\'s section again for next week. </p>\n\n<p> We spent the rest of the meeting working through the presentation. We\nused a PowerPoint Marie put together in a practice run. We had to change it\na bit, but it was nice to have something there to work with. I think my\nsection is pretty good and offered a few suggestions for everyone else.\nEven after three rounds of practice and changes, the presentation ran too\nlong &mdash; particularly John\'s part. I suspect he\'s not very experienced\nat this sort of thing, because he tried to include way too much and said it\nway too fast. However, we still have time. </p>\n\n<p> I spent about an hour and a half working on Marie\'s section during the\nweek. Unfortunately, it really would have been better to get to this\nearlier because my recommendations will mean changes throughout the paper,\nand I didn\'t have time to make them all this past week. Why didn\'t anyone\nelse see this? </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(166,12,12,'<p> Everyone arrived on time for the meeting this week. </p>\n\n<p> We began by walking through the changes I proposed, making it clear\nthat these changes would require larger changes throughout the paper. We\ntalked about forgetting them because what we\'ve got is not wrong, but\neveryone agreed that making the changes would give us a stronger paper.\nThere just isn\'t much time &mdash; especially with everyone getting ready\nfor their final projects and exams in other classes. Fortunately, Hannah\nvolunteered to make the changes this week, if someone else would promise to\nread through it next week to make sure she didn\'t miss anything. After a\npause, John volunteered. Good that they stepped up because I don\'t have\ntime for any of this. </p>\n\n<p> This week the presentation was much better and it sounded smooth. While\nit still ran too long, we agreed that everyone will probably speak faster\nin class, and the instructor probably wouldn\'t care if we ran over a bit.\n</p>\n\n<p> I practiced a few more times during the week when I was able to find a\nmoment. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(167,12,13,'<p> The presentation went very smoothly. Hannah was a bit nervous, but she\nknew what she was talking about and it showed. The audience asked some good\nquestions, which showed that they understood our presentation. I answered\nmost of the questions that came our way because no one else seemed up for\nit. We should have discussed clothes beforehand, because I came wearing a\nsuit, and Marie and Hannah were both wearing dress skirts and blouses. John\nlooked out of place in his usual jeans and a sweater. </p>\n\n<p> I think we\'ll get positive feedback and good grades. Hannah shared her\nupdated version of the paper and after a quick review of the changes, which\nweren\'t huge. As promised, John took the paper home to review it more\nclosely. We ended early because I had to leave for another group and really\nthere was not much else to do. </p>\n\n<p> As we wrapped up, Marie asked John to send her a copy as soon as he\'s\nfinished so she could take one last crack at it. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL),(168,12,14,'<p> At the final meeting, we reviewed the paper to make sure it was ready\nfor submission at the end of the week. I volunteered to do a final read,\nprint the document and send it to the instructor, but Marie said she was\nnot finished with it and that she\'d like to take some more time with it.\nShe eventually agreed to get it to me the evening of the next day. Hannah\nsuggested that I might not have enough time and asked that Marie submit the\nlatest version at the deadline. She said that if I was able to get Marie my\nupdates by that time, they\'d go in, but otherwise we\'d send what we\'d got.\nI feel like they don\'t trust me and that\'s annoying, but I agreed. </p>\n\n<p> I got Marie the content in plenty of time and she got it in in time.\nShe confirmed this and sent a copy of the finished product to the entire\nteam. </p>\n','2019-01-14 13:46:41','2019-01-14 13:46:41',NULL);
